INSERT INTO `cscart_addon_descriptions` (`addon`, `name`, `description`, `lang_code`) VALUES
('access_restrictions', 'Access restrictions', 'Lets you limit storefront and administrator area access to certain IP-addresses with different options', 'EN'),
('age_verification', 'Age verification', 'Toggles age restriction rules for products and categories', 'EN'),
('anti_fraud', 'Anti fraud', 'Adds configurable security order verification using the Maxmind service to prevent fraud', 'EN'),
('attachments', 'Attachments', 'Makes it possible to attach files to products', 'EN'),
('banners', 'Banners management', 'Allows you to create text and visual banners', 'EN'),
('barcode', 'Order barcode', 'Makes it possible to configure and attach barcodes to orders', 'EN'),
('bestsellers', 'Bestsellers', 'Makes it possible to collect data about the best selling products and add a product block filling type to represent them', 'EN'),
('customers_also_bought', 'Customers also bought', 'Makes it possible to create a special block for the products often purchased along with the current one', 'EN'),
('discussion', 'Comments and reviews', 'Lets customers leave comments to products, categories, orders, etc., review products and write testimonials', 'EN'),
('form_builder', 'Form builder', 'Lets you create custom forms (e.g. Contact us or Apply for partnership)', 'EN'),
('gift_certificates', 'Gift certificates', 'Adds a built-in gift certificate system', 'EN'),
('gift_registry', 'Gift registry', 'Lets customers create events, invite guests, make up their own and see the others'' gift wish lists', 'EN'),
('google_analytics', 'Google Analytics', 'Integrates a Google Analytics service with the store', 'EN'),
('my_changes', 'My changes', 'A dummy add-on for easier hook design editing', 'EN'),
('news_and_emails', 'News & e-mails', 'Lets you manage site news and configure newsletter sending', 'EN'),
('polls', 'Polls', 'Adds a possibility to add customized polls to the site', 'EN'),
('product_configurator', 'Product configurator', 'Makes it possible to create products with other products as options (e.g. lets customer select computer components among the store items upon purchase)', 'EN'),
('recurring_billing', 'Recurring billing', 'Makes it possible to place periodic orders and set up status notifications', 'EN'),
('required_products', 'Required products', 'Makes it possible to specify products required for purchase', 'EN'),
('reward_points', 'Reward points', 'Lets customers earn and spend points for purchases', 'EN'),
('rma', 'RMA', 'Adds a return management system', 'EN'),
('send_to_friend', 'Send the page link to a friend', 'Adds the Send to friend tab for products', 'EN'),
('seo', 'SEO', 'Adds Search engine-friendly URLs support', 'EN'),
('sms_notifications', 'SMS notifications', 'Allows you to set up administrator SMS order notifications', 'EN'),
('statistics', 'Statistics', 'Collects visitor statistics', 'EN'),
('store_locator', 'Store locator', 'Lets you place local stores on map and inform customers about their nearest stores', 'EN'),
('tags', 'Tags', 'Enables product tags', 'EN'),
('webmail', 'Webmail', 'Turns on a built-in email client', 'EN'),
('wishlist', 'Wish List', 'Lets customers store items in personal wish lists', 'EN'),
('magicslideshow', 'Magic Slideshow', 'Display one image after another. Fade or slide, fast or slow, text or just images. It''s your choice!', 'EN'),
('magiczoom', 'Magic Zoom', 'Zoom into images when you hover over an image. A beautiful effect.', 'EN'),
('clothes_chooser', 'Clothes Chooser', 'Choose clothes', 'EN'),
('catalog_mode', 'Catalog mode', 'Allows you to use the store as a product catalog', 'EN'),
('cloth_system', 'Cloth System', 'Allows you to change clothes on a model', 'EN');
