INSERT INTO `cscart_discussion_messages` (`message`, `post_id`, `thread_id`) VALUES
('I first noticed this monitor at one of those computer stores where they place all the monitors on the same shelf. This one really stood out for color and very sharp focus. I watch movies and play some games and I haven''t noticed any ghosting. The only thing that I wish I could do is rotate the screen for word processing (kind of a minor complaint). Otherwise this is a very good monitor and the price is good for a 19 inch LCD. ', 1, 1),
('This monitor is way too light (everything appears faded out), and adjusting the contrast and brightness controls don''t help. No matter what brightness contrast setting is used, everything is either way too dim & gray or way too light. The monitor''s brightness & contrast controls seem to have the exact same function - contrast setting appears to actually be adjusting the brightness and nothing seems to be actually changing the contrast. This will probably be returned soon, unless someone can tell me how to get the correct brightness/contrast setting. ', 2, 1),
('Just a perfect product!', 3, 2),
('I do not like. \n\nAt all.', 4, 2),
('A beautiful boots.\n\nMy opinion is they are just best.', 5, 3),
('dfgsdfgsdfg sd gsd ggdf gdsfg dsf', 6, 4),
('test', 7, 5),
('I got the A500 over on Friday from a local BestBuy apparent they are not suppose to sell it until Monday. The screen has very wide viewing angle, I looked at the Ipad 2 before I looked at the A500, and I couldn''t tell the difference based on memory, but I''m sure IPS is better. Though the screen is better than the Xoom which I also own.', 8, 17),
('We don''t get much of a choice here in Russia, really only the Iconia, Xoom & the Samsung Galaxy, so far this Iconia is my favourite.', 9, 17);
