('EN', 'text_payflow_notice', '<b>Note:</b> Before PayFlow Pro payment module starts working, please make sure that all the necessary additional components are successfully installed. You can find them on the ''Downloads'' page of <a href="https://manager.verisign.com/" target=_blank><b>Merchant Backoffice</b></a>.<br /><br />From the ''Downloads'' page, please download ''Payflow Pro Software Development Kit (SDK)'' that is complies with your operating system. Unpack the downloaded archive file. Then, copy the files: <ul><li>For Windows NT and Windows 2000:<br />Copy the files <u>bin/pfpro.exe</u> and <u>lib/pfpro.dll</u> to the directory <u>[cart_dir]/payments/payflow_files/bin</u><br />Copy the contents of the certs directory to the directory <u>[cart_dir]/payments/certificates</u><li>For Unix:<br />Copy the file <u>bin/pfpro</u> to the directory <u>[cart_dir]/payments/payflow_files/bin</u><br />Copy the file <u>lib/libpfpro.so</u> to the directory <u>[cart_dir]/payments/payflow_files/lib</u><br />Copy the contents of the certs directory to the directory <u>[cart_dir]/payments/certificates</u></ul>'),
