(46, 'EN', 'Seller Get Paid', '<div class="container-seller">\r\n<div class="shop_name">Select the payment methods you accept.</div>\r\n<div class="seller_getpaid_content_text">\r\n<div class="seller_getpaid_outer"><span class="seller_getpaid_msg">To accept credit card payment you must change your shop''s currency to USD after your shop is opened</span>\r\n<div class="seller_getpaid_logo_outer">&nbsp;</div>\r\n</div>\r\n<p class="seller_getpaid_checklist"><input type="checkbox" /> PayPal</p>\r\n<p class="seller_getpaid_checklist"><input type="checkbox" /> Money Order</p>\r\n<p class="seller_getpaid_checklist"><input type="checkbox" /> Personal Check</p>\r\n<p class="seller_getpaid_checklist"><input type="checkbox" /> Other</p>\r\n</div>\r\n<div style="float: left; width: 500px; margin-left: 60px;"><input class="seller_getpaid_save_btn" type="button" value="Save" /></div>\r\n</div>', '', '', '', ''),
(47, 'EN', 'Seller Setup OpenShop', '<div class="shop-left-column">\r\n<div class="add-shop-section">Add Shop Section</div>\r\n<!--end of add-shop-section-->\r\n<div class="shop-owner-info">\r\n<div class="owner-particular">\r\n<div class="owner-name">Shop Owner</div>\r\n<!--end of owner-name--> <span><a href="#">Edit</a></span>\r\n<div class="owner-image"><a href="#"> <img src="images/owner-image.png" alt="" border="none" /></a></div>\r\n<!--end of owner-image-->\r\n<div class="owner-image-addnew"><a href="#"> Add profile picture</a></div>\r\n<!--end of owner-image-addnew-->\r\n<div class="owner-name-style">Jason Richardson</div>\r\n<p><a href="#">Add location</a></p>\r\n</div>\r\n<!--end of owner-particular--></div>\r\n<!--end of shop-owner-info-->\r\n<div class="add-shop-location"><a href="#"> Add Shop Section</a></div>\r\n<!--end of add-shop-location--></div>\r\n<!--end of shop-left-column-->\r\n<div class="shop-right-column">\r\n<div class="shop-right-first">\r\n<div class="right-shop-banners"><span class="right-shop-banners"><a href="#">Add shop banners</a></span>\r\n<div class="right-shop-title">\r\n<p style="font-weight: bold;">jasonrichardson3</p>\r\n<p><a href="#">Edit</a></p>\r\n<div class="clear">&nbsp;</div>\r\n<p><a href="#">Add shop title</a></p>\r\n</div>\r\n<!--end of right-shop-title-->\r\n<div class="clear">&nbsp;</div>\r\n<div class="right-shop-social">\r\n<div class="right-shop-social-particular">\r\n<p>Get Social</p>\r\n<div class="each-logos"><a href="#"> <img src="images/right-social-facebook.png" alt="" border="none" /></a></div>\r\n<div class="each-logos"><a href="#"> <img src="images/right-social-twitter.png" alt="" border="none" /></a></div>\r\n</div>\r\n<!--end of right-shop-social-particular--></div>\r\n<!--end of right-shop-social-->\r\n<div class="clear">&nbsp;</div>\r\n<div class="shop-announcent"><br /><a href="#">Add shop announcement</a></div>\r\n<!--end of shop-announcent--></div>\r\n<!--end of right-shop-title--></div>\r\n<!--end of shop-right-first-->\r\n<div class="right-shop-bottom">\r\n<div class="list-each-item"><span><a href="#"><img src="images/right-add-sign.png" alt="" border="none" /></a></span>\r\n<p>List your first item</p>\r\n</div>\r\n<!--end of list-each-item-->\r\n<div class="list-each-item-second">&nbsp;</div>\r\n<!--end of list-each-item-->\r\n<div class="list-each-item-second">&nbsp;</div>\r\n<!--end of list-each-item-->\r\n<div class="list-each-item-second">&nbsp;</div>\r\n<!--end of list-each-item-->\r\n<div class="blankspace">&nbsp;</div>\r\n<div class="list-each-item-third">&nbsp;</div>\r\n<!--end of list-each-item-->\r\n<div class="list-each-item-second">&nbsp;</div>\r\n<!--end of list-each-item-->\r\n<div class="list-each-item-second">&nbsp;</div>\r\n<!--end of list-each-item-->\r\n<div class="list-each-item-second">&nbsp;</div>\r\n<!--end of list-each-item--></div>\r\n<!--end of right-shop-bottom--></div>\r\n<!--end of shop-right-column-->', '', '', '', ''),
(49, 'EN', 'Billing Page', '<div class="main-container-billing">\r\n<p>Enter The Credit Card you want to use to pay your bills</p>\r\n<div class="main-billing-information">\r\n<div class="credit-card-information">Enter The Credit Card you want to use to pay your bills</div>\r\n<!--end of credit-card-information--><form id="billing-form" action="#" name="billing-form">\r\n<div class="credit-card-details">\r\n<div class="filldetails"><span><span class="onlyheading">Card Type</span></span>\r\n<div class="cardtype"><input style="margin: 7px 0 0 8px;" type="checkbox" />\r\n<div class="each-card"><a href="#"> <img src="images/visa-image.png" alt="" border="none" /></a></div>\r\n<!--end of each-card--></div>\r\n<!--end of cardtype-->\r\n<div class="cardtype"><input style="margin: 7px 0 0 8px;" type="checkbox" />\r\n<div class="each-card"><a href="#"> <img src="images/master-card.png" alt="" border="none" /></a></div>\r\n<!--end of each-card--></div>\r\n<!--end of cardtype-->\r\n<div class="cardtype"><input style="margin: 7px 0 0 8px;" type="checkbox" />\r\n<div class="each-card"><a href="#"> <img src="images/others-image.png" alt="" border="none" /></a></div>\r\n<!--end of each-card--></div>\r\n<!--end of cardtype-->\r\n<div class="cardtype"><input style="margin: 7px 0 0 8px;" type="checkbox" />\r\n<div class="each-card"><a href="#"> <img src="images/last-image.png" alt="" border="none" /></a></div>\r\n<!--end of each-card--></div>\r\n<!--end of cardtype--></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">Card Number</span></span> <input class="card-input-type" type="text" /></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">Expiration Date</span></span> <select class="card-selet-date"><option>Choose Month</option> <option>January</option> <option>Februrary</option> <option>March</option> <option>April</option> <option>May</option> <option>June</option> <option>July</option> <option>August</option> <option>September</option> <option>October</option> <option>November</option> <option>December</option> </select> <select class="card-selet-date"><option>Choose Year</option></select></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">CCV</span></span> <input class="card-input-type-ccv" style="margin: 5px 0 0 14px;" type="text" /></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">Name On Card</span></span> <input class="card-input-type" type="text" /></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">Phone</span></span> <input class="card-input-type" type="text" /></div>\r\n<!--end of filldetails--></div>\r\n<!--end of credit-card-details-->\r\n<div class="credit-card-information">Billing Address</div>\r\n<!--end of credit-card-information-->\r\n<div class="credit-card-details">\r\n<div class="filldetails"><span><span class="onlyheading">Country</span></span> <select class="select-country-big"><option>United States</option> <option>United Kingdom</option> <option>India</option> <option>France</option> <option>Germany</option> <option>Brasil</option> </select></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">Street</span></span> <input class="card-input-type" style="margin-top: 5px;" type="text" /></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">Apt/Suite/Other</span></span> <input class="card-input-type" type="text" /></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">City</span></span> <input class="card-input-type" type="text" /></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">State</span></span> <select class="select-country-big"><option>Select State</option> </select></div>\r\n<!--end of filldetails-->\r\n<div class="filldetails"><span><span class="onlyheading">Zip/Postal Code</span></span> <input class="card-input-type" style="margin-top: 5px;" type="text" /></div>\r\n<!--end of filldetails--></div>\r\n<!--end of credit-card-details-->\r\n<div class="clear">&nbsp;</div>\r\n<input class="billing-save-last" type="submit" value="" /></form></div>\r\n<!--end of main-billing-information--></div>', '', '', '', ''),
(50, 'EN', 'List Items', '<div class="main-list-items">\r\n<p>List an Item</p>\r\n<form id="list-items-form" action="#" name="list-items-form">\r\n<div class="list-items-right">\r\n<div class="list-particular"><span>Brand</span>\r\n<div class="list-type-selector"><span>Who made it?</span> <select class="list-items-type"><option>Select a maker...</option></select></div>\r\n<!--end of list-type-selector--></div>\r\n<!--end of list-particular-->\r\n<div class="list-particular"><span>Categories</span>\r\n<div class="list-type-selector"><span>What is it?</span> <select class="list-items-type"><option>Select a maker...</option></select></div>\r\n<!--end of list-type-selector--></div>\r\n<!--end of list-particular-->\r\n<div class="list-particular"><span>Size</span>\r\n<div class="list-type-selector"><span>What size?</span> <select class="list-items-type"><option>Select a Property...</option></select></div>\r\n<!--end of list-type-selector--></div>\r\n<!--end of list-particular-->\r\n<div class="list-particular-last"><span>Color</span>\r\n<div class="list-type-selector"><span>What is the color?</span> <select class="list-items-type"><option>Select a Property...</option></select></div>\r\n<!--end of list-type-selector--></div>\r\n<!--end of list-particular--></div>\r\n<!--end of list-items-right-->\r\n<div class="list-photo-details">\r\n<div class="photo-details-heading">Photos</div>\r\n<!--end of photo-details-heading-->\r\n<div class="each-detailed-photo"><span><a href="#"><img src="images/right-add-sign.png" alt="" border="none" /></a></span>\r\n<p>List your first item</p>\r\n</div>\r\n<!--end of each-detailed-photo-->\r\n<div class="photo-details-blank">&nbsp;</div>\r\n<!--end of photo-details-blank-->\r\n<div class="photo-details-blank">&nbsp;</div>\r\n<!--end of photo-details-blank--></div>\r\n<!--end of list-photo-details-->\r\n<div class="photo-details-description">\r\n<div class="photo-description-particular"><span>Item Title</span>\r\n<div class="desctiption-questions">\r\n<div class="photo-questions-heading">Descriptive titles are best. Try to describe your item the way a shopper would.</div>\r\n<!--end of photo-questions-heading--> <input class="photo-questions-answer" type="text" /></div>\r\n<!--end of desctiption-questions--></div>\r\n<!--end of photo-description-particular-->\r\n<div class="photo-description-second"><span>Description</span>\r\n<div class="desctiption-questions">\r\n<div class="photo-questions-heading">Try to answer the questions shoppers will have. Tell the item''s story and explain why it''s special.</div>\r\n<!--end of photo-questions-heading--> <textarea class="photo-description-answer" name="textarea"></textarea></div>\r\n<!--end of desctiption-questions--></div>\r\n<!--end of photo-description-second-->\r\n<div class="photo-questions-heading" style="margin-left: 130px;">Preview how your listing will appear in Google search results.<a href="#"> Show preview</a></div>\r\n<!--end of photo-questions-heading--></div>\r\n<!--end of photo-details-description-->\r\n<div class="item-prise-quantity">\r\n<div class="photo-prise-particular"><span>Prise</span>\r\n<div class="desctiption-questions-prise">\r\n<div class="enter-prise">\r\n<div style="width: 15px; height: 30px; float: left;">$</div>\r\n<input class="enter-prise-area" type="text" />\r\n<div class="enter-prise-currency">AUD</div>\r\n</div>\r\n<!--end of enter-prise--></div>\r\n<!--end of desctiption-questions--></div>\r\n<!--end of photo-description-particular-->\r\n<div class="photo-prise-currency"><span>Quantity</span>\r\n<div class="desctiption-questions-prise">\r\n<div class="enter-prise"><input class="enter-prise-quantity" type="text" value="1" /></div>\r\n<!--end of enter-prise--></div>\r\n<!--end of desctiption-questions--></div>\r\n<!--end of photo-prise-currency--></div>\r\n<!--end of item-prise-quantity-->\r\n<div class="item-shipping">\r\n<div class="photo-description-shipping"><span>Item Title</span>\r\n<div class="photo-questions-heading" style="font-weight: bold;">Processing Time</div>\r\n<!--end of photo-questions-heading--> <select class="list-items-type" style="margin: 0 0 0 -1px;"><option>Ready to ship in...</option></select>\r\n<div class="photo-questions-heading" style="font-weight: bold; margin: 10px 0 0 109px;">Ships From</div>\r\n<!--end of photo-questions-heading--> <select class="list-items-shipping"><option>Select a location...</option></select></div>\r\n<!--end of photo-description-particular--></div>\r\n<!--end of item-shipping-->\r\n<div class="clear">&nbsp;</div>\r\n<input class="listing-submit" type="submit" value="" /></form></div>', '', '', '', ''),
(51, 'EN', 'Shop Name', '<div class="container-seller"><!--end of main-container-itemdescription-->\r\n<div class="shop_name">Shop Name</div>\r\n<form id="seller-setup-page" action="#" name="seller-setup">\r\n<div class="seller_content_text">\r\n<p>Your shop name appears with your items in the Etsy marketplace. Pick a name that has personal significance or helps identify what''s in your shop.</p>\r\n<p>Shop Name <input style="width: 250px; height: 38px;" type="text" /></p>\r\n<p style="margin: -10px 0 0 110px; font-size: 12px;">You can change your shop name later.</p>\r\n<input class="seller_save_btn" type="submit" value="Save" /></div>\r\n</form></div>', '', '', '', ''),
