INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`) VALUES
(1, 'EN', '65" Class (64.5" Diag.) LED 8000 Series Smart TV', '', '', '<p>For the ultimate TV enthusiasts, incredible picture quality and advanced connectivity are just the first step; the Samsung UN65D8000 LED TV goes a step beyond, adding elegant design to the formula. On the commanding 65-inch screen you can enjoy Samsung'' Smart TV, which puts the web, a wide range of apps, Skype video calling, and plenty more at your fingertips. Or connect a Blu-ray 3D player to get immersed in cinema-quality 3D programming--two pairs of active glasses are included.</p>', '', '', '', '', ''),
(4, 'EN', '40" Class (40.0" Diag.) LED 5003 Series TV', '', '', '<p>Clear Motion Rate (CMR) is Samsung''s more comprehensive and accurate measure for how well an LCD or LED TV can display fast-moving images. Previously, motion clarity was expressed simply by the refresh rate, measured in Hz. CMR, however, takes into account all three factors that contribute to motion clarity: panel refresh rate, image processor speed and backlight technology.</p>', '', '', '', '', ''),
(5, 'EN', '46" Class (45.9" Diag.) LCD 610 Series TV', '', '', '<p>ConnectShare&trade; Movie lets you watch videos, play music or view photos from a USB drive. Simply plug your USB directly into your Samsung TV&rsquo;s USB port and watch on the big screen with friends and family.</p>', '', '', '', '', ''),
(6, 'EN', 'Toshiba 32C120U 32" Class 720P HD LCD TV', '', '', '<p>Think you need to break your budget to enjoy blockbuster HD entertainment? Not with Toshiba''s 32" class C110U LCD HDTV. Featuring all-new design, this value-packed television looks great and works well in a living room, kitchen or bedroom. Increase detail and depth of the images on your screen with our impressive Dynalight technology.</p>', '', '', '', '', ''),
(7, 'EN', 'Trefoil Hoodie', '', '', '<p>The adidas Originals Trefoil Hoodie has been a streetwear essential for decades, with its characteristic big hood, kangaroo pocket and large Trefoil. Now it''s your turn to join the Trefoil men''s hoodie crew and carry the legend forward.</p>', '', '', '', '', ''),
(8, 'EN', 'Toshiba 32TL515U 32" Class 1080P 3D LED HD TV', '', '', '<p>Although its attractive features, design, and passive 3D have merit, the picture quality issues of the Toshiba TL515U LED-based LCD TV lessen its appeal in the face of the stiff competition.</p>', '', '', '', '', ''),
(9, 'EN', 'Toshiba 42TL515U 42" Class 1080P 3D LED HD TV', '', '', '<p>Although its attractive features, design, and passive 3D have merit, the picture quality issues of the Toshiba TL515U LED-based LCD TV lessen its appeal in the face of the stiff competition.</p>', '', '', '', '', ''),
(10, 'EN', 'Toshiba 47TL515U 47" Class 1080P 3D LED HD TV', '', '', '<p>Although its attractive features, design, and passive 3D have merit, the picture quality issues of the Toshiba TL515U LED-based LCD TV lessen its appeal in the face of the stiff competition.</p>', '', '', '', '', ''),
(11, 'EN', 'Collegiate 72 Tee', '', '', '<p>It''s not how old you are, it''s how stylish, and this men''s adidas Originals Collegiate 72 Tee shirt feels just as fresh as it was the day the Trefoil was born in 1972. That''s why this t-shirt features a collegiate "72" on the front.</p>', '', '', '', '', ''),
(12, 'EN', '100g Pants', '', '', '<p>When coach calls you off the bench, you need warm-up pants that come off in three seconds or less. That&rsquo;s why these men''s adidas 100g basketball pants have tear-away snaps down the sides, so you''re ready for action as fast as a superhero.</p>', '', '', '', '', ''),
(13, 'EN', 'Your Idea, Inc. 12 Steps to Building a Million Dollar Business -- Starting Today!', '', '', '<p>&nbsp;</p>\r\n<p style="text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;">Every time a new story about how some nobody from nowhere got rich producing some clever new product in his garage, you may think, "Why can''t I do that?" Well, anyone can--the trick is to take those good ideas and build them into great products that can succeed in the marketplace. In this book, you will get the 12-step plan you need to make your new product or service a profitable reality. You will learn important skills for success, including how to:</p>\r\n<ul style="text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;">\r\n<li style="text-align: left;">Refine their idea to attract a target audience</li>\r\n<li style="text-align: left;">Research the competition</li>\r\n<li style="text-align: left;">Find the right manufacturer</li>\r\n<li style="text-align: left;">Create appropriate brand messaging</li>\r\n<li style="text-align: left;">Build buzz online and beyond</li>\r\n<li style="text-align: left;">Work trade shows and conventions</li>\r\n</ul>\r\n<p><span style="color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;">Written by a woman with no formal business experience who turned her own idea into a million-dollar company, this book is the pragmatic yet inspiring guide every aspiring entrepreneur is looking for.</span></p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(14, 'EN', 'Toshiba 40E220U 40" Class 1080P HD LCD TV', '', '', '<p>Enjoy a stunning picture bursting with color and clarity with the 40-inch Toshiba 40E200U LCD HDTV (40-inch diagonal screen size), featuring a 1080p Full HD resolution that provides twice the pixel resolution of 720p HD models. It provides a number of convenient home entertainment options and key picture quality features, including DynaLight dynamic backlight control for deeper black levels and four HDMI digital inputs for simple high quality connection to cable/satellite boxes, DVD players and more. Plus, the HDMI ports feature fast InstaPort switching for quick changes from one source to another.&nbsp;<br /><br />DynaLight automatically adjusts the backlight intensity based on the image content.<br /><br /> With the Gaming Mode function, you''ll experience reduced game control delay and improved reaction time--perfect for PC gaming--and the Photo Frame capability with Auto Slide Show enables you to display slideshows of your favorite images when not watching TV programming. <br /><br /> Boasting a slimming tapered bezel and attractive front panel gradation, the new Horizon design creates a more modern, elegant appearance that also adds a subtle luminance to the logo to further its stylish appeal. Other features include MP3 playback via the integrated USB port, a PC input, and a removable stand.</p>', '', '', '', '', ''),
(15, 'EN', 'Nike Chambray Super Runner Men''s Jacket', '', '<p>The  timeless Windrunner design gets a premium upgrade in the Nike Chambray  Super Runner Men''s Jacket. Created with tough, water-resistant fabric  and a mesh lining, this jacket combines breathability and protection  from the elements.</p>', '<div class="text description black-white">\r\n<div class="product-description-component">\r\n<p><strong>The Nike Chambray Super Runner Jacket: A durable, updated classic </strong></p>\r\n<br />\r\n<p>The timeless Windrunner design gets a premium upgrade in the Nike Chambray Super Runner Men''s Jacket. Created with tough, water-resistant fabric and a mesh lining, this jacket combines breathability and protection from the elements.</p>\r\n<br />\r\n<p><strong>Benefits</strong></p>\r\n<ul>\r\n<li>Hood with drawcord for an adjustable fit</li>\r\n<li>Overlay at yoke and raglan sleeves for style and enhanced protection</li>\r\n<li>Rib cuffs and hem for a fit that stays in place</li>\r\n<li>Mesh lining for enhanced ventilation</li>\r\n<li>Durable, wind-resistant fabric to protect against the elements</li>\r\n</ul>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<ul>\r\n<li>Side zip pockets for secure storage</li>\r\n<li>Fabric: Body: 100% cotton. Lining and overlay: 100% polyester.</li>\r\n<li>Machine wash</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>\r\n</div>', '', '', '', '', ''),
(16, 'EN', '3D Blu-ray Disc Player (BD-D7500)', '', '', '<p>Whether you are viewing a premium-quality 2D picture or seeing incredible 3D depth, images are breathtakingly real in Samsung Full HD. Combine with a 3D TV and 3D active shutter glasses to view the latest Hollywood 3D titles or amplify your viewing experience by upconverting 2D content to immersive 3D.</p>', '', '', '', '', ''),
(17, 'EN', '101 Things Everyone Should Know About Economics A Down and Dirty Guide to Everything from Securities and Derivatives to Interest Rates and Hedge FundsAnd What They Mean For You', '', '', '<p><span style="color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;">What you don''t know about economics can hurt you&mdash;now more than ever. This easy-to-understand guide answers all the questions you need to know to secure your financial future, such as:</span></p>\r\n<ul style="text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;">\r\n<li style="text-align: left;">What does it mean to my paycheck when the Fed lowers or raises interest rates?</li>\r\n<li style="text-align: left;">What''s the difference between bonds, securities, and derivatives&mdash;and which should I invest in now?</li>\r\n<li style="text-align: left;">What does Keynesian economics have to do with my savings?</li>\r\n</ul>\r\n<p><span style="color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;">For those people whose heads spin when reading the business pages of the newspaper, here''s a roadmap through the economic jungle. In simple, plain language, Peter Sander explains how economies work, why they grow, how they contract, and what the government can and can''t do to help them. Most important, he tells you how all this affects&nbsp;</span><em style="color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;">you</em><span style="color: #000000; font-family: Arial, sans-serif; font-size: 12px; background-color: #ffffff;">&mdash;and what kind of changes you''re going to see in your finances as a result.</span></p>\r\n<p style="text-align: left; color: #000000; font-size: 12px; background-color: #ffffff;">Economics has been called the "dismal" science. But it doesn''t need to be gloomy or impenetrable. This book is an essential guide for anyone who wants to understand where the economy is today, where it''s going, and what it means for the rest of us.</p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(18, 'EN', '3D Blu-ray Disc Player (BD-D7000)', '', '', '<p>Whether you are viewing a premium-quality 2D picture or seeing incredible 3D depth, images are breathtakingly real in Samsung Full HD. Combine with a 3D TV and 3D active shutter glasses to view the latest Hollywood 3D titles or amplify your viewing experience by upconverting 2D content to immersive 3D.</p>', '', '', '', '', ''),
(19, 'EN', 'Toshiba BDX2150 Blu-ray Player', '', '', '<p>Enjoy the clarity of Blu-ray and the convenience of streaming media with the Toshiba BDX2150 Blu-ray Disc player. Wi-Fi ready for clutter-free in-home connectivity (Wi-Fi adapter required, sold separately), this player lets you enjoy your favorite movies with stunning native 1080p Full HD output plus surround sound with Dolby audio enhancements. Internet connectivity enables you to take advantage of popular streaming services such as Blockbuster, Netflix*, CinemaNow, Pandora, Vudu and YouTube. In addition, BD-Live 2.0 technology allows you to access internet-only bonus material available on many Blu-ray titles. Offering both USB and HDMI with CEC ports, this player is equipped with the latest command and control functionality.</p>', '', '', '', '', ''),
(20, 'EN', 'The ABCs of Gold Investing. How to Protect and Build Your Wealth with Gold', '', '', '<p><em style="color: #000000; font-family: Verdana; font-size: small;"><strong>The ABCs of Gold Investing</strong></em><span style="color: #000000; font-family: Verdana; font-size: small;">&nbsp;(Second Edition) is a solid resource for investors wishing to understand the benefits of private gold ownership. In this reader-friendly book, author Michael J. Kosares addresses the rapid changes in both the American and world economies and explains why gold is important to you as an investor. And, with thirty years experience in the gold business, he can tell you how to add gold to your portfolio in a safe and economical manner.</span></p>', '', '', '', '', ''),
(274, 'EN', 'testing-things', '', '', '<p>this is testing things</p>', '', '', '', '', ''),
(21, 'EN', 'Toshiba SD3300 DVD Player', '', '', '<p>Toshiba SD3300 DVD Player''s narrower width gives this unit a smaller footprint and will help to conserve entertainment center shelf space.</p>', '', '', '', '', ''),
(22, 'EN', '7.1 Channel Blu-ray 3D Home Theater System', '', '', '<p>Whether you are viewing a premium-quality 2D picture or seeing incredible 3D depth, images are breathtakingly real in Samsung Full HD. Combine with a 3D TV and 3D active shutter glasses to view the latest Hollywood 3D titles or amplify your viewing experience by upconverting 2D content to immersive 3D.</p>', '', '', '', '', ''),
(23, 'EN', '5.1 Channel Blu-ray 3D Home Theater System', '', '', '<p>Whether you are viewing a premium-quality 2D picture or seeing incredible 3D depth, images are breathtakingly real in Samsung Full HD. Combine with a 3D TV and 3D active shutter glasses to view the latest Hollywood 3D titles or amplify your viewing experience by upconverting 2D content to immersive 3D.</p>', '', '', '', '', ''),
(24, 'EN', '5.1 Channel Blu-ray 3D Home Theater System', '', '', '<p>Whether you are viewing a premium-quality 2D picture or seeing incredible 3D depth, images are breathtakingly real in Samsung Full HD. Combine with a 3D TV and 3D active shutter glasses to view the latest Hollywood 3D titles or amplify your viewing experience by upconverting 2D content to immersive 3D.</p>', '', '', '', '', ''),
(25, 'EN', 'HW-D7000 AV Receiver with built-in Blu-ray Disc Player', '', '', '<p>Replicate the theater experience in your own home by immersing yourself in 7.2 channel surround sound. You can position the speakers throughout your space to bring your favorite music and movies to life with cinematic sound, transforming your living room into the ultimate home theater.</p>', '', '', '', '', ''),
(26, 'EN', 'Mac OS X Lion: The Missing Manual', '', '', '<table style="color: #333333; font-family: Arial, Verdana, Geneva, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #ffffff;" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td style="font-size: 12px; font-family: Arial, Verdana, Geneva, Helvetica, sans-serif; color: #333333;">\r\n<div>\r\n<div>\r\n<p>For a company that promised to "put a pause on new features," Apple sure has been busy-there''s barely a feature left untouched in Mac OS X 10.6 "Snow Leopard." There''s more speed, more polish, more refinement-but still no manual. Fortunately, David Pogue is back, with the humor and expertise that have made this the #1 bestselling Mac book for eight years straight. You get all the answers with jargon-free introductions to:</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Big-ticket changes.</strong>&nbsp;A 64-bit overhaul. Faster everything. A rewritten Finder. Microsoft Exchange compatibility. All-new QuickTime Player. If Apple wrote it, this book covers it.</li>\r\n<li><strong>Snow Leopard Spots.</strong>&nbsp;This book demystifies the hundreds of smaller enhancements, too, in all 50 programs that come with the Mac: Safari, Mail, iChat, Preview, Time Machine.</li>\r\n<li><strong>Shortcuts.</strong>&nbsp;This must be the tippiest, trickiest Mac book ever written. Undocumented surprises await on every page.</li>\r\n<li><strong>Power usage.</strong>&nbsp;Security, networking, build-your-own Services, file sharing with Windows, even Mac OS X''s Unix chassis-this one witty, expert guide makes it all crystal clear.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', '', '', '', ''),
(27, 'EN', 'Trefoil Logo Hoodie', '', '<p>This classic women''s adidas Originals Trefoil Logo Hoodie is made of  comfortable fleece with a drawcord hood, a kangaroo pocket and an  outsize logo. The pullover hoodie also features extra-long cuffs and hem  for feminine style.</p>', '<div class="productText" style="display: block;">\r\n<div class="prodDesc">This classic women''s adidas Originals Trefoil Logo Hoodie is made of comfortable fleece with a drawcord hood, a kangaroo pocket and an outsize logo. The pullover hoodie also features extra-long cuffs and hem for feminine style.</div>\r\n<div class="prodDetail">\r\n<h3>Details</h3>\r\n<ul>\r\n<li>Kangaroo pocket</li>\r\n<li>Drawcord-adjustable hood</li>\r\n<li>Ribbed long cuffs and wider hem</li>\r\n<li>Large Trefoil on front</li>\r\n<li>70% cotton / 30% polyester fleece</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>\r\n</div>', '', '', '', '', ''),
(28, 'EN', 'Run Perf 7/8 Ti', '', '', '<p>adidas Run Perf 7/8 Ti , new to site, more details coming soon.</p>', '', '', '', '', ''),
(29, 'EN', 'TomTom GO LIVE Top Gear edition', '', '', '<p>The TomTom GO LIVE Top Gear edition satnav! Featuring the voice of Jeremy Clarkson, plus a heap of Top Gear bonus goodies, this special edition satnav is the ultimate traffic- vanquishing weapon for the discerning driverist. With speed camera warnings, information via Local Search with Google&trade;, weather reports and more, it&rsquo;ll spirit you onto gloriously empty roads when all about you are stuck in jams. With the calming presence of Jeremy Clarkson himself by your side, what could possibly go wrong?</p>', '', '', '', '', ''),
(30, 'EN', 'GO 2535 TM WTE', '', '', '<p>The TomTom GO series is the ultimate in driving intelligence. The new, super-slim TomTom GO series holds the latest navigation technology, in a fresh, sleek design and includes a magnetic, click &amp; lock mount for maximum mounting security. Travel confidently with superior routing and the most accurate, dependable maps in the GPS industry.</p>', '', '', '', '', ''),
(31, 'EN', 'Nike Classic Solid Women''s Jersey Shorts', '', '', '<div class="text dark-grey-heather-white description">\r\n<div class="product-description-component">\r\n<p><strong>The Nike Classic Women''s Shorts: Versatile comfort</strong></p>\r\n<br />\r\n<p>With a simple and sporty design, the comfortable Nike Classic Solid Women''s Jersey Shorts are a must-have for every gym bag.</p>\r\n<br />\r\n<p><strong>Benefits</strong></p>\r\n<ul>\r\n<li>Elastic waist with drawcord for an athletic fit</li>\r\n<li>Vented hem for a full range of motion</li>\r\n</ul>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<ul>\r\n<li>Fabric: 61% cotton/33% polyester/6% spandex</li>\r\n<li>Machine wash</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>\r\n</div>', '', '', '', '', ''),
(32, 'EN', 'nvi 3450', '', '', '<p>Garmin Guidance 3.0 allows you to quickly look up addresses and services and be guided to your destination with voice-prompted, turn-by-turn directions that speak street names. It comes preloaded with maps that feature 3-D landmarks and terrain for North America. It also comes preloaded with more than 8 million points of interest and offers the ability to add your own.</p>', '', '', '', '', ''),
(33, 'EN', 'nvi 2455LT', '', '', '<p>Whether you&rsquo;re driving through an unfamiliar city or on your daily commute, n&uuml;vi 2455LT makes your trip easier than ever before. It includes FREE lifetime traffic updates, advanced lane guidance and more.</p>', '', '', '', '', ''),
(34, 'EN', 'Nike "Untouchable" Women''s Tank Top', '', '', '<div class="text description dark-grey-heather-dark-grey-heather-red">\r\n<div class="product-description-component">\r\n<p><strong>The Nike "Untouchable" Tank Top: Sleeveless tribute to ''72</strong></p>\r\nCelebrating a banner year in sports with vibrant print detail, the Nike "Untouchable" Women''s Tank Top offers a motion-friendly racerback silhouette in a body-hugging fit.<br />\r\n<p><strong>Benefits</strong></p>\r\n<ul>\r\n<li>Slim fit contours to your body</li>\r\n<li>Rib scoop-neck and armholes for durability and comfort</li>\r\n<li>Racerback for enhanced range of movement</li>\r\n<li>Screen-print at front</li>\r\n</ul>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<ul>\r\n<li>Fabric: 100% cotton</li>\r\n<li>Machine wash</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>\r\n</div>', '', '', '', '', ''),
(35, 'EN', 'Managing Enterprise Content: A Unified Content Strategy, 2nd Edition', '', '', '<p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; line-height: 1.5em; color: #000000; font-family: ''Lucida Grande'', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff;">We can''t just design content for one channel, device or medium anymore; we need to design responsive structured content to reach customers anytime, anywhere, and on any device. And we can''t do that until we can define how each element associated with a content object should be effectively written to respond to different customer needs and context of the content as well as changes in display and different capabilities of devices. This book presents a unified content strategy model.<br /><br />A unified content strategy:</p>\r\n<ul style="margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: ''Lucida Grande'', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;">\r\n<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;">Identifies customer requirements</li>\r\n</ul>\r\n<ul style="margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: ''Lucida Grande'', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;">\r\n<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;">Defines structured content models for responsive content</li>\r\n</ul>\r\n<ul style="margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: ''Lucida Grande'', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;">\r\n<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;">Determines how content will be reused and repurposed across media and devices and how it will adapt to changing customer needs</li>\r\n</ul>\r\n<ul style="margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: ''Lucida Grande'', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;">\r\n<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;">Identifies the tags (metadata) for retrieval and dynamic delivery</li>\r\n</ul>\r\n<ul style="margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: ''Lucida Grande'', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;">\r\n<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;">Determines how content should be managed throughout the entire content lifecycle</li>\r\n</ul>\r\n<ul style="margin-top: 0px; margin-bottom: 1em; margin-left: 1.5em; color: #000000; font-family: ''Lucida Grande'', Arial, Helvetica, Verdana, sans-serif; background-color: #ffffff; padding: 0px;">\r\n<li style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; line-height: 1.5em;">Defines the governance policies to manage the content from creation to retirement</li>\r\n</ul>\r\n</p>', '', '', '', '', ''),
(36, 'EN', 'Routing Protocols and Concepts: CCNA Exploration Companion Guide', '', '', '<p>&nbsp;</p>\r\n<p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left; margin: 0px;"><em>Routing Protocols and Concepts</em>, CCNA Exploration Companion Guide is the official supplemental textbook for the Routing Protocols and Concepts course in the Cisco Networking Academy&reg; CCNA&reg; Exploration curriculum version 4. This course describes the architecture, components, and operation of routers, and explains the principles of routing and the primary routing protocols. The Companion Guide, written and edited by Networking Academy instructors, is designed as a portable desk reference to use anytime, anywhere. The book&rsquo;s features reinforce the material in the course to help you focus on important concepts and organize your study time for exams.</p>\r\n<p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left; margin: 0px;">&nbsp;</p>\r\n<p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left; margin: 0px;">New and improved features help you study and succeed in this course:</p>\r\n<ul style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-align: left;">\r\n<li style="font-size: 1em;">Chapter objectives&mdash;Review core concepts by answering the focus questions listed at the beginning of each chapter.</li>\r\n<li style="font-size: 1em;">Key terms&mdash;Refer to the updated lists of networking vocabulary introduced and turn to the highlighted terms in context in each chapter.</li>\r\n<li style="font-size: 1em;">Glossary&mdash;Consult the comprehensive glossary with more than 150 terms.</li>\r\n<li style="font-size: 1em;">Check Your Understanding questions and answer key&mdash;Evaluate your readiness with the updated end-of-chapter questions that match the style of questions you see on the online course quizzes. The answer key explains each answer.</li>\r\n<li style="font-size: 1em;">Challenge questions and activities&mdash;Strive to ace more challenging review questions and activities designed to prepare you for the complex styles of questions you might see on the CCNA exam. The answer key explains each answer.&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(37, 'EN', 'DPX308U', '', '', '<p>Many cars come with a 2DIN opening so swap that basic factory radio out for a DPX308U! This full featured CD-receiver comes with front USB input which provides a simple connection for your iPod/iPhone, allowing you to listen to your favorite music while controlling it easily from you your car stereo. When connecting an iPod or iPhone to the USB port you get the added benefit of advanced search features designed to let you spend more time listening to your favorite songs instead of hunting for them.</p>', '', '', '', '', ''),
(38, 'EN', 'Nike Futura Unravel Women''s T-Shirt', '', '', '<div class="text black-gold description">\r\n<div class="product-description-component">\r\n<p><strong>The Nike Futura Shirt: A flattering fit with bold pops of color</strong></p>\r\n<br />\r\n<p>It''s a style explosion in the Nike Futura Unravel Women''s T-Shirt, a high-energy essential with a flattering design and playful bursts of color.</p>\r\n<br />\r\n<p><strong>Benefits</strong></p>\r\n<ul>\r\n<li>Extended rib V-neck for a flattering, comfortable fit</li>\r\n<li>Reflective screen-print at front for a pop of color</li>\r\n<li>A slim fit that''s contoured to your body</li>\r\n</ul>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<ul>\r\n<li>Fabric: 100% cotton</li>\r\n<li>Machine wash</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>\r\n</div>', '', '', '', '', ''),
(39, 'EN', 'DEH-80PRS', '', '', '<p>The DEH-80PRS CD receiver features audiophile grade internal components and materials that are carefully selected to achieve Pioneer''s highest standards for the ultimate in sound quality. Pioneer&rsquo;s exclusive sound field technologies including Auto EQ and Auto Time Alignment help optimize audio in ways that perfectly suit particular listening spaces and allow subtle manual control of settings. Versatile connectivity helps deliver exceptional sound quality from various digital devices.</p>', '', '', '', '', ''),
(40, 'EN', 'DEH-P8400BH', '', '', '<p>The DEH-P8400BH CD receiver features a full-dot LCD display with Pioneer''s new MIXTRAX technology, built-in Bluetooth&reg; for hands-free calling and audio streaming, and an HD Radio&trade; tuner. A variety of multimedia options ensures that you will be properly entertained. Customizable audio functions make it easy to suit your listening taste.</p>', '', '', '', '', ''),
(41, 'EN', 'Gift Set (Onesie Plus Socks)', '', '', '<p>Welcome the new addition with this adidas Originals Gift Set, featuring a one-piece romper and matching socks. The romper has a sleepy-time Trefoil character on the back, while the front bristles with fun in vibrant stripes.</p>\r\n<div class="prodDetail">\r\n<h3>Details</h3>\r\n<ul>\r\n<li>Crewneck</li>\r\n<li>Full snap-button front for easy on and off</li>\r\n<li>Allover yarn-dyed stripe pattern on front</li>\r\n<li>Solid-color back with Trefoil-inspired graphic</li>\r\n<li>Matching socks included</li>\r\n<li>95% cotton / 5% elastane single jersey</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>', '', '', '', '', ''),
(42, 'EN', 'DEH-1300MP', '', '', '<p>With music in so many different formats, it only makes sense to have a CD receiver that can play them all. Take your digital songs on the go by copying them directly onto a CD-R or CD-RW disc in either MP3 or WMA formats. Since these files are digitally encoded, you will be able to see detailed track information such as artist, song title, and album.</p>', '', '', '', '', ''),
(43, 'EN', 'FH-P8000BT', '', '', '<p>The FH-P8000BT is smartly designed to expand your system, customize your experience, provide superior sound quality and easy operation.</p>', '', '', '', '', ''),
(44, 'EN', 'U.S. History and Government, Second Edition', '', '', '<p>\r\n<p style="color: #333333; font-family: Verdana, Geneva, sans-serif; font-size: 14px; line-height: 17px;"><span style="color: #996633; font-family: Georgia, ''Times New Roman'', Times, serif; font-size: x-small;"><strong>Purpose:</strong></span></p>\r\n<p style="color: #333333; font-family: Verdana, Geneva, sans-serif; font-size: 14px; line-height: 17px;"><span style="color: #996633; font-family: Georgia, ''Times New Roman'', Times, serif; font-size: x-small;">To provide students taking the 11th-grade New York State course in U.S. history and government and the Regents examination, as well as others taking a similar course, with a concise and comprehensive text.&nbsp;<br /></span></p>\r\n<ul style="color: #333333; font-family: Verdana, Geneva, sans-serif; font-size: 14px; line-height: 17px;" type="square">\r\n<span style="color: #996633; font-family: Georgia, ''Times New Roman'', Times, serif; font-size: x-small;"><strong>Text features include:</strong>\r\n<li>introduction to U.S. geography with an emphasis on how geography has shaped the American experience</li>\r\n<li>summary of the founding, principles, and operations of the U.S. government . lucid historical narrative</li>\r\n<li>emphasis on the modern period</li>\r\n<li>primary source readings in every chapter</li>\r\n<li>emphasis on the experiences and contributions of women and minorities</li>\r\n<li>mid-chapter &ldquo;in Review&rdquo; features</li>\r\n<li>end-of-chapter exercises: multiple-choice, thematic-essay, and document-based questions</li>\r\n<li>more maps, charts, and tables</li>\r\n<li>expanded coverage of U.S. Supreme Court landmark cases</li>\r\n<li>&ldquo;The American People: Changes at the Millennium&rdquo; - a demographic feature in the last chapter</li>\r\n<li>appendix: annotated Declaration of Independence and U.S. Constitution.</li>\r\n<li>Teacher&rsquo;s Manual With Answers has guidelines for class presentation of each chapter, answer key, Student&rsquo;s Study Guide.</li>\r\n<li>Hardbound</li>\r\n</span>\r\n</ul>\r\n</p>', '', '', '', '', ''),
(45, 'EN', 'The Process of Research in Psychology', '', '', '<p><strong style="color: #000000; font-family: Arial, Verdana, ''Sans Serif''; line-height: 15px; text-align: justify;">A student friendly, thoughtfully organized introduction to research in psychology&nbsp;</strong><br style="color: #000000; font-family: Arial, Verdana, ''Sans Serif''; line-height: 15px; text-align: justify;" /><br style="color: #000000; font-family: Arial, Verdana, ''Sans Serif''; line-height: 15px; text-align: justify;" /><span style="color: #000000; font-family: Arial, Verdana, ''Sans Serif''; line-height: 15px; text-align: justify;">Employing numerous examples and the pedagogical approach of spaced repetition, this introductory text provides a step-by-step explanation of how to design, conduct, and present a research study in psychology. Chronologically organized and chock-full of pedagogy, this book creates logical scaffolding upon which students can build their knowledge.</span><br style="color: #000000; font-family: Arial, Verdana, ''Sans Serif''; line-height: 15px; text-align: justify;" /></p>', '', '', '', '', ''),
(46, 'EN', 'The Official SAT Study Guide: Second Edition(TM)', '', '', '<p>&nbsp;</p>\r\n<p class="dtm" style="margin-top: 10px !important; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;">When it comes to getting answers, go to the source!&nbsp;<em>The Official SAT Study Guide: Second Edition&trade;</em>&nbsp;features 10 SAT&reg; practice tests created by the test maker. With over 1,000 pages and more than 20 chapters, it''s packed with the most up-to-date information students need to get ready for the test.</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;">Students will gain valuable experience and raise their confidence by taking practice tests, by reviewing critical concepts, test-taking approaches, and focused sets of practice questions just like those on the actual SAT.</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;"><em>The Official SAT Study Guide: Second Edition&trade;</em>&nbsp;will help students get ready for the SAT with:</p>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 16px; color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff; padding: 0px;">\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">10 official SAT practice tests, including 3 new recent exams</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">detailed descriptions of math, critical reading, and writing sections of the SAT</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">targeted practice questions for each SAT question type</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">practice essay questions, along with sample essays and annotations</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">a review of math concepts tested in the exam</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">test-taking approaches and suggestions that underscore important points</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">free online score reports</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">exclusive access to online answers and explanations at collegeboard.org</li>\r\n<li style="list-style-image: url(http://store.collegeboard.com/common/shared/images/bullet.gif); list-style-type: square; margin-bottom: 10px;">$10 discount on&nbsp;<em>The Official SAT Online Course</em>&nbsp;to all book owners</li>\r\n</ul>\r\n<p><span style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;">There''s also a complete chapter on the PSAT/NMSQT&reg;</span></p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(47, 'EN', 'MARVEL VS. CAPCOM 3: FATE OF TWO WORLDS SPECIAL EDITION (PS3)', '', '', '<p><span style="color: #242424; font-family: Arial, Verdana, Helvetica, sans-serif; text-align: left; background-color: #ffffff; font-size: xx-small; padding: 0px; margin: 0px;">The ultimate "VS." Series was born here!</span></p>\r\n<ul style="padding-top: 0px; padding-right: 20px; padding-bottom: 0px; padding-left: 20px; margin-top: 10px; margin-bottom: 20px; margin-left: 0px; list-style-position: initial; list-style-image: initial; color: #242424; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff;">\r\n<li style="padding-top: 2px; padding-bottom: 8px; padding-left: 20px; background-image: url(http://drh.img.digitalriver.com/DRHM/Storefront/Site/capcomus/cm/images/site/bg_bullet.jpg); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: transparent; background-position: 0% 5px; background-repeat: no-repeat no-repeat; margin: 0px;"><strong style="padding: 0px; margin: 0px;">Innovative graphics and gameplay bring the Marvel&reg; and Capcom universes to life:</strong>Powered by an advanced version of MT Framework, the engine used in Resident Evil&reg; 5 and Lost Planet&reg; 2, Marvel&reg; vs. Capcom&reg; 3 brings beautiful backgrounds and character animations to the forefront</li>\r\n<li style="padding-top: 2px; padding-bottom: 8px; padding-left: 20px; background-image: url(http://drh.img.digitalriver.com/DRHM/Storefront/Site/capcomus/cm/images/site/bg_bullet.jpg); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: transparent; background-position: 0% 5px; background-repeat: no-repeat no-repeat; margin: 0px;"><strong style="padding: 0px; margin: 0px;">Evolved VS. Fighting System:</strong>&nbsp;Wild over-the-top gameplay complete with signature aerial combos, hyper combos and more. The evolved new battle system, the &ldquo;Team Aerial Combo,&rdquo; takes the exciting mind-reading game to a whole new level!</li>\r\n<li style="padding-top: 2px; padding-bottom: 8px; padding-left: 20px; background-image: url(http://drh.img.digitalriver.com/DRHM/Storefront/Site/capcomus/cm/images/site/bg_bullet.jpg); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: transparent; background-position: 0% 5px; background-repeat: no-repeat no-repeat; margin: 0px;"><strong style="padding: 0px; margin: 0px;">3-on-3 Tag Team Fighting:</strong>&nbsp;Players build their own perfect team by assigning unique &ldquo;Assist Attacks&rdquo; for each character and utilize each character&rsquo;s special moves to create their own unique fighting style</li>\r\n<li style="padding-top: 2px; padding-bottom: 8px; padding-left: 20px; background-image: url(http://drh.img.digitalriver.com/DRHM/Storefront/Site/capcomus/cm/images/site/bg_bullet.jpg); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: transparent; background-position: 0% 5px; background-repeat: no-repeat no-repeat; margin: 0px;"><strong style="padding: 0px; margin: 0px;">Simple Mode:</strong>&nbsp;Streamlined button mapping option allows novice players to perform moves like a pro</li>\r\n<li style="padding-top: 2px; padding-bottom: 8px; padding-left: 20px; background-image: url(http://drh.img.digitalriver.com/DRHM/Storefront/Site/capcomus/cm/images/site/bg_bullet.jpg); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: transparent; background-position: 0% 5px; background-repeat: no-repeat no-repeat; margin: 0px;"><strong style="padding: 0px; margin: 0px;">Living Comic Book Art Style:</strong>&nbsp;See the most adored characters from the Capcom and Marvel&reg; universes brought to life in a &ldquo;moving comic&rdquo; style, blurring the boundaries between 2D and 3D graphics</li>\r\n<li style="padding-top: 2px; padding-bottom: 8px; padding-left: 20px; background-image: url(http://drh.img.digitalriver.com/DRHM/Storefront/Site/capcomus/cm/images/site/bg_bullet.jpg); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: transparent; background-position: 0% 5px; background-repeat: no-repeat no-repeat; margin: 0px;"><strong style="padding: 0px; margin: 0px;">New Characters:</strong>&nbsp;Popular returning characters include Spider-Man, Ryu, Wolverine, Morrigan, Iron Man, Hulk, Captain America, Felicia, Chun-Li, Tron Bonne, Magneto and Doctor Doom. Viewtiful Joe will make his debut in the Marvel vs. Capcom franchise.&nbsp;<strong style="padding: 0px; margin: 0px;">New characters joining the playable cast for the first time in fighting game history include Chris Redfield, Thor, Trish, Super-Skrull, Amaterasu, Dormammu, Wesker, X-23, Arthur, Deadpool, Nathan Spencer, M.O.D.O.K. and Dante!</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(48, 'EN', 'TS-MR2040', '', '', '<p>This is marine audio at its best. This 8" two-way speaker is built specifically for marine use, with heavy-duty construction that strenuously resists water, corrosion, heat&mdash;and boring music. Pioneer research showed that more bass is required for boating applications, and this 8" size delivers.</p>', '', '', '', '', ''),
(49, 'EN', 'TS-MR1640', '', '', '<p>Whether you''re out on the water or at the dock, this 6-1/2&rdquo; two-way speaker adds a new dimension to your boat. It''s built specifically for marine use, with heavy-duty construction inside and out that strenuously resists water, corrosion, heat, and sunlight.</p>', '', '', '', '', ''),
(50, 'EN', 'TS-D1720C', '', '', '<p>Absolute fidelity to musical sources takes form from speakers that reproduce the ambience in which sounds originate. Stage size, musicians&rsquo; movement, aural reflection and other distinctive details all bring these sounds to life. Pioneer D-Series speakers are available in 2-way component packages or 2-way coaxial designs in multiple sizes that fit most vehicles.</p>', '', '', '', '', ''),
(51, 'EN', 'TS-D6902R', '', '', '<p>Absolute fidelity to musical sources takes form from speakers that reproduce the ambience in which sounds originate. Stage size, musicians&rsquo; movement, aural reflection and other distinctive details all bring these sounds to life. Pioneer D-Series speakers are available in 2-way component packages or 2-way coaxial designs in multiple sizes that fit most vehicles.</p>', '', '', '', '', ''),
(52, 'EN', 'KFC-W3013PS', '', '', '<p>1200W Peak Power<br /> 400W RMS Power<br /> 4 ohms Impedance<br /> 34Hz - 300Hz Frequency Response<br /> 6" Mounting Depth<br /> PP Cone with Diamond Array Pattern<br /> Dual-Ventilation System<br /> Rubber Surround</p>', '', '', '', '', ''),
(53, 'EN', 'KFC-W3012', '', '', '<p>Super-sturdy, super powerful, the KFC-W3012 is a 12-inch, 4-ohm sub that handles an impressive 1200W of power. A truly high-performance sub, the KFC-W3012 has a long stroke design and a silver textured pattern cone woofer that adds strength and rigidity to the cone for maximum bass performance.</p>', '', '', '', '', ''),
(54, 'EN', 'TS-W3002D2|D4', '', '', '<p>The TS-W3002D2/4 subwoofers are designed to produce enormously powerful music. Just take a look at its super-heavy-duty construction, all designed to handle up to 3,500 watts max. Double-stacked magnets for higher power, and a step-up radial surround for superior control and long excursions. We used a constructed cast-aluminum basket for this sub. Add in our patented IMPP cone and you''ve got a monster sub that can handle whatever you want to throw at it.</p>', '', '', '', '', ''),
(55, 'EN', 'PRS-D800', '', '', '<p>The PRS-D800 2-channel amplifier contains audiophile grade components that were carefully selected and design perfected to achieve highest audio quality.</p>', '', '', '', '', ''),
(56, 'EN', 'GM-6500F', '', '', '<p>From dramatic distinction to dramatic design, Pioneer''s new GM-Series amplifiers are thrillers in every sense, pushing the limits of flexibility and functionality.<br /><br />The 4-channel GM-6500F delivers a whopping 760 watts max - plenty of juice to power your speakers. It''s also got built-in low-pass/high-pass crossovers, speaker level inputs for easy connection to an OEM headunit and oversized power terminals.</p>', '', '', '', '', ''),
(57, 'EN', 'GM-D8500M', '', '', '<p>Class-D amplifiers overcome the inefficiencies of traditional Class-A or AB amplifiers. Pioneer&rsquo;s Class-D amps transform very little power into heat so a higher percentage of the power supply (67%) is transformed into the load. This results in a very compact amp which needs less input power to produce very high output power. The Class-D amplifier&rsquo;s PWM (Pulse Width Modulator) modulates the original audio input signal with a triangulated signal wave which has a much higher fixed frequency. The result is a digital signal which contains both the input signal and a band of frequency components around the modulation frequency. A LPF (Low Pass Filter) then filters out the high frequency pulses and the resulting amplified output signal is then sent to the subwoofer and/or speakers.</p>', '', '', '', '', ''),
(58, 'EN', 'AVH-P8400BH', '', '', '<p>The AVH-P8400BH is Pioneer''s top-of-the-line DVD multimedia receiver that features a beautiful 7" motorized touchscreen interface with our new Advanced Display Resolution technology, built-in Bluetooth&reg; for hands-free calling and audio streaming, an HD Radio&trade; tuner, and Advanced App Mode for iPhone&reg; 4/4S. The newly designed and innovative user interface makes direct operation of the unit stress-free by eliminating complicated layered selection displays, so access to desired functions is smoother and simpler than ever. A variety of multimedia options ensures that you will be properly entertained. Customizable audio and video functions make it easy to suit your mood.</p>', '', '', '', '', ''),
(59, 'EN', 'AVH-P4400BH', '', '', '<p>The AVH-P4400BH DVD multimedia receiver features a 7" motorized touchscreen display, built-in Bluetooth&reg; for hands-free calling and audio streaming, and an HD Radio&trade; tuner. The newly updated and innovative user interface makes direct operation of the unit stress-free by eliminating complicated layered selection displays, so access to desired functions is smoother and simpler than ever. A variety of multimedia options ensures that you will be properly entertained. Customizable audio and video functions make it easy to suit your mood.</p>', '', '', '', '', ''),
(60, 'EN', 'AVIC-Z130BT', '', '', '<p>Pioneer''s flagship navigation receiver, the double-DIN AVIC-Z130BT features built-in navigation with maps of the US, Alaska, Hawaii, Canada, and Puerto Rico. Get there fast with spoken street names, lane guidance, and a wealth of GPS features, and stay in touch on the way with built-in Bluetooth for hands-free calling. The motorized 7-inch WVGA touchscreen display is great for GPS and for navigating your entertainment, whether it''s DVDs or CDs, your digital media from USB drives or microSD cards, or content from your iPhone. Speaking of iPhones, the AVIC-Z130BT features enhanced integration with Pandora and Aha Radio apps, along with GPS features through the free AVIC FEEDS app.</p>', '', '', '', '', ''),
(62, 'EN', 'XRS 9945', '', '', '<p>The XRS 9945 provides total protection and peace of mind with Super-Xtreme Range Superheterodyne&trade; Technology, detecting all 15 radar/laser bands with its super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. Other features include Cobra exclusive full-color ExtremeBright DataGrafix&reg; Display, an 8-point electronic compass, Voice Alert&trade;, car battery voltage display/low car battery warning and much more.<br /><br /> With the optional GPS Locator and AURA&trade; Database, upgrade your unit to alert you to verified Speed and Red Light Camera locations, dangerous intersections, and reported Speed Trap locations for entire United States and Canada (purchase and subscription necessary).</p>', '', '', '', '', ''),
(63, 'EN', 'XRS 9770', '', '', '<p>The XRS 9770 provides total protection and peace of mind with Xtreme Range Superheterodyne Technology, detecting all 15 radar/laser bands with its completely new, super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. Other features include DigiView&reg; Text Display, an 8-point electronic compass, Voice Alert, and much more.</p>', '', '', '', '', '');
INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`) VALUES
(64, 'EN', 'XRS 9745', '', '', '<p>The XRS 9745 provides total protection and peace of mind with Xtreme Range Superheterodyne&reg; Technology, detecting all 15 radar/laser bands with its super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. Other features include DigiView&reg; Text Display, an 8-point electronic compass, Voice Alert&trade;, and much more.</p>', '', '', '', '', ''),
(65, 'EN', 'XRS 9370', '', '', '<p>The XRS 9370 provides total protection and peace of mind with the Xtreme Range Superheterodyne technology, detecting all 14 radar/laser bands at greater range than its predecessor. It comes in an industry-leading compact design with UltraBright&trade; Data Display, LaserEye&reg;, and much more.</p>', '', '', '', '', ''),
(66, 'EN', 'XRS 9970G', '', '', '<p>The XRS 9970G provides total protection and peace of mind with Super-Xtreme Range Superheterodyne Technology, detecting all 15 radar/laser bands with its super-fast lock-on detection circuitry. The unit provides extra detection range and the best possible advance warning to even the fastest of POP mode radar guns. . It comes with a GPS Locator and Lifetime updates to the AURA&trade; Database to alert you to verified Speed and Red Light Camera locations, dangerous intersections, and reported Speed Trap locations for entire United States and Canada.  Other features include Cobra exclusive Touchscreen, full-color ExtremeBright DataGrafix Display, an 8-point electronic compass, Voice Alert, car battery voltage display/low car battery warning and much more.</p>', '', '', '', '', ''),
(67, 'EN', 'HTC Wildfire S - White (T-Mobile)', '', '', '<p>The HTC Wildfire S for T-Mobile is a 3G capable smartphone that adds style to a practical device. This sleek device runs on the Android&trade; 2.3 platform, so you can have the latest Android&trade; technology and access to thousands of apps. It also features a 3.2 inch capacitive touchscreen, a 5 megapixel camera for capturing important moments and Wi-Fi calling/hotspot capabilities! Weighing only 3.7 ounces, the Wildfire S is extremely portable. If you are looking for a stylish and fun smartphone that is easy to use, the HTC Wildfire S could be the phone for you!</p>', '', '', '', '', ''),
(68, 'EN', 'Titan', '', '', '<p>In the right hands, amazing things happen.<br /><br />Put emails in their place<br /> Combine your personal inboxes while keeping your work account separate.<br /><br />Plenty of room in the office<br /> Microsoft&reg; Office Mobile and multitasking on a huge <br /> 4.7" screen makes plenty of room for work, wherever you go.<br /><br />Focus on thoughts, not thumbs<br /> With such a spacious keypad, you can stop focusing on your fingers and start focusing on ideas.<br /><br />Expansive display, infinite possibility<br /> Whether you&rsquo;re taking care of business or taking a break from it all, you can see the big picture on the 4.7" LCD screen.<br /><br />Pocket-sized profile<br /> At 9.9mm, it&rsquo;s slim enough to fit comfortably in your pocket. But considering everything the HTC TITAN with Windows Phone is capable of, it won&rsquo;t be spending much time there.</p>', '', '', '', '', ''),
(69, 'EN', 'Rhyme', '', '', '<p>HTC Rhyme&trade; and its suite of innovative accessories<br /> deliver seamless experiences.<br /><br />Docking Station<br />Effortlessly slide the HTC Rhyme into the Docking Station to charge it and automatically activate Dock Mode, turning your phone into an all-in-one alarm clock, music player, and picture frame.<br /><br /> Charm<br /> Attached to your bag, the Charm alerts you of calls, missed calls, and messages. It also keeps your phone within easy reach and goes with anything.<br /><br /> Tangle&ndash;free Headphones<br /> These headphones don&rsquo;t just sound amazing&mdash;they&rsquo;re virtually tangle-free, thanks to flat wires.<br /><br />Exclusive HTC Sense&trade; experience<br /> The HTC Rhyme delivers a visually refined and intuitive <br /> HTC Sense experience. Find what you want faster with streamlined menus across HTC Sense apps and get the live info you care about on the home screen with the Quick Launch widget. Stay on top of all your to-dos by creating tasks from emails and messages, then sync those tasks with your Microsoft&reg; Exchange account for one to-do list on phone and PC.</p>', '', '', '', '', ''),
(70, 'EN', 'EVO Design 4G', '', '', '<p>The HTC EVO Design 4G is a high-end smartphone that is packed full of the latest features! Powered by Android 2.3, this device comes pre-loaded with the newest Android Platform for smartphones. You can choose from thousands of apps and games at the Android Marketplace. The HTC EVO Design 4G also comes loaded with a 4.0&rdquo; qHD capacitive touch display, with the latest version of HTC Sense, and international phone capabilities. With a 5 megapixel main camera, you will have the ability to capture, record and playback in HD. This smartphone also features a 1.3 megapixel front-facing camera for video chats! Quickly download movies and create user generated content with a flash-enabled web browsing experience running on Sprint''s 4G network and the power of a 1.2 GHz processor.</p>', '', '', '', '', ''),
(71, 'EN', 'DROID INCREDIBLE 2', '', '', '<p>Socialize with a sense of style<br /> The Droid Incredible 2 by HTC is ready to party. Its sleek, all-black design will get looks, and front and back cameras can help capture a scene, start a conversation, or snap a self-portrait. You can record the night''s most memorable moments in 720p HD video for sharing later.<br /><br />A phone that''s designed around you<br /> HTC Sense&trade; lets you do more in fewer steps with a friendly experience that brings everything you care about right to the surface. You can easily make your phone your own and put everything exactly where you want it. FriendStream&trade; pulls together all your friends'' Twitter,&trade; Facebook,&reg; and Flickr&reg; updates in one place. Here''s an idea: Choose a People widget that lets you see everybody''s latest updates and messages right on the home screen. You can also select a compact People widget that just shows their profile pictures.<br /><br />Worth watching &mdash; and listening to<br /> Your music and movies look and sound great on a 4-inch super LCD screen with SRS WOW&trade; HD surround sound. Get access to unlimited songs through V CAST&trade; Music with Rhapsody or tune in to the expert DJs on Slacker&reg; Internet Radio. V CAST Video on Demand gives you on-the-go access to more shows and movies, including those available from BLOCKBUSTER On Demand.&reg;<br /><br />Invite friends to your own private Hotspot<br /> Your phone turns into a 3G Mobile Hotspot, for up to five other Wi-Fi&reg;&ndash;enabled devices. That just might make you more popular than ever.<br /><br />Call anyone, anywhere &mdash; no matter where you travel<br /> The global-ready Droid Incredible 2 by HTC will keep you connected from Lima to London.</p>', '', '', '', '', ''),
(72, 'EN', 'DROID RAZR', '', '', '<p>DESIGN: THINNEST 4G LTE SMARTPHONE<br />DROID RAZR is so thin, it makes microchips feel flabby. The thinnest 4G LTE smartphone, it can get you out of the tightest of situations while letting you keep your cool.<br /><br />CONSTRUCTION: DROID STRONG, RAZR SHARP<br />DROID RAZR proves that thin no longer equals frail. It''''s made strong with KEVLAR&reg; fiber, while Corning&reg; Gorilla&reg; Glass defends the screen against scrapes and scratches. A force field of water-repellent nanoparticles shields the phone against water attacks - even the electrical boards inside.<br /><br />NETWORK SPEED: DOMINATE AT WARP SPEED<br />Unleash the fierce power of Verizon''s 4G LTE network, piloted by a dual-core 1.2 GHz processor. Blast your music and check the score, while email reloads - all at the same time, without delay. The 1 GB of RAM keeps you rocketing through.<br /><br />DUAL CAMERAS: LIFE HAS NEVER LOOKED BETTER<br />Create some cinematic awesomeness of your own with an 8MP rear camera and 1080p HD video recording. Ready for all conditions, DROID RAZR has image stabilization technology for less blurry video.</p>', '', '', '', '', ''),
(73, 'EN', 'DROID BIONIC', '', '', '<p>With a ferociously fast Verizon Wireless 4G LTE network and dual-core 1 GHz processor, DROID BIONIC is the master of all Droids. And with ZumoCast&trade; by Motorola, nothing is beyond your digital reach. The free app lets you pull your music, movies, pictures and documents from your computer like a digital telepath - instantly and wirelessly. That''s right, DROID BIONIC is so powerful, it can control your connected devices and extract their precious content, remotely, at 4G LTE speed. That makes it not only the master of all Droids, but the master of machines.<br /><br />Key Features:<br /> Our free Zumocast&trade; app lets you stream content 24/7 and in real time from your computer <br /> 4G LTE speeds up to 10x faster than 3G to stream movies, watch TV and video chat <br /> Crisp text, vivid imagery and brilliant color delivered in 4.3-inch high res qHD <br /> Doubles as a 4G LTE mobile hotspot for up to 5 Wi-Fi enabled devices <br /> Dual-core 1GHz processor and 1GB RAM <br /> Webtop app transforms your phone; surf the web, run apps and take calls - all at the same time <br />In The Box:<br /> DROID BIONIC phone<br />HW4X Standard Battery<br /> Standard Battery Door<br />Travel Charger<br />Micro USB Data cable<br /> User Guide</p>', '', '', '', '', ''),
(74, 'EN', 'Droid 3', '', '', '<p>You''re going places, and DROID 3 by Motorola can take you there. With incredible dual-core speed and brilliant qHD display. You''re making a big Android smartphone statement. DROID 3 offers more power and greater responsiveness, and the efficient handling of a five-row keyboard. The thinnest full QWERTY smartphone. Ever.<br /><br />Key Features: <br />Adobe&reg; Flash&reg; Player for stellar video and gaming<br />Scratch-resistant Corning&reg; Gorilla&reg; Glass with glare reducing coating<br />View, capture and share on the large 4-inch qHD display<br />An 8MP camera with 1080p HD video and front-facing web cam to see and be seen<br />Video capture in 1080p HD; output to compatible device via HDMI&reg; micro connector cable<br />Thinnest Full QWERTY smartphone ever.<br /> Super-charged dual-core 1GHz processor makes multi-tasking a snap<br /> What you get in the box: <br />DROID 3 phone <br />Battery Door <br />Battery <br />Charger <br />User Guide</p>', '', '', '', '', ''),
(75, 'EN', 'DROID PRO', '', '', '<p>Access your work directory, email or calendar with Droid Pro by Motorola, an Android-for-business smartphone with corporate-level-security. It features both a QWERTY keyboard and touchscreen, a speedy 1 GHZ processor and Adobe&reg; Flash&reg; Player 10.<br /><br /> Key Features: <br /> Up to 2GB memory on board, 2GB microSD pre-installed, expandable up to 34GB <br /> 5MP camera with auto focus and dual-LED flash <br /> Touchscreen navigation, pinch to zoom and customized home screens <br /> CDMA plus quad-band GSM and tri-band UTMS <br /> Ultra-fast 1 GHz processor for better web browsing and speedy UI and downloads <br /> Android 2.2 (Froyo) Platform <br /> Mobile Email: IMAP and POP, Microsoft Exchange, Gmail&trade;, MSN Hotmail&reg;, Yahoo!&reg; and AOL&reg; <br /> Quickoffice&reg;, Skype mobile&trade;, YouTube, AuthenTec VPN client, Mediashare, File Manager <br /> Be a mobile hot spot for up to 5 other devices <br /> Adobe&reg; Flash&reg; Player 10 <br />What you get: <br /> DROID PRO by Motorola phone <br /> Battery <br /> Battery Door <br /> Travel Charger <br /> User Guide</p>', '', '', '', '', ''),
(76, 'EN', 'FLIPSIDE with MOTOBLUR', '', '', '<p>MOTOROLA FLIPSIDE&trade; is a powerhouse at work or play, with enhanced MOTOBLUR to not only sync social media, but now to help prioritize - with content filters and resizable widgets to keep you on track.<br /><br /> Key Features: <br />Use Global Address Lookup to access corporate directions and easily schedule meetings on the go <br /> Touchscreen supports pinch-to-zoom or slide open for QWERTY keyboard and laptop-like nav pad <br /> Extend time between charges as MOTOBLUR battery manager monitors power consumption <br />Prioritize home screen messages using MOTOBLUR filters and resizable widgets <br />CrystalTalk&trade; PLUS technology amplifies your voice and filters out background noise <br />Facebook&trade;, MySpace and Twitter Direct Messaging <br />What you get in the box:: <br />FLIPSIDE&trade; with MOTOBLUR&trade; for AT&amp;T phone <br /> Battery BT61 <br /> Battery Door <br />Travel Charger <br /> User Guide</p>', '', '', '', '', ''),
(117, 'EN', 'SCH-I515', '', '', '<p>Galaxy Nexus is the world''s first phone with a 4.65" high-definition  Super AMOLED display, making text, photos, videos and games look crisp,  vibrant and rich. With 1280x720 HD resolution, videos look amazing and  the unique Contour Display curves nicely to the shape of your face and  makes it easier to hold.</p>', '', '', '', '', ''),
(118, 'EN', 'Smallville: The Complete Tenth Season', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 16 X 9 FULL FRAME</p>\r\n<p>Run Time: 1012 minutes</p>\r\n<p>Episodes Info :</p>\r\n<p>Lazarus</p>\r\n<p>Shield</p>\r\n<p>Supergirl</p>\r\n<p>Homecoming</p>\r\n<p>Isis</p>\r\n<p>Harvest</p>\r\n<p>Ambush</p>\r\n<p>Abandoned</p>\r\n<p>Patriot</p>\r\n<p>Luthor</p>\r\n<p>Icarus</p>\r\n<p>Collateral</p>\r\n<p>Beacon</p>\r\n<p>Masquerade</p>\r\n<p>Fortune</p>\r\n<p>Scion</p>\r\n<p>Kent</p>\r\n<p>Booster</p>\r\n<p>Dominion</p>\r\n<p>Prophecy</p>\r\n<p>Finale Part 1</p>\r\n<p>Finale Part 2</p>\r\n<p>Special Features:</p>\r\n<p>Commentaries on 2 Key Episodes</p>\r\n<p>Unaired Scenes</p>\r\n<p>Smallville: Coming Home: Cast and Creators Reflect on the Landmark 200th Episode Homecoming, in Which Clark Kent Experiences</p>\r\n<p>Transformative Events on the Way to His Final Destiny</p>\r\n<p>My Fathers, My Son: How Clark Kent&rsquo;s Fathers/Son Relationships Evolved over the Series&rsquo; 10 Years</p>\r\n<p>How Do We Do Music Video</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: VIVA 6 Disc 25mm Case</p>\r\n<p>Subtitle Languages:</p>\r\n<p>Chinese</p>\r\n<p>French</p>\r\n<p>Portuguese</p>\r\n<p>Spanish</p>\r\n<p>Copyright:</p>\r\n<p>SMALLVILLE and all related characters and elements are trademarks of and &copy; DC Comics.</p>\r\n<p>Genre: Drama, Television</p>\r\n<p>Synopsis:</p>\r\n<p>The series that redefines the origins of the world&rsquo;s greatest hero reaches its powerful conclusion with more revelations, more fascinating characters from DC Comics lore and a mind-blowing, spirit-lifting finale that is everything fans could want. In this 22-Episode Season 10, super heroes emerge from the shadows, only to be driven underground by a public that labels them vigilantes. At the same time, otherworld forces of darkness gather, presenting Clark Kent with the greatest challenge of his young life. The world he calls home and the people he loves &ndash; including Lois Lane, who now shares his secret and his life &ndash; need a champion. They shall have one. Don&rsquo;t miss all the hopes, heartaches and heroics of a final season to remember. They will lift you up, up and away.</p>\r\n</p>', '', '', '', '', ''),
(78, 'EN', 'adizero Rush Shoes', '', '', '<p>Get moving in the lightweight adizero&trade; Rush shoes by adidas. These  featherweight, dynamic men''s running shoes are just 7.5 ounces of  high-mileage style, with adiPRENE&reg;+ support in the forefoot, a light  synthetic upper and a thin rubber outsole for a close</p>', '', '', '', '', ''),
(79, 'EN', 'adiZero Tempaia Shoes', '', '', '<p>The adiZero&trade; Tempaia shoes by adidas are lightweight, breathable tennis  shoes designed for multi-court use. They feature a breathable upper,  adiPRENE&reg;+ in the forefoot for propulsion, adiPRENE&reg; heel cushioning and  EXTENDED TORSION&reg; for support.</p>', '', '', '', '', ''),
(80, 'EN', 'Nike Tenkay Slip TXTL Women''s Shoe', '', '', '<div class="black-white-black-white text description">\r\n<div class="product-description-component">\r\n<p><strong>The Nike Tenkay Slip TXTL: Casual-cool with a sporty side</strong></p>\r\nVersatile  and super comfortable, the Nike Tenkay Slip TXTL Women''s Shoe looks as  good as it feels. With a soft textile upper and a durable rubber  outsole, this shoe provides excellent traction on a variety of surfaces.<br />\r\n<p><strong>Benefits</strong></p>\r\n<li>Textile upper with suede overlays for a comfortable fit</li>\r\n<li>Elastic slip-on entry for easy on and off</li>\r\n<li>Flex grooves at outsole for enhanced flexibility</li>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<li>Removable ankle strap for a versatile fit</li>\r\n<li>Rubber outsole for durability</li>\r\n</div>\r\n</div>', '', '', '', '', ''),
(81, 'EN', 'Minnetonka Original Cowhide Driving Moc', '', '', '<div class="linePadding leadingEquity">Authentic designs. Free-spirited heritage. Shaping the moccasin''s place in history since 1946.</div>\r\n<div class="linePadding">Leather</div>\r\n<ul class="equityBullets firstSet">\r\n<li>&bull; Genuine leather construction </li>\r\n<li>&bull; Lace-up front </li>\r\n<li>&bull; Long-wearing nub bottom </li>\r\n<li>&bull; Cushioned leather insole </li>\r\n<li>&bull; Contrast stitching </li>\r\n</ul>', '', '', '', '', ''),
(82, 'EN', 'Legend of the Guardians: the Owls of Ga''hoole(VG)', '', '', '<p>&nbsp;</p>\r\n<ul class="desc_details" style="margin-top: 0px; margin-bottom: 0px; margin-left: 0px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-size: 11px; font-family: Verdana, Helvetica, Arial, sans-serif; vertical-align: baseline; list-style-position: initial; list-style-image: initial; width: 413px; color: #ffffff; line-height: 11px; background-color: #05182b; padding: 0px; border: 0px initial initial;">\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"><span style="background-color: #ffffff; color: #000000;"><span style="font-family: Verdana, Helvetica, Arial, sans-serif;"> </span></span></li>\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"><span style="color: #000000;"><strong>Studio:</strong> Warner Home Video</span></li>\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"><span style="color: #000000;"><strong>Theatrical Release Date: </strong>09/23/2010</span></li>\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"><span style="color: #000000;"><strong>Packaging Type:</strong> Wii</span></li>\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"><span style="color: #000000;"><strong>Genre:</strong> Action/Adventure</span></li>\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"> \r\n<ul class="desc_details" style="margin-top: 0px; margin-bottom: 0px; margin-left: 0px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-size: 11px; font-family: Verdana, Helvetica, Arial, sans-serif; vertical-align: baseline; list-style-position: initial; list-style-image: initial; width: 413px; color: #ffffff; line-height: 11px; background-color: #05182b; padding: 0px; border: 0px initial initial;">\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"><span style="color: #000000; background-color: #ffffff;"><strong style="border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; padding: 0px; margin: 0px; border: 0px initial initial;">Theatrical Release Date:</strong>&nbsp;09/23/2010</span></li>\r\n<li style="padding-bottom: 5px; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-style: inherit; font-family: inherit; vertical-align: baseline; line-height: 15px; clear: left; float: left; width: 413px; margin: 0px; border: 0px initial initial;"><span style="color: #000000; background-color: #ffffff;">Ships to U.S. Destinations Only</span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(83, 'EN', 'Speed Racer: The Videogame (Wii)', '', '', '<p>&nbsp;</p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: Wii</p>\r\n<p>Genre: Action/Adventure, Racing</p>\r\n<p>Synopsis:</p>\r\n<p>Fantasy Violence, Mild Language</p>\r\n<p>&nbsp;</p>\r\n<p>After uncovering the corrupt influence of Royalton Industries and smashing all his opponents in The Crucible, Speed Racer returns for his 2nd year of racing and this time the illustrious World Racing League Cup is up for grabs. Who will be the fastest, most cunning racer to win is unknown. Watch out for Cannonball Taylor who has revenge on his mind, while choosing allies like Racer X, to overcome the challenges that this years circuit has to offer.</p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(84, 'EN', 'Lego Batman (Wii)', '', '', '<p>&nbsp;</p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Packaging Type: Wii</p>\r\n<p>Copyright:</p>\r\n<p>BATMAN and all related characters and elements are trademarks of and &copy; DC Comics. WBIE LOGO, WB SHIELD: &trade; &amp; &copy; Warner Bros. Entertainment Inc. (s08) LEGO, the LEGO logo and the Minifigure are trademarks of the LEGO Group. &copy; 2008 The LEGO Group. All Rights Reserved. LEGO BATMAN: THE VIDEOGAME Software &copy; 2008 TT Games Publishing Ltd. All other trademarks and copyrights are the property of their respective owners. All rights reserved.</p>\r\n<p>Genre: Action/Adventure, GAME</p>\r\n<p>Synopsis:</p>\r\n<p>Cartoon Violence</p>\r\n<p>&nbsp;</p>\r\n<p>When all the villains in Arkham Asylum team up and break loose, only the dynamic duo is bold enough to take them on to save Gotham City. The fun of LEGO, the drama of Batman and the uniqueness of the combination makes for a comical and exciting adventure in LEGO Batman: The Videogame. Play as Batman and his sidekick Robin as you build, drive, swing and fight your way through Gotham City capturing escaped villains including The Joker, Penguin, Scarecrow and more. Then, jump into the story from the other side and play as Batmans foes! Enjoy the power you wield and battle Batman while spreading chaos throughout the city. There is no rest for the good (or evil!).</p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(85, 'EN', 'Looney Tunes: Acme Arsenal (Wii)', '', '', '<p>&nbsp;</p>\r\n<p>Official Website: <a title="http://looneytunes.warnerbros.com/acmearsenal/" href="http://looneytunes.warnerbros.com/acmearsenal/">http://looneytunes.warnerbros.com/acmearsenal/</a></p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: Wii</p>\r\n<p>Genre: Action/Adventure</p>\r\n<p>Synopsis:</p>\r\n<p>Cartoon Violence</p>\r\n<p>&nbsp;</p>\r\n<p>Tag-team with the Tunes in the fight for their lives! Wield a major arsenal of ACME weapons as the tunes team-up to hunt down the mad scientist, chasing him through exotic locals from the past, present and future. Unite Bugs, Taz, Daffy, Marvin and more in a co-operative "whack-and-smash" romp through time - including online play! Melee and projectile weapons: Each character''s weapon/melee skills can power up three times on the fly as you go. Vehicle Based Action: Race a jet scooter across an alien environment or wage battle on top of a giant flying Pterodactyl...the possibilities are endless! Travel to various locations such as Camelot, Ancient Egypt, Mars, the Wild West and more! Top-notch voice talent provides the characters with their classic voices and an authentic Looney Tunes slapstick adventure, while giving their look an updated, next-generation, modern edge.</p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(86, 'EN', 'Nokia 700', '', '', '<p>Nokia 700 - Experience the thinnest and most compact Nokia touch Smartphone (L=4.33", W=1.97", Thickness=.38", Weight=.21 lbs.). Stay connected with friends and family with a compact and elegant device. Slim and sustainable elegance fits perfectly in your hand. Fresh and fast new Nokia UI delivers what you need when you need it. Personalize your multiple home screens with different sized widgets. Browsing experience like on your desktop PC. Choose from thousands of apps. Sharing pictures and pairing accessories has never been so easy. You can effortlessly share your photos and videos with NFC. Tap and access information and benefits from NFC tags placed in stores and public places. Crisp and Clear display makes it look almost as if the icons are painted on the surface of the handset with Vibrant colors and sharp contrasts indoors and outdoors, day or night. Extensive use of recycled metals, bio plastics and bio paint makes this the most Nokia Smartphone ever.</p>', '', '', '', '', ''),
(87, 'EN', 'Sesame Street:Cookie''s Counting Carnival (Wii)', '', '', '<p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: Wii</p>\r\n<p>Synopsis:</p>\r\n<p>Cookie Monster and Big Bird will guide you through festive numbers games and teach you all about counting at the greatest Carnival of Numbers! Play fun games in the many areas of the carnival such as the Grandstand, Rides, Petting Zoo, Concession Stand, Theater, and the Arcade.</p>\r\n</p>', '', '', '', '', ''),
(88, 'EN', 'Lord of the Rings: War in the North(PS3)', '', '', '<p>&nbsp;</p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: PS3</p>\r\n<p>Genre: Action/Adventure, Racing</p>\r\n<p>Synopsis:</p>\r\n<p>In The Lord of the Rings: War in the North, players will experience an unrivaled Co-Op based Action/RPG gameplay experience &ndash; banding together on an untold journey to defeat the Dark Lord Sauron&rsquo;s forces and turn the tide in the War of the Ring.</p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(89, 'EN', 'Green Lantern: Rise of the Manhunters (PS3)', '', '', '<p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: PS3</p>\r\n<p>Genre: Action/Adventure</p>\r\n</p>', '', '', '', '', ''),
(90, 'EN', 'F.E.A.R. 3 (PS3) MX', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Packaging Type: PS3</p>\r\n<p>Genre: GAME</p>\r\n<p>Synopsis:</p>\r\n<p>As a specialized soldier in the elite squad, First Encounter Assault Recon (F.E.A.R.), you must uncover the mystery of Armacham&rsquo;s current operations, reassemble the lost F.E.A.R. and Delta teams, and stop the powerful paranormal entity, Alma, before she releases the most unimaginable horror into this world.</p>\r\n</p>', '', '', '', '', ''),
(91, 'EN', 'Montblanc Nicolas Rieussec Chronograph Automatic', '', '', '<p>43 mm watch with stainless steel case, Montblanc Calibre MB R200,  monopusher chronograph with automatic winding, anthracite-coloured dial  with applique hour circle, date display, second time zone with day/night  display, chronograph counters with rotating discs.</p>', '', '', '', '', ''),
(92, 'EN', 'Montblanc TimeWalker Automatic', '', '', '<p>42 mm stainless steel watch with black dial, red-gold plated hands and  numerals, automatic movement, date display, black alligator-skin strap</p>', '', '', '', '', ''),
(93, 'EN', 'Scene It? Bright Lights! Big Screen(X360)', '', '', '<p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Run Time: 1 minutes</p>\r\n<p>Packaging Type: XBOX 360 Amaray</p>\r\n<p>Genre: Party</p>\r\n<p>Synopsis:</p>\r\n<p>The popular movie trivia game franchise now launches its 3rd video game edition across all consoles with even more movie clips, feature-rich content, new mini-games, a dynamic visual package, DLC support, and four-player multiplayer.</p>\r\n</p>', '', '', '', '', ''),
(94, 'EN', 'Batman: Arkham City (X360)', '', '', '<p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: XBOX 360 Amaray</p>\r\n<p>Genre: Action/Adventure</p>\r\n<p>Synopsis:</p>\r\n<p>The city''s greatest heroes and villains collide within the diseased heart of Gotham.</p>\r\n</p>', '', '', '', '', ''),
(95, 'EN', 'Game Party: In Motion (X360)', '', '', '<p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: Wii</p>\r\n<p>Genre: Puzzle</p>\r\n<p>Synopsis:</p>\r\n<p>Get off the couch and get ready for the party as Game Party: In Motion turns your living room into the ultimate fun filled arcade. Grab your friends and family and jump right into the action as you use the motion of your entire body to play 16 exciting games. Throw a football at moving targets as you dodge an oncoming rusher or toss ringers in a game of horseshoes. Game Party: In Motion lets family and friends alike connect, play and get things moving!</p>\r\n</p>', '', '', '', '', ''),
(96, 'EN', 'Batman: Arkham City (X360) CE', '', '', '<p>\r\n<p>Studio: Warner Home Video</p>\r\n<p>Packaging Type: XBOX 360 Amaray</p>\r\n<p>Genre: Action/Adventure</p>\r\n<p>Synopsis:</p>\r\n<p>The city''s greatest heroes and villains collide within the diseased heart of Gotham.</p>\r\n</p>', '', '', '', '', ''),
(97, 'EN', 'Harry Potter and the Deathly Hallows - Part 2 (Blu-ray+DVD+UltraViolet Digital Copy Combo Pack)', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 07/14/2011</p>\r\n<p>Special Features:</p>\r\n<p>- Disc 1 (Blu-ray): Feature Film and Maximum Movie Mode</p>\r\n<p>- Disc 2 (Blu-ray): Special Features</p>\r\n<p>- Disc 3: (DVD): Standard definition version of the film Also includes an UltraViolet Digital Copy for Instant Streaming (redeemed</p>\r\n<p>via in-packed insert)</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Maximum Movie Mode hosted by Matthew Lewis (Neville Longbottom) and other cast members - As the epic showdown between Harry</p>\r\n<p>Potter and Lord Voldemort approaches, don&rsquo;t miss a single detail as the forces of Good and Evil clash one final time throughout the</p>\r\n<p>grounds of Hogwarts.</p>\r\n<p>&bull; A Conversation with JK Rowling and Daniel Radcliffe - Join J.K. Rowling and Daniel Radcliffe for an exclusive conversation</p>\r\n<p>about bringing the character of Harry Potter to life, the last decade of films and how their lives have changed by the fame that</p>\r\n<p>they&rsquo;ve both experienced.</p>\r\n<p>&bull; The Goblins of Gringotts - Hosted by Warwick Davis, you&rsquo;ll see the entire process of becoming a goblin&rdquo; on a Harry Potter</p>\r\n<p>film, from auditions and casting to makeup and prosthetic tests as well as filming the final scenes.</p>\r\n<p>&bull; The Women of Harry Potter &ndash; A look at the remarkable women in Harry Potter&rsquo;s life and the critical role they play in the</p>\r\n<p>films.</p>\r\n<p>&bull; Warner Bros. Leavesden Studios Sneak Peek</p>\r\n<p>&bull; Deleted Scenes&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Packaging Type: O-Sleeve 3-disc Elite BD Case</p>\r\n<p>Copyright:</p>\r\n<p>&copy; 2011 Warner Bros. Ent. Harry Potter Publishing Rights &copy; J.K.R. Harry Potter characters, names and related indicia are trademarks of and &copy; Warner Bros. Ent. All Rights Reserved.</p>\r\n<p>Genre: Drama, Fantasy Adventure, Mystery</p>\r\n<p>Synopsis:</p>\r\n<p>In the epic finale, the battle between the good and evil forces of the wizarding world escalates into an all-out war. The stakes have never been higher and no one is safe. But it is Harry who may be called upon to make the ultimate sacrifice as he draws closer to the climactic showdown with Lord Voldemort. It all ends here.</p>\r\n</p>', '', '', '', '', ''),
(112, 'EN', 'Gone with The Wind: 2-Disc Special Edition', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 12/14/1939</p>\r\n<p>Run Time: 238 minutes</p>\r\n<p>Special Features:</p>\r\n<p>Commentary by Historian Rudy Behlmer</p>\r\n<p>&nbsp;</p>\r\n<p>Mail-in poster offer</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: Double Eco Amaray Case</p>\r\n<p>Copyright:</p>\r\n<p>GONE WITH THE WIND, its characters and elements are trademarks of Turner Entertainment Co. &amp; The Stephens Mitchell Trusts. &copy; Turner Entertainment Co.</p>\r\n<p>Genre: Classic, Drama, Romance</p>\r\n<p>Synopsis:</p>\r\n<p>Period romance. War epic. Family saga. Popular fiction adapted with crowd-pleasing brilliance. Star acting aglow with charisma and passion. Moviemaking craft at its height. These are sublimely joined in the words Gone with the Wind. This dynamic and durable screen entertainment of the Civil War-era South comes home with the renewed splendor of a New 70th-Anniversary Digital Transfer capturing a higher-resolution image from Restored Picture Elements than ever before possible. David O. Selznick&rsquo;s monumental production of Margaret Mitchell&rsquo;s Pulitzer Prize-winning book can now enthrall new generations of home viewers with a majestic vibrance that befits one of Hollywood&rsquo;s greatest achievements.</p>\r\n</p>', '', '', '', '', ''),
(113, 'EN', 'SGH-I677', '', '', '<p>The Samsung Focus Flash 4G mobile phone features Windows Phone 7.5 OS (Mango) and 4G speed for faster downloads and streaming. This 4G smartphone also includes a Super AMOLED touch screen for simple navigation of features, a rear-facing 5.0MP camera for still photos, a secondary front-facing camera for video chatting, and Bluetooth-compatibility for use with your favorite Bluetooth-enabled device. Plus, the Samsung Focus Flash 4G doubles as a mobile hotspot for up to 4 additional Wi-Fi enabled devices.</p>', '', '', '', '', ''),
(114, 'EN', 'Birds of Prey: The Complete Series (DVD)', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 4 X 3 FULL FRAME</p>\r\n<p>Episodes Info :</p>\r\n<p>13 One-Hour Episodes</p>\r\n<p>&nbsp;</p>\r\n<p>Pilot</p>\r\n<p>Slick</p>\r\n<p>Prey for the Hunter</p>\r\n<p>Three Birds and a Baby</p>\r\n<p>Sins of the Mother</p>\r\n<p>Primal Scream</p>\r\n<p>Split</p>\r\n<p>Lady Shiva</p>\r\n<p>Nature of the Beast</p>\r\n<p>Gladiatrix</p>\r\n<p>Reunion</p>\r\n<p>Feat of Clay</p>\r\n<p>Devil''s Eye</p>\r\n<p>Special Features:</p>\r\n<p>GOTHAM GIRLS SEASONS 1-3 - The animated web-based series featuring the</p>\r\n<p>female heroes and rogues from Gotham City.</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: VIVA 4 Disc 15mm Case</p>\r\n<p>Genre: Drama, Television</p>\r\n<p>Synopsis:</p>\r\n<p>Who will stand up to villains now that a heartbroken Dark Knight has mysteriously vanished? Never fear, New Gothamites, a trio of champions is ready to take wing &ndash; and Helena, the daughter of Batman and Catwoman, is among them. She calls herself Huntress and crime is her prey. Teenaged Dinah is the youngest of the group, learning as she goes and gifted in clairvoyance. And overseeing the awesome threesome&rsquo;s high-tech nerve center is Batgirl. Left wheelchair-bound by The Joker, she has reinvented herself as Oracle, the team&rsquo;s cyber expert. Huntress, Dinah, Oracle: They are the Birds of Prey. Fighting together. Living together. And soaring into adventure together in 13 breathtaking live-action episodes.</p>\r\n</p>', '', '', '', '', ''),
(100, 'EN', 'The Hangover Part II (Blu-ray)', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 05/25/2011</p>\r\n<p>Special Features:</p>\r\n<p>- Now includes Instant Streaming with UltraViolet Digital Copy</p>\r\n<p>MUST REDEEM DIGITAL COPY OFFER BY 12/06/2013</p>\r\n<p>- "Comedy Rhythm of Todd Phillips"</p>\r\n<p>- "Not Your Everyday Monkey"</p>\r\n<p>- "Bangkok Tour with Mr. Chow"</p>\r\n<p>- Action Mash-Up</p>\r\n<p>- Gag Reel</p>\r\n<p>Packaging Type: O-Sleeve BD Case</p>\r\n<p>Copyright:</p>\r\n<p>&copy; 2011 Warner Bros. Entertainment Inc. and Legendary Pictures. All Rights Reserved.</p>\r\n<p>Genre: Comedy</p>\r\n<p>Synopsis:</p>\r\n<p>Phil (Bradley Cooper), Stu (Ed Helms), Alan (Zach Galifianakis) and Doug (Justin Bartha) travel to exotic Thailand for Stu''s wedding. What could go wrong? Director Todd Phillips'' explosively funny follow-up to his award-winning smash hit demonstrates that though what happens in Vegas may stay in Vegas, what happens in Bangkok can hardly be imagined!</p>\r\n</p>', '', '', '', '', ''),
(101, 'EN', 'Nokia X3-02', '', '', '<p>Stay connected and keep yourself entertained wherever you roam with the sleek Nokia X3-02 unlocked GSM mobile phone. This stunning, touch-and-type phone features a keypad for easy messaging and a touch display for one-handed navigation. Touch and type is ideal for SMS and social networking where fast and frequent input is needed, while touch is ideal for functions such as setting alarms, smooth browsing and controlling applications like music and games.</p>', '', '', '', '', ''),
(102, 'EN', 'PR 100 Women''s White Quartz Watch', '', '', '<p>Unrivaled best seller that is true to its name, the PR 100 is certainly precise and hugely popular.<br /> <br /> A combination of tradition with up-to-the-minute looks using quality  materials on the outside and Swiss reliability on the inside.  This  ironic watch family offers lady and gent sizes to prevent any rivalry,  although as far as style is concerned, the race is on!  The Swiss made  quartz ETA movement has battery end-of-life indicator, a scratch  resistant sapphire crystal and date indicator.  Features include a  stainless steel bracelet, a magnificent white dial, and water resistance  up to 100 meters.</p>', '', '', '', '', ''),
(103, 'EN', 'Fringe: The Complete Third Season (Blu-Ray)', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 16 X 9 FULL FRAME</p>\r\n<p>Run Time: 1012 minutes</p>\r\n<p>Episodes Info :</p>\r\n<p>Olivia</p>\r\n<p>The Box</p>\r\n<p>The Plateau</p>\r\n<p>Do Shapeshifters Dream of Electric Sheep?</p>\r\n<p>Amber 31422</p>\r\n<p>6955 kHz</p>\r\n<p>The Abducted&hellip;</p>\r\n<p>Entrada</p>\r\n<p>Marionette</p>\r\n<p>The Firefly</p>\r\n<p>Reciprocity</p>\r\n<p>Concentrate and Ask Again</p>\r\n<p>Immortality</p>\r\n<p>6 B</p>\r\n<p>Subject 13</p>\r\n<p>Os</p>\r\n<p>Stowaway</p>\r\n<p>Bloodline</p>\r\n<p>Lysergic Acid Diethylamide</p>\r\n<p>6:02 AM EST</p>\r\n<p>The Last Sam Weiss</p>\r\n<p>The Day We Died</p>\r\n<p>Special Features:</p>\r\n<p>Duality of Worlds: Four featurettes exploring The Other You, Visualizing an Alternate World, A Machine of Destiny and The Psychology</p>\r\n<p>of Duality</p>\r\n<p>Animating the &ldquo;Lysergic Acid Diethylamide&rdquo; Episode</p>\r\n<p>Constructing an Extrasensory Soundscape</p>\r\n<p>BLU-RAY EXCLUSIVE &ndash; Glimmer to the Other Side</p>\r\n<p>Experience &ldquo;Os&rdquo; (Episode 316) in Selectable Maximum Episode Mode with Pop-Up Experience-Enhancing Commentaries and Featurettes</p>\r\n<p>Commentary on &ldquo;The Plateau&rdquo; with Monica Owusu-Breen, Jeff Pinkner and Timothy Good</p>\r\n<p>Commentary on &ldquo;Lysergic Acid Diethylamide&rdquo; with Jay Worth, Luyen Vu, and Tanya Swerling</p>\r\n<p>Unusual Side Effects: Gag Reel</p>\r\n<p>Trailers</p>\r\n<p>Packaging Type: O-Sleeve BD Case</p>\r\n<p>Subtitle Languages:</p>\r\n<p>Danish</p>\r\n<p>English SDH</p>\r\n<p>Finnish</p>\r\n<p>French</p>\r\n<p>Norwegian</p>\r\n<p>Portuguese</p>\r\n<p>Spanish</p>\r\n<p>Swedish</p>\r\n<p>Copyright:</p>\r\n<p>FRINGE and all related characters and elements are trademarks of and &copy; Warner Bros. Entertainment Inc.</p>\r\n<p>Genre: Drama, Television</p>\r\n<p>Synopsis:</p>\r\n<p>Immersive. Compelling. Hypnotic. Brilliantly imaginative. Endlessly thrilling. Pick your term. The mystery of the universes deepens in the critically acclaimed 22-episode third season of television&rsquo;s most exciting sci-fi. The Fringe team escapes from the parallel universe &ndash; except for Olivia, trapped in the other world and replaced in ours by her double, who turns Peter and Olivia&rsquo;s tentative relationship into a love affair. Then Olivia returns, bonds of trust fray, ever more bizarre and terrifying phenomena occur and secrets that stretch back to 1985 threaten to destroy our universe. Or theirs. &ldquo;Fringe continues its hot streak known as Season 3. It&rsquo;s been firing on all cylinders all season&rdquo; (Andrew Hanson, LATimes.com).</p>\r\n</p>', '', '', '', '', ''),
(104, 'EN', 'Final Destination 5 (Blu-ray)', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 08/11/2011</p>\r\n<p>Special Features:</p>\r\n<p>- Now includes Instant Streaming with UltraViolet Digital Copy</p>\r\n<p>MUST REDEEM DIGITAL COPY OFFER BY 12/27/2013</p>\r\n<p>- Circle of Death</p>\r\n<p>- Alternate Death Scenes</p>\r\n<p>- Visual Effects of Death: Collapsing Bridge</p>\r\n<p>- Visual Effects of Death: Airplane Crash</p>\r\n<p>Packaging Type: O-Sleeve BD Case</p>\r\n<p>Copyright:</p>\r\n<p>&copy; 2011 New Line Productions, Inc.</p>\r\n<p>Genre: Horror</p>\r\n<p>Synopsis:</p>\r\n<p>Death is just as omnipresent as ever, and in Final Destination 5 it strikes again. During the bus ride to a corporate retreat, Sam (Nicholas D&rsquo;Agosto) has a premonition in which he and most of his friends &mdash; as well as numerous others &mdash; die in a horrific bridge collapse. When his vision ends, events begin to mirror what he had seen, and he frantically ushers as many of his colleagues &mdash; including his friend, Peter (Miles Fisher), and girlfriend, Molly (Emma Bell) &mdash; away from the disaster before Death can claim them. But these unsuspecting souls were never supposed to survive, and in a terrifying race against time, the ill-fated group tries to discover a way to escape Death&rsquo;s sinister agenda.</p>\r\n</p>', '', '', '', '', ''),
(105, 'EN', 'Nokia Lumia 800', '', '', '<p>EASIER, FASTER, FUNNER<br /><br />The Nokia Lumia 800. One glance to see what everyone''s up to.</p>', '', '', '', '', ''),
(106, 'EN', 'Nokia E5-00', '', '', '<p>Discover more ways to stay connected with friends, family, business contacts and everyone important to you with the Nokia E5-00. It has everything you need to stay in touch with a variety of email and messaging options, while also helping you to take and share pics and videos, explore the web, connect through social networking, access work and personal email, navigate your day and more. The affordable Nokia E5 even manages to fit a full QWERTY keyboard into its compact, eye-catching design for quick and easy messaging on the go. Plus, there are plenty of features to make it the perfect business-focused device. Stay productive and stay in the loop with work no matter where you are with simple setup and access for your corporate email account. The Nokia E5 makes communicating with work a breeze with Mail for Exchange, the free, direct and secure corporate email solution that offers a robust desktop-like email experience right on your phone, with email, calendar, contacts and more. Plus, your work email shows up on your phone instantly, so you don&rsquo;t have to wait for important emails. The Nokia E5 also features a fully integrated Microsoft Communicator Mobile client, to provide your mobile device the same great IM, contacts and usability that you enjoy on your computer. Keep in touch however you like with a variety of ways to connect to others with the Nokia E5. The home screen offers an easy visual way to view your contacts and makes it easy to organize the people you talk to most. The Nokia E5 also features one-click access to messaging as well as easy email setup and support for plenty of popular personal email services. The leading IM services have also been seamlessly integrated onto the phone. The Nokia E5 also offers free voice-guided navigation from Ovi Maps so you always know where you&rsquo;re going. Plus customize your phone with thousands of available apps from Ovi Store. Connect with everyone and everything you want with the Nokia E5.</p>', '', '', '', '', ''),
(107, 'EN', 'Montblanc Classic Collection Money Clip', '', '', '<p>Platinum-plated money clip with black onyx inlay</p>', '', '', '', '', ''),
(108, 'EN', 'Due Date (Blu-ray)', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 11/04/2010</p>\r\n<p>Special Features:</p>\r\n<p>- Deleted Scenes</p>\r\n<p>- Action Mashup</p>\r\n<p>- Too Many Questions Mashup</p>\r\n<p>- Gag Reel</p>\r\n<p>- "Two and a Half Men" Sequence featuring Ethan Tremblay</p>\r\n<p>MUST REDEEM DIGITAL COPY OFFER BY 2/20/12</p>\r\n<p>Packaging Type: Blue BD Case</p>\r\n<p>Copyright:</p>\r\n<p>&copy; 2010 Warner Bros. Entertainment. All Rights Reserved.</p>\r\n<p>Genre: Comedy</p>\r\n<p>Synopsis:</p>\r\n<p>From The Hangover director Todd Phillips, Due Date throws two unlikely companions together on a road trip that turns out to be as life-changing as it is outrageous. Expectant first-time father Peter Highman (Robert Downey Jr.) looks forward to his new child&rsquo;s due date five days away. As Peter hurries to catch a flight home from Atlanta to be at his wife&rsquo;s side for the birth, his best intentions go completely awry when an encounter with aspiring actor Ethan Tremblay (Zach Galifianakis) forces Peter to hitch a ride with Ethan on a cross-country trip that will ultimately destroy several cars, many friendships and Peter&rsquo;s last nerve.</p>\r\n</p>', '', '', '', '', ''),
(109, 'EN', 'Montblanc Contemporary Collection Key Ring with Montblanc emblem', '', '', '<p>Stainless steel key ring with brown calf leather</p>', '', '', '', '', ''),
(111, 'EN', 'Last Samurai, The (DVD) (WS)', '', '', '<p>\r\n<p>Official Website: http://lastsamurai.warnerbros.com/</p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 12/04/2003</p>\r\n<p>Screen Aspect: 16 X 9 LETTERBOX</p>\r\n<p>Run Time: 154 minutes</p>\r\n<p>Special Features:</p>\r\n<p>Audio Commentary: Commentary by Edward Zwick</p>\r\n<p>Deleted Scenes: The Beheading (Behind the Beheading)</p>\r\n<p>&nbsp;</p>\r\n<p>Algren and Katsumoto</p>\r\n<p>&nbsp;</p>\r\n<p>Documentaries: History vs. Hollywood: The Last Samurai {History Channel Documentary)</p>\r\n<p>Featurette: Tom Cruise: A Warrior''s Journey</p>\r\n<p>&nbsp;</p>\r\n<p>Edward Zwick: Director''s Video Journal {Behind-the-scenes production journal - narrated by Ed Zwick and Tom Cruise</p>\r\n<p>&nbsp;</p>\r\n<p>A World of Detail: Production Design with Lilly Kilvert</p>\r\n<p>&nbsp;</p>\r\n<p>Silk and Armor: Costume Design with Ngila Dickson</p>\r\n<p>&nbsp;</p>\r\n<p>Imperial Army Basic Training: From Soldier to Samurai: The Weapons</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Interviews: Making an Epic: A Conversation with Edward Zwick</p>\r\n<p>Other: Japan Premieres {Tokyo &amp; Kyoto red carpet)</p>\r\n<p>Packaging Type: Eco Amaray Case</p>\r\n<p>Subtitle Languages:</p>\r\n<p>English</p>\r\n<p>French</p>\r\n<p>Spanish</p>\r\n<p>Copyright:</p>\r\n<p>&copy; 2003 Warner Bros. Entertainment Inc. All Rights Reserved.</p>\r\n<p>Genre: Action/Adventure, Drama, Period, War, WESTERN</p>\r\n<p>Synopsis:</p>\r\n<p>Epic Action Drama. Set in Japan during the 1870s, The Last Samurai tells the story of Capt. Nathan Algren (Tom Cruise), a respected American military officer hired by the Emperor of Japan to train the country''s first army in the art of modern warfare. As the Emperor attempts to eradicate the ancient Imperial Samurai warriors in preparation for more Westernized and trade-friendly government policies, Algren finds himself unexpectedly impressed and influenced by his encounters with the Samurai, which places him at the center of a struggle between two eras and two worlds, with only his own sense of honor to guide him.</p>\r\n<p>"Two Thumbs Up" - EBERT &amp; ROEPER&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>"A stunning beautiful epic adventure" - ROGER EBERT / EBERT &amp; ROEPER&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>"It''s a spectacular epic. Tom Cruise is truly magnificent. - PAUL CLINTON / CNN&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>"Ken Watanabe is magnetic and majestic." - LISA SCHWARZBAUM / ENTERTAINMENT WEEKLY&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>"The Last Samurai is a movie that demands our surrender" - RICHARD SCHICKEL / TIME&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>"Bold and daring. The battle scenes are astonishing!" - JEFFREY LYONS / NBC&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>"The Last Samurai'' is a transfixing, majestic experience." - GENE SHAL</p>\r\n</p>', '', '', '', '', '');
INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`) VALUES
(110, 'EN', 'Roots 30th Anniversary Special Edition (DVD)', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 4 X 3 FULL FRAME</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: Slipcase - Super Slim</p>\r\n<p>Copyright:</p>\r\n<p>TM &amp; (c) Warner Bros. Entertainment Inc.</p>\r\n<p>Genre: Black Theme or Star</p>\r\n<p>Synopsis:</p>\r\n<p>Based on Alex Haley''s best-selling novel about his African ancestors, Roots followed several generations in the lives of a slave family. The saga began with Kunta Kinte (LeVar Burton), a West African youth captured by slave raiders and shipped to America in the 1700s. The family''s saga is depicted up until the Civil War where Kunte Kinte''s grandson gained emancipation. Roots made its greatest impression on the ratings and widespread popularity it garnered. On average, 130 million - almost half the country at the time - saw all or part of the series.</p>\r\n</p>', '', '', '', '', ''),
(115, 'EN', 'Evolve SST.2 X9 Complete Bike 10SPD ''12', '', '', '<p><span class="content">The all new 100mm travel Evolve sst.2 with ICT  Technology is dialed in to maintain the legendary efficiency, handling  and ride of a nimble full suspension cross country bike while harnessing  the rolling efficiency and feel of the 29" wheel.  The NEW super formed  pivot integrated seat tube is lighter and stronger while the NEW  semi-integrated tapered head tube is stiffer and more responsive. </span></p>', '', '', '', '', ''),
(116, 'EN', 'I Am Legend (DVD) (WS)', '', '', '<p>\r\n<p>fficial Website: <a title="http://iamlegend.warnerbros.com/" href="http://iamlegend.warnerbros.com/">http://iamlegend.warnerbros.com/</a></p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Theatrical Release Date: 12/13/2007</p>\r\n<p>Screen Aspect: 16 X 9 LETTERBOX</p>\r\n<p>Special Features:</p>\r\n<p>4 awesome animated comics: Death as a gift, Isolation, Sacrificing the Few for the Many and Shelter</p>\r\n<p>DVD-ROM PC weblink to intense bonus material databanki chronicling the movie''s creation and exploring the history and current status</p>\r\n<p>of life-threatening viral infections</p>\r\n<p>Packaging Type: Amaray Case</p>\r\n<p>Copyright:</p>\r\n<p>(c) 2007 A Warner Bros. Entertainment Inc. All Rights Reserved</p>\r\n<p>Genre: Action/Adventure, Drama, Horror, Sci-Fi/Fantasy</p>\r\n<p>Synopsis:</p>\r\n<p>Robert Neville is a brilliant scientist, but even he could not contain the terrible virus that was unstoppable, incurable, and man-made. Somehow immune, Neville is now the last human survivor in what is left of New York City and maybe the world. For three years, Neville has faithfully sent out daily radio messages, desperate to find any other survivors who might be out there. But he is not alone. Mutant victims of the plague -- The Infected -- lurk in the shadows... watching Neville''s every move... waiting for him to make a fatal mistake. Perhaps mankind''s last, best hope, Neville is driven by only one remaining mission: to find a way to reverse the effects of the virus using his own immune blood. But he knows he is outnumbered... and quickly running out of time.</p>\r\n<p>"I Am Legend is mind-blowing excitement..." Pete Hammond / Maxim</p>\r\n</p>', '', '', '', '', ''),
(119, 'EN', 'The Big Bang Theory: The Complete Fourth Season', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 16 X 9 LETTERBOX</p>\r\n<p>Run Time: 529 minutes</p>\r\n<p>Episodes Info :</p>\r\n<p>The Robotic Manipulation</p>\r\n<p>The Cruciferous Vegetable Amplification</p>\r\n<p>The Zazzy Substitution</p>\r\n<p>The Hot Troll Deviation</p>\r\n<p>The Desperation Emanation</p>\r\n<p>The Irish Pub Formulation</p>\r\n<p>The Apology Insufficiency</p>\r\n<p>The 21-Second Excitation</p>\r\n<p>The Boyfriend Complexity</p>\r\n<p>The Alien Parasite Hypothesis</p>\r\n<p>The Justice League Recombination</p>\r\n<p>The Bus Pants Utilization</p>\r\n<p>The Love Car Displacement</p>\r\n<p>The Thespian Catalyst</p>\r\n<p>The Benefactor Factor</p>\r\n<p>The Cohabitation Formulation</p>\r\n<p>The Toast Derivation</p>\r\n<p>The Prestidigitation Approximation</p>\r\n<p>The Zarnecki Incursion</p>\r\n<p>The Herb Garden Germination</p>\r\n<p>The Agreement Dissection</p>\r\n<p>The Wildebeest Implementation</p>\r\n<p>The Engagement Reaction</p>\r\n<p>The Roommate Transmogrification</p>\r\n<p>Special Features:</p>\r\n<p>Actor on Actor: The Big Bang''s Theory of Relativity Featurette -This fun and light-hearted piece features the stars of the show</p>\r\n<p>conducting interviews with each other detailing their experiences working on one of the hottest comedies on television.</p>\r\n<p>The Barenaked Ladies on Big Bang Theory Featurette - Having created one of the greatest theme songs in recent history, the Barenaked</p>\r\n<p>Ladies bring it home when they come to the set of the Big Bang Theory to record a music video for the song. Featuring an interview</p>\r\n<p>with the band, behind the scenes footage of the filming of an episode, and clips from the new video itself, this piece carries with</p>\r\n<p>it all of the fun and energy you could expect from both the band and the show.</p>\r\n<p>The History of Everything Music Video</p>\r\n<p>Gag Reel</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: VIVA 4 Disc 15mm Case</p>\r\n<p>Subtitle Languages:</p>\r\n<p>Chinese</p>\r\n<p>English SDH</p>\r\n<p>French</p>\r\n<p>Portuguese</p>\r\n<p>Spanish</p>\r\n<p>Thai</p>\r\n<p>Copyright:</p>\r\n<p>BIG BANG THEORY and all related characters and elements are trademarks of and &copy; Warner Bros. Entertainment Inc.</p>\r\n<p>Genre: Comedy, Television</p>\r\n<p>Synopsis:</p>\r\n<p>&ldquo;Four seasons in, it is still laugh-out-loud funny. Every episode, every week,&rdquo; USA Today&rsquo;s Robert Bianco says about the hit series The Big Bang Theory. Here&rsquo;s your chance to subject his conclusion to empirical analysis by watching all 24 Season 4 Episodes! This season the Big Bang gang&rsquo;s romantic universe expands. On the rebound from Penny, Leonard falls into the arms of Raj&rsquo;s sister Priya. Sheldon gets a girlfriend, or rather a friend who is a girl: Amy, a dour neurobiologist who declares herself besties with Penny. Howard and Bernadette heat up. And so do Raj and Bernadette (at least in Raj&rsquo;s Bollywood daydream). All in the furtherance of award-winning genius comedy.</p>\r\n</p>', '', '', '', '', ''),
(120, 'EN', 'Samsung Galaxy S II, Epic 4G Touch (Black)', '', '', '<p>The fastest, state-of-the-art networks are 4G, so naturally, the Epic&trade;  4G Touch is designed for speed. With 4G, every download, upload, app,  game, connection and feature runs almost as fast as you can push the  button.</p>', '', '', '', '', ''),
(121, 'EN', 'Fringe: The Complete Third Season', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 16 X 9 FULL FRAME</p>\r\n<p>Run Time: 1012 minutes</p>\r\n<p>Episodes Info :</p>\r\n<p>Olivia</p>\r\n<p>The Box</p>\r\n<p>The Plateau</p>\r\n<p>Do Shapeshifters Dream of Electric Sheep?</p>\r\n<p>Amber 31422</p>\r\n<p>6955 kHz</p>\r\n<p>The Abducted&hellip;</p>\r\n<p>Entrada</p>\r\n<p>Marionette</p>\r\n<p>The Firefly</p>\r\n<p>Reciprocity</p>\r\n<p>Concentrate and Ask Again</p>\r\n<p>Immortality</p>\r\n<p>6 B</p>\r\n<p>Subject 13</p>\r\n<p>Os</p>\r\n<p>Stowaway</p>\r\n<p>Bloodline</p>\r\n<p>Lysergic Acid Diethylamide</p>\r\n<p>6:02 AM EST</p>\r\n<p>The Last Sam Weiss</p>\r\n<p>The Day We Died</p>\r\n<p>Special Features:</p>\r\n<p>Duality of Worlds: Four featurettes exploring The Other You, Visualizing an Alternate World, A Machine of Destiny and The Psychology</p>\r\n<p>of Duality</p>\r\n<p>Animating the &ldquo;Lysergic Acid Diethylamide&rdquo; Episode</p>\r\n<p>Constructing an Extrasensory Soundscape</p>\r\n<p>Experience &ldquo;Os&rdquo; (Episode 316) in Selectable Maximum Episode Mode with Pop-Up Experience-Enhancing Commentaries and Featurettes</p>\r\n<p>Commentary on &ldquo;The Plateau&rdquo; with Monica Owusu-Breen, Jeff Pinkner and Timothy Good</p>\r\n<p>Commentary on &ldquo;Lysergic Acid Diethylamide&rdquo; with Jay Worth, Luyen Vu, and Tanya Swerling</p>\r\n<p>Unusual Side Effects: Gag Reel</p>\r\n<p>Trailers</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: Viva Multi-Disc (6-10)</p>\r\n<p>Subtitle Languages:</p>\r\n<p>Chinese Traditional</p>\r\n<p>English SDH</p>\r\n<p>French</p>\r\n<p>Portuguese</p>\r\n<p>Spanish</p>\r\n<p>Thai</p>\r\n<p>Copyright:</p>\r\n<p>FRINGE and all related characters and elements are trademarks of and &copy; Warner Bros. Entertainment Inc.</p>\r\n<p>Genre: Drama, Television</p>\r\n<p>Synopsis:</p>\r\n<p>Immersive. Compelling. Hypnotic. Brilliantly imaginative. Endlessly thrilling. Pick your term. The mystery of the universes deepens in the critically acclaimed 22-episode third season of television&rsquo;s most exciting sci-fi. The Fringe team escapes from the parallel universe &ndash; except for Olivia, trapped in the other world and replaced in ours by her double, who turns Peter and Olivia&rsquo;s tentative relationship into a love affair. Then Olivia returns, bonds of trust fray, ever more bizarre and terrifying phenomena occur and secrets that stretch back to 1985 threaten to destroy our universe. Or theirs. &ldquo;Fringe continues its hot streak known as Season 3. It&rsquo;s been firing on all cylinders all season&rdquo; (Andrew Hanson, LATimes.com).</p>\r\n</p>', '', '', '', '', ''),
(122, 'EN', 'Evolution SST.2 XO Complete Bike 10SPD12', '', '', '<p><span class="content">The all new ICT bred Evolution 29er boasts 120mm  of fully active travel. Combine the Evolution sst.2 120 frame with a set  of fast rolling 29" wheels and you have a machine that can take you  further than you ever thought possible.</span></p>', '', '', '', '', ''),
(123, 'EN', 'Supernatural: The Complete Sixth Season', '', '', '<p>\r\n<p>Studio: Warner Bros.</p>\r\n<p>Screen Aspect: 16 X 9 FULL FRAME</p>\r\n<p>Run Time: 924 minutes</p>\r\n<p>Episodes Info :</p>\r\n<p>Exile on Main St.</p>\r\n<p>Two and a Half Men</p>\r\n<p>The Third Man</p>\r\n<p>Weekend at Bobby''s</p>\r\n<p>Live Free or Twihard</p>\r\n<p>You Can''t Handle the Truth</p>\r\n<p>Family Matters</p>\r\n<p>All Dogs Go to Heaven</p>\r\n<p>Clap Your Hands if You Believe</p>\r\n<p>Caged Heat</p>\r\n<p>Appointment in Samarra</p>\r\n<p>Like a Virgin</p>\r\n<p>Unforgiven</p>\r\n<p>Mannequin 3: The Reckoning</p>\r\n<p>The French Mistake</p>\r\n<p>...And Then There Were None</p>\r\n<p>My Heart Will Go On</p>\r\n<p>Frontierland</p>\r\n<p>Mommy Dearest</p>\r\n<p>The Man Who Would Be King</p>\r\n<p>Let It Bleed</p>\r\n<p>The Man Who Knew Too Much</p>\r\n<p>Special Features:</p>\r\n<p>Jensen Ackles: A Director&rsquo;s Journey featurette</p>\r\n<p>Supernatural and the Quest for the Soul featurette</p>\r\n<p>Audio Commentary on &ldquo;Clap Your Hands if you Believe&rdquo; with EPs Robert Singer, Sera Gamble, and Ben Edlund</p>\r\n<p>Audio Commentary on &ldquo;The French Mistake&rdquo; with EP''s Robert Singer, Sera Gamble and Ben Edlund.</p>\r\n<p>&ldquo;The French Mistake&rdquo; Alternate Takes and Outtakes</p>\r\n<p>Gag Reel</p>\r\n<p>Easter Egg</p>\r\n<p>Two bonus episodes from Supernatural: The Anime Series - &ldquo;All Hell Breaks Loose&rdquo; Parts 1 &amp; 2</p>\r\n<p>Media Quantity: Multi D</p>\r\n<p>Packaging Type: VIVA 6 Disc 25mm Case</p>\r\n<p>Subtitle Languages:</p>\r\n<p>Chinese</p>\r\n<p>French</p>\r\n<p>Portuguese</p>\r\n<p>Spanish</p>\r\n<p>Thai</p>\r\n<p>Genre: Drama, Television</p>\r\n<p>Synopsis:</p>\r\n<p>The prize: ending the Apocalypse. The price: Sam&rsquo;s life. Season 5&rsquo;s horrific finale left Dean alone, as Sam descended into Hell. Now a different man, Dean vows to stop hunting and devote himself to building a family with Lisa and her son Ben. Then, mysteriously, Sam reappears, drawing Dean back into the old life. But Sam&rsquo;s a different man too. He&rsquo;s returned without his soul. How the Winchesters confront this greatest challenge yet to their powerful bond is the troubled heart &ndash; and soul &ndash; of the profound and thrilling 5-Disc, 22-Episode Season 6. As the brothers struggle to reunite, they must also battle deadly supernatural forces. Demons. Angels. Vampires. Shapeshifters. And a terrifying new foe called the Mother of All.</p>\r\n<div></div>\r\n</p>', '', '', '', '', ''),
(124, 'EN', 'Truth SST.2 X9 Complete Bike 10SPD ''12', '', '', '<p><span class="content">The legendary performance of the 100mm travel  Truth sst.2 has been enhanced through fine tuning and tweaking over  countless seasons of XC and endurance racing in every condition  imaginable. With Ellsworth''s proprietary ICT suspension, SST tubing,a  lighter and stronger pivot integrated seat tube and a semi-integrated  tapered head tube - this is the fastest Truth ever created. </span></p>', '', '', '', '', ''),
(125, 'EN', 'Samsung Galaxy S II', '', '', '<dl><dt>The Galaxy S II has an amazing 4.27" Super  AMOLED Plus screen. This superb display has razor sharp clarity and  breathtaking color. See every detail of videos and pictures. See the  full range of hues in all their subtlety and brilliance. And with its  superior wide viewing angle, you don''t have to be directly in front of  the screen to see a perfect image. Truth is, you really have to see it  to believe it.</dt></dl>', '', '', '', '', ''),
(126, 'EN', 'Casio PRIZM fx-CG10', '', '', '<p><br /><img style="word-wrap: break-word; border-style: initial; border-color: initial;" src="http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_2.jpg" alt="PRIZM fx-CG10" align="right" /><strong style="word-wrap: break-word;">High-resolution color LCD with full textbook-style display</strong><br style="word-wrap: break-word;" /><br style="word-wrap: break-word;" />The color LCD offers full textbook-style display with the highest pixel resolution* (82,944 dots) and widest color reproduction* (65,536 colors) of any calculator. PRIZM&trade; comes with high-resolution fonts up to 18x24 dots (including blank dots), to enable equations and text to be displayed just like they appear in textbooks. The Blanview LCD delivers superior visibility and low power consumption, enabling color display with an estimated run time of 140 hours on four AAA-size alkaline batteries.**<strong style="word-wrap: break-word;"><br style="word-wrap: break-word;" /></strong>*As of October 7, 2010, for the pixel resolution and color reproduction of calculators. According to a survey by Casio Computer Co., Ltd.<br style="word-wrap: break-word;" />**Using repetition of the following one-hour sequence: Menu display for 5 minutes, Run-Matrix mode calculation for 5 minutes, flashing cursor in Run-Matrix mode for 50 minutes. Based on default settings for display brightness and auto power off. (Refer to the Specifications for exact settings)&nbsp;&nbsp;<strong style="word-wrap: break-word;"><img style="word-wrap: break-word; border-style: initial; border-color: initial;" src="http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_3.jpg" alt="PRIZM fx-CG10" align="right" /></strong><strong style="word-wrap: break-word;">Picture Plot enables learning from real-life pictures</strong><strong style="word-wrap: break-word;">&nbsp;</strong><br style="word-wrap: break-word;" /><br style="word-wrap: break-word;" />Picture Plot enables users to create their own graphs over pictures displayed on the color LCD. PRIZM&trade; comes with 55 types of color pictures that users can create graphs over, such as a picture of the parabola of jets from a water fountain and an image sequence of a clock&rsquo;s pendulum movement. Users can perform regression calculations from the completed graphs to enhance their understanding of math functions.&nbsp;&nbsp;&nbsp;<strong style="word-wrap: break-word;">Multitude of functions that leverage the color LCD</strong><br style="word-wrap: break-word;" /><br style="word-wrap: break-word;" />Colors can be added to a multitude of graphing objects including dotted lines, circles, and bars, as well as grid lines on graphs, labels of coordinate axes, and coordinate values displayed during tracing. The Color Link function links the colors used in graphs to the designated values in the spreadsheet screen, to aid the visual comprehension of trends and changes in values. PRIZM&trade; automatically color-codes brackets when entering equations with multiple brackets, as a visual aid to facilitate the entry of complex equations.&nbsp;</p>\r\n<table style="word-wrap: break-word;" align="center">\r\n<tbody style="word-wrap: break-word;">\r\n<tr style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;"><img style="word-wrap: break-word; border-style: initial; border-color: initial;" src="http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_3.jpg" alt="PRIZM fx-CG10" align="left" /></strong></td>\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;"><img style="word-wrap: break-word; border-style: initial; border-color: initial;" src="http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_4.jpg" alt="PRIZM fx-CG10" align="left" /></strong></td>\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;"><img style="word-wrap: break-word; border-style: initial; border-color: initial;" src="http://www.casio.com/resource/images/pressreleases/fx-CG10_Prizm_press_5.jpg" alt="PRIZM fx-CG10" align="left" /></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>', '', '', '', '', ''),
(127, 'EN', 'Fore CR5 SRAM Red', '', '', '<p>An all new frame and new graphics package make the Fore CR5 look as  fast as it really is. Now available with SRAM Red componants.</p>\r\n<p>What do you get when you interview hundreds of riders, questioning them  about their desires for the ultimate road bike and then, spend  thousands of hours translating those ideas into reality? A dream come  true. We call it the Fezzari For&eacute; CR5. It is the pinnacle of road bike  performance. From its all new state of the art, proprietary Fezzari  Racing Design Xr7 3K monocoque carbon frame to its best-of-market  components, the For&eacute; CR5 is THE ultimate road bike. Our designers and  engineers didn''t cut corners.<br /> <br /> Take, for instance, the state of the art proprietary Fezzari Racing  Design Xr7 3K monocoque carbon fiber frame. We used the highest grade of  carbon fiber available on the market. We made it even stiffer laterally  by enlarging the bottom bracket shell and adding the BB30 bottom  bracket/crank design, strengthening the headtube and making it more  laterally stiff by enlarging the diameter to a 1.5" tapered design.  We''ve also enlarged the seatstays near the rear axle for more lateral  rigidity. We made the Xr7 frame even more vertically compliant for those  rides on the cobblestones. We''ve done this by using an oval design in  our top tube and down tube.&nbsp; The new Xr7 frame is even more aerodynamic  than before with the new F4 ultralight bladed carbon fork and internal  cable routing on the top tube.&nbsp; The Xr7 frame was recently tested to be  one of the most durable frames on the market, and it weighs a mere 900  grams. Strength, lightweight, rigidity where you need it most, and  flexible enough to take the edge off of rough roads -- it''s the perfect  frame for anyone who wants to get the most out of their riding  experience.<br /> <br /> Next, take a look at the perfect blend of components. The Fore CR5  includes SRAM Red components shifters, brakes and derraileurs, FSA  K-Force Light BB30 Carbon Crankset, Fezzari F4 XrT 3K carbon ultralite  bladed carbon fork with carbon steerer tube, FSA K-Force compact carbon  bars, FSA K- Force carbon seat post, and even carbon spacers on the  headset.<br /> <br /> Finally, add the new sleek graphics and logos and you have--the ultimate road ride.<br /> <br /> You get the following upgrades over the CR3:</p>\r\n<ol>\r\n<li> <strong>Upgraded Frameset</strong> &ndash; from the Xr5 to the new Xr7  frame,&nbsp; more lateral stiffness with a BB30 crank system, enlarged  headtube for better cornering, and sprinting, added rigidity in the rear  triangle, increased aerodynamics with the new F4 bladed fork design and  internal cable routing.</li>\r\n<li> <strong>Upgraded Shifters</strong> &ndash; from Shimano Ultegra to the flagship SRAM Red, for smoother, more precise shifting</li>\r\n<li> <strong>Upgraded Front Derailleur</strong> &ndash; from Shimano Ultegra to SRAM Red, which is lighter and smoother</li>\r\n<li> <strong>Upgraded Cassette</strong> &ndash; from Shimano Ultegra to SRAM Red</li>\r\n<li> <strong>Upgraded Crankset</strong> &ndash; from FSA SLK Light to FSA K-Force Light, which is lighter</li>\r\n<li> <strong>Upgraded Chain</strong> &ndash; from Shimano Ultegra to SRAM Red</li>\r\n<li> <strong>Upgraded Wheelset</strong> &ndash; Mavic Ksyrium SL, which are lighter,stiffer, faster, and perform better</li>\r\n<li> <strong>Upgraded Brakes</strong> &ndash; from Shimano Ultegra to SRAM Red, which are lighter and smoother</li>\r\n<li> <strong>Upgraded Seatpost-&nbsp; </strong>The&nbsp; FSA K-force light seatpost  is one of the lightest on the market.&nbsp; It also completes the graphics  package complimenting the crank and handle bar.</li>\r\n</ol>\r\n<p>When you get a For&eacute; CR5, we custom fit it for you through our 23-Point  Custom Setup program. We&rsquo;ll get your specific&nbsp; body measurements so we  can outfit your bike to fit you perfectly.&nbsp; You''ll have the rest of the  peloton envious of your ride.</p>', '', '', '', '', ''),
(128, 'EN', 'Casio FX-115ES', '', '', '<table class="defTBL" style="word-wrap: break-word; color: #555555; font-family: Helvetica, sans-serif; font-size: 12px; line-height: 18px; text-align: left; background-color: #ffffff;" border="0" width="95%">\r\n<tbody style="word-wrap: break-word;">\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Number of Functions</strong></td>\r\n<td style="word-wrap: break-word;">279</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Display</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">2-Line Digit</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Natural Textbook</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Digits</td>\r\n<td style="word-wrap: break-word;">10 + 2</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Memory</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Store/Recall</td>\r\n<td style="word-wrap: break-word;">Yes/Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Recall &amp; Edit values</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Number of independent memories</td>\r\n<td style="word-wrap: break-word;">1</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Number of constant memories</td>\r\n<td style="word-wrap: break-word;">6</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Features</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Operating system</td>\r\n<td style="word-wrap: break-word;">S - V.P.A.M</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Protective hard case</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Clear last entry and clear all</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Review &amp; edit preview entries</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Overhead Model Available</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Fixed decemial capabilities</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Multi-replay</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Plastic Keys</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Mathematics</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Metric conversions</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Scientific notation</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Parenthesis/Constant</td>\r\n<td style="word-wrap: break-word;">Yes/-</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Pi</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Xth root</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Fraction calculations</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Complex numbers</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">DMS &lt;&gt; DD / P &lt;&gt; R Conversions</td>\r\n<td style="word-wrap: break-word;">Yes/Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Trigonometry</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Sin, Cos, Tan, &amp; Inverses</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Hyperbolic Functions</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Converts between DEG, RAD, GRAD</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Statistics</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">One/two variable</td>\r\n<td style="word-wrap: break-word;">Yes/Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Mean, sum, # elements</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Standard Deviation</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Linear Regression</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Log, In, Inverse Log, Exponential</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Store and edit data in memory</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Quadratic, log, exp, power, inverse regression</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">nPr, cPr, x!</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Random number generator</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Calculus</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Complex number calculations</td>\r\n<td style="word-wrap: break-word;">No</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Numeric integration</td>\r\n<td style="word-wrap: break-word;">No</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Numeric differential calculations</td>\r\n<td style="word-wrap: break-word;">No</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;"><strong style="word-wrap: break-word;">Power/Unit Dimensions</strong></td>\r\n<td style="word-wrap: break-word;">&nbsp;</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Power</td>\r\n<td style="word-wrap: break-word;">Solar Plus w/Battery back-up</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Auto Power Off</td>\r\n<td style="word-wrap: break-word;">Yes</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Battery</td>\r\n<td style="word-wrap: break-word;">-</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Size (H x W x L) Inches</td>\r\n<td style="word-wrap: break-word;">Not available</td>\r\n</tr>\r\n<tr class="contentTextGray" style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;">Weight (ounces)</td>\r\n<td style="word-wrap: break-word;">Not available</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class="contentTextGray" style="word-wrap: break-word; margin-top: 10px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; line-height: 1.25em; color: #555555; font-family: Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff;">Technical Specifications subject to change</p>\r\n<p class="contentTextGray" style="word-wrap: break-word; margin-top: 10px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; line-height: 1.25em; color: #555555; font-family: Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff;">The FX-115ES is permitted on AP, SAT and PSAT/NMSQT. Policies are subject to change. Visit<a style="word-wrap: break-word; color: #00349a; text-decoration: underline;" href="http://www.collegeboard.com/" target="_blank">www.collegeboard.com</a>for more information.</p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(129, 'EN', 'Fore CR1', '', '', '<p>Take your riding to the next level with the For&eacute; CR1 full carbon road  bike, built to be extremely durable and responsive. Feel the adrenalin  rush as it accelerates smoothly and corners aggressively. Great for  cross-country riding, a triathlon, and even a race.&nbsp; The new Fezzari  Fore CR1 is the newest bike to the Fezzari carbon road bike family.&nbsp; It  has the same tried and true monocoque carbon frame as the&nbsp; Fore CR2, but  is built with a Shimano 105/Ultegra groupo to help save a little on the  price.</p>\r\n<p>Start with a proprietary Fezzari Racing Design Xr4 monocoque carbon  frame that was recently tested as one of the most durable frames on the  market.</p>\r\n<p>All this translates into exhilaration when you&rsquo;re climbing &ndash; knowing  that you&rsquo;re ascending more efficiently &ndash; and confidence on the downhill  when you take that corner at high speeds. Our proprietrary frame  painting process give one of the best looking finishes available.</p>\r\n<p>You get e&nbsp; upgrades over the Catania:</p>\r\n<ol>\r\n<li> <strong>Upgraded Frame</strong> &ndash; the CR1 has a full monocoque carbon  frame vs the Catania&rsquo;s aluminum alloy frame. The carbon frame is lighter  and will absorb more of the road chatter when riding.</li>\r\n<li> <strong>Upgraded Seatpost</strong> &ndash; the larger diameter 31.6mm seatpost is stiffer and lighter.</li>\r\n<li> <strong>Upgraded Wheels</strong> &ndash; The CR1 gets a lighter and more aero dynamic wheel whith looks to go with it.</li>\r\n</ol>\r\n<p>Who will want this bike? If you&rsquo;ve been biking and plan to get into it  more, and you want to get something that will grow with you as you grow  in the sport (but you&rsquo;re not willing to pay the price of a CR3 or CR5),  then this is the bike for you. It gets you on a full monocoque carbon  fiber frame and still gives you the confidence you won''t miss a shift  with the Shimano 105/Ultegra drivetrain. You&rsquo;ll have the confidence that  you can ride with anyone, anytime.</p>', '', '', '', '', ''),
