-word; padding: 0px; margin: 0px;"><img style="word-wrap: break-word; border-style: initial; border-color: initial;" src="http://www.casio.com/resource/images/catalog/calculator/black_bullet.gif" border="0" alt="" /></div>\r\n</td>\r\n</tr>\r\n<tr style="word-wrap: break-word;">\r\n<th style="word-wrap: break-word;" colspan="2">\r\n<div style="word-wrap: break-word; padding: 0px; margin: 0px;"><strong style="word-wrap: break-word;">Power</strong></div>\r\n</th>\r\n</tr>\r\n<tr style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;" width="61%">Type</td>\r\n<td style="word-wrap: break-word;" width="39%">\r\n<div style="word-wrap: break-word; padding: 0px; margin: 0px;">AC</div>\r\n</td>\r\n</tr>\r\n<tr style="word-wrap: break-word;">\r\n<th style="word-wrap: break-word;" colspan="2">\r\n<div style="word-wrap: break-word; padding: 0px; margin: 0px;"><strong style="word-wrap: break-word;">Unit Dimensions</strong></div>\r\n</th>\r\n</tr>\r\n<tr style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;" width="61%">Size (inches)&nbsp; H x W x L</td>\r\n<td style="word-wrap: break-word;" width="39%">\r\n<div style="word-wrap: break-word; padding: 0px; margin: 0px;">4-3/10" x 8-2/5" x 15"</div>\r\n</td>\r\n</tr>\r\n<tr style="word-wrap: break-word;">\r\n<td style="word-wrap: break-word;" width="61%">Weight oz/lbs</td>\r\n<td style="word-wrap: break-word;" width="39%">\r\n<div style="word-wrap: break-word; padding: 0px; margin: 0px;">3.7 lbs</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>\r\n<p style="word-wrap: break-word; margin-top: 10px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; line-height: 1.25em; color: #555555; font-family: Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff;">Technical Specifications Subject to Change</p>\r\n</p>', '', '', '', '', ''),
(131, 'EN', 'Catania', '', '', '<p class="MsoPlainText">The new Catania features carbon fork, carbon seatpost, Ultegra  derailleur, and the new Fezzari Racing Design R3A frame with increased  aerodynamic properties and a sleeker look.</p>\r\n<p class="MsoPlainText">The Catania road bike is a great all-around bike. If you want to get  into road biking or want a bike that is durable, high-performing, and as  comfortable as a road bike can get, the Catania is for you.</p>\r\n<p class="MsoPlainText">The Catania features the R3A frame with compact geometry. Compact  geometry means that we shorten the seat tube slightly, which makes the  bike a little lighter and reduces lateral flex (you don&rsquo;t want your bike  flexing side to side when you&rsquo;re pedaling). It also allows your riding  position to be a little more upright.</p>\r\n<p class="MsoPlainText">Add to that a great set of components, including: Shimano Ultegra  derailleur and Shimano 105 shifters for smooth shifting Fezzari Carbon  II fork to minimize the road chatter; FSA Gossamer crank with external  oversized bearings that make it pedal smoother and more efficiently;  Alex double-wall rims that are extremely durable; Maxxis performance  tires; and a Fezzari Racing Design Ultra XR saddle that is one of the  most comfortable road saddles you&rsquo;ll ride.</p>', '', '', '', '', ''),
(132, 'EN', 'Samsung Galaxy Player 5.0', '', '', '<p>Easily connect via Wi-Fi without any monthly service fees. The Samsung Galaxy Player can access the internet and apps anywhere there is an available hotspot. The sleek, lightweight 6.42 oz. design fits in any pocket and the brilliant 5&rdquo; LCD delivers incredible viewing quality.</p>', '', '', '', '', ''),
(133, 'EN', 'Samsung Galaxy Player 4.0', '', '', '<p>Easily connect via Wi-Fi without any monthly service fees. The Samsung Galaxy Player can access the internet and apps anywhere there is an available hotspot. The sleek, lightweight 4.27 oz. design fits in any pocket and the brilliant 4&rdquo; Super Clear LCD delivers incredible viewing quality.</p>', '', '', '', '', ''),
(134, 'EN', 'Creative ZEN Style M300 MP3 Player 16GB (Black)', '', '', '<p>Don''t let the compact appearance of the Creative ZEN Style M300 MP3 player fool you. For a media player this tiny, you&rsquo;d be amazed at the array of features it can offer for a remarkably affordable price.</p>', '', '', '', '', '');
INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`) VALUES
(135, 'EN', 'Creative ZEN Touch 2 MP3 Player 8GB (Black)', '', '', '<p>The ZEN line of portable media players has long been associated with the highest quality in audio playback, and the Creative ZEN Touch 2 continues to uphold this standard. But that''s not all it offers. What makes this player truly stand out from the rest is that you can stream music wirelessly to compatible Bluetooth&reg; headphones or speakers such as Creative''s ZiiSound D5 and WP-300, and surf the Internet too.</p>', '', '', '', '', ''),
(136, 'EN', 'BlazBlue: Continuum Shift EXTEND', '', '', '<p>\r\n<p>The Time of the AZURE is Here!</p>\r\n<p>&nbsp;</p>\r\n<p>Aksys Games, a publisher of interactive entertainment software, is proud to announce that the next installment in the hit fighting game series BlazBlue, BlazBlue: Continuum Shift EXTEND, will be coming to North America as a PlayStation&reg;Vita launch title! With the devious, all new playable character Relius Clover, new story scenarios, new gameplay modes, and competitively balanced action, BlazBlue: Continuum Shift EXTEND makes a grand return to home consoles and the new frontier!</p>\r\n<p>BlazBlue: Continuum Shift EXTEND Key Features:</p>\r\n<p>&nbsp;</p>\r\n<p>Enhanced Story Mode: Relive and rediscover the events that took place in BlazBlue: Calamity Trigger or venture forth into one of four all new story scenarios!</p>\r\n<p>New and Revised Game Modes to Explore: Take on the strongest of foes in Unlimited Mars Mode, dungeoneer your way to the bottom of Abyss Mode, or lead an army to victory in Legion Mode!</p>\r\n<p>Fully Revised Combat System: All characters, new and old, have been thoroughly rebalanced and armed with all new strategies and combos to take your game to the top!</p>\r\n<p>Improved Online Multiplayer: Battle it out in BlazBlue&rsquo;s acclaimed online mode with all new multiplayer features, such as online team battles!</p>\r\n<p>SHIP DATE: February 14, 2012</p>\r\n<p>GENRE: Fighting</p>\r\n<p>PLAYER(S): 1 Local, 2-6 Online</p>\r\n</p>', '', '', '', '', ''),
(137, 'EN', 'Ultimate Marvel VS. Capcom 3', '', '', '<p>\r\n<p>he ULTIMATE heroes from Marvel and Capcom collide again in Ultimate Marvel vs. Capcom 3. Every epic character from the original blockbuster returns to the fray alongside 12 new fighters,&nbsp;</p>\r\n<p>8 over-the-top new stages and enhanced gameplay.</p>\r\n<p>COMING SOON: Ultimate Marvel Vs. Capcom 3 for PlayStation&reg;Vita system! It''s the full console experience packed with 50 legendary characters*, local and Wi-Fi multiplayer, touch panel controls, and exclusive new features.</p>\r\n<p>UNLEASH YOUR ULTIMATE</p>\r\n<p>ANYTIME, ANYWHERE</p>\r\n<p>LAUNCHING with the PlayStation&reg;Vita system on 2/22/12&nbsp;</p>\r\n<p>OUT NOW on Xbox 360 and PlayStation&reg;3 system</p>\r\n</p>', '', '', '', '', ''),
(138, 'EN', 'Ridge Racer', '', '', '<p>\r\n<p>BEAUTY &amp; HIGH SPEED DRIFTING AROUND THE WORLD!</p>\r\n<p>The high-octane racing franchise drifts onto the PlayStation&reg;Vita delivering stunning graphics and heart-pounding action that players can truly feel. Ridge Racer&reg; features high-speed action, high-performance racing machines, and all-new gameplay additions creating an edge-of-your-seat experience only possible on the PlayStation&reg;Vita. Racing fans can also take the action online and tear up the track against players from around the globe using the PlayStation&reg;Vita &ldquo;near&rdquo; and Wi-Fi functionality and race against other players&rsquo; ghosts anywhere at anytime.</p>\r\n<p>\r\n<p>Vivid, next generation high-contrast graphics and advanced lighting effects powered by the PlayStation&reg;Vita painting processor</p>\r\n<p>An immersive audio experience with a dynamic soundscape that changes and evolves with each race according to the movement of your machine.</p>\r\n<p>All-new custom drift system enables players to tune the action to suit their style of driving. All new "Machine Upgrade Map" customization allows players to upgrade functional parts and create their own original machines</p>\r\n<p>New introduction of the Planetary League allows players to join in one of four racing teams and race against other players from around the world both at real-time and "anywhere at any time" by exchanging ghosts via "near" functionality.</p>\r\n<p>Compete against up to 7 other players from around the world with online (ad-hoc, Wi-Fi) multiplayer.</p>\r\n</p>\r\n</p>', '', '', '', '', ''),
(139, 'EN', 'Shinobido 2: Revenge of Zen', '', '', '<p>\r\n<p>Shinobido 2: Revenge of Zen is the sequel to Shinobido: Way of the Ninja, featuring the series&rsquo; trademark stealth action gameplay with the addition of new stylish assassin moves and a dynamic storyline. Developed by Acquire, the story is set six months after the events of the previous opus, with the Utakata region once again at the center of the storm and embroiled in a civil war involving the mysterious Magic Mirror. Players will take the role of Zen, a man who has suffered betrayal at the hands of his companions and the loss of his home. Saved by the Asuka clan of Utakata, Zen makes up his mind to live as an assassin and begins a perilous journey in search of revenge.</p>\r\n<p>Dynamic Storyline: Interact with three factions with different choices affecting the power balance between the factions and resulting in diverging storylines.</p>\r\n<p>Stealth action gameplay for a master assassin: Employ a variety of deadly finishing moves which vary according to the location. Activate the Zankoku for bullet-time action and use the Ninja Flying ability to freely explore environments.</p>\r\n<p>New &lsquo;near&rsquo; network features: Boost your inventory by receiving gift items from other players using the PlayStation&reg;Vita near feature.</p>\r\n<p>Original PS Vita rear touch panel gameplay features: &nbsp;Use the rear touch panel to change to a first person view and launch long range weapons at enemies.</p>\r\n</p>', '', '', '', '', ''),
(140, 'EN', 'Yamaha PDX-11 DB', '', '', '<p>This easy-to-carry, powerful speaker system frees your iPod/iPhone music for your active lifestyle. Enjoy your entire content library whenever you want, wherever you go.</p>', '', '', '', '', ''),
(141, 'EN', 'Yamaha PDX-11 GR', '', '', '<p>This easy-to-carry, powerful speaker system frees your iPod/iPhone music for your active lifestyle. Enjoy your entire content library whenever you want, wherever you go.</p>', '', '', '', '', ''),
(142, 'EN', 'Yamaha TSX-130WH', '', '', '<p>Enjoy music from all your favorite sources with this attractive all-in-one audio system.</p>', '', '', '', '', ''),
(143, 'EN', 'Yamaha PDX-30PI', '', '', '<p>A certified "works with iPhone" Desktop Audio product that every iPhone or iPod fan who wants to enjoy a higher sound quality with a powerful output needs to have! The PDX-30 includes a card-type remote control for additional convenience.</p>', '', '', '', '', ''),
(144, 'EN', 'Yamaha PDX-30BU', '', '', '<p>A certified "works with iPhone" Desktop Audio product that every iPhone or iPod fan who wants to enjoy a higher sound quality with a powerful output needs to have! The PDX-30 includes a card-type remote control for additional convenience.</p>', '', '', '', '', ''),
(145, 'EN', 'Sansa Fuze+ MP3 Player (Red) - 4GB', '', '', '<p>With the versatile SanDisk Sansa Fuze+ MP3 player, you''ll get more features for less money. You''ll be able to watch video on the 2.4-inch screen, share photos, listen to FM radio, record voice memos, and more--all in a device that is just 0.43-inches thin. Internal memory and a microSDHC expansion slot give you plenty of storage options for your digital media, and you can expand your enjoyment even further by adding an optional slotRadio card for an instant library of songs.</p>', '', '', '', '', ''),
(146, 'EN', 'Sansa Clip+ MP3 Player (Blue) - 4GB', '', '', '<p>Small but powerful, the Sansa Clip+ is a tiny MP3 player that boasts an array of cool features, as well as distinctively big sound for its small size. Rock out with up to 1,000 songs on this blue player. &dagger; Enjoy even more play when you use the expandable memory slot to play preloaded microSDHC&trade; cards**. slotRadio&trade; and slotMusic cards** are preloaded with tunes ready to pop into the player&rsquo;s memory card slot. Rock on with a 15-hour battery life. &dagger; &dagger;</p>', '', '', '', '', ''),
(147, 'EN', 'Sansa Clip+ MP3 Player (Red) - 4GB', '', '', '<p>Small but powerful, the Sansa Clip+ is a tiny MP3 player that boasts an array of cool features, as well as distinctively big sound for its small size. Rock out with up to 1,000 songs on this red player. Enjoy even more play when you use the expandable memory slot to play preloaded microSDHC cards. slotRadio and slotMusic cards are preloaded with tunes ready to pop into the player&rsquo;s memory card slot. Rock on with a 15-hour battery life.</p>', '', '', '', '', ''),
(148, 'EN', '16GB A Series Walkman Video MP3', '', '', '<p>With an A Series by your side, there''s never a dull moment. The dazzling 2.8" (400x240) touch screen delivers incredible color and quickly serves up photos, videos, album artwork and more. Easily navigate your media library with the tap of a finger or via traditional button controls if you prefer. Experience your music wirelessly and stream audio to other compatible devices with integrated Bluetooth&reg;. Sony Clear Audio technologies work as a team to make your music sound the best it can &ndash; Digital Sound Enhancement Engine, Clear Stereo and Clear Bass Audio Technologies offer deeper, richer sound plus S-Master&trade; MX amplification makes for higher signal to noise ratios and less distortion. Upload the matching lyric file and learn the words to your favorite song as your A Series scrolls them along the screen in sync with the music. Premium EX earbuds and USB cable included.</p>', '', '', '', '', ''),
(149, 'EN', '8GB E Series Walkman Video MP3', '', '', '<p>Long lasting battery offering up to 50 hours of music or up to 10 hours of video playback, FM tuner, Karaoke mode, Clear Audio technologies, EX headphones, integrated mic and 2.0" LCD.</p>', '', '', '', '', ''),
(150, 'EN', 'Wildwood city classic', '', '', '<div id="overview-bullets">\r\n<ul class="bullet-points">\r\n<li>Hi-Ten Remington Steel Wildwood Citi Comfort Frame</li>\r\n<li>45mm Travel Comfort Suspension Fork</li>\r\n<li>Compact Crankset w/ Integrated Chainguard</li>\r\n<li>SSW26 Double Tunnel Alloy Rims<span> </span></li>\r\n<li>Avenir Comfort Saddle w/ Supersoft Foam, Coil Springs</li>\r\n</ul>\r\n</div>', '', '', '', '', ''),
(151, 'EN', 'Wildwood classic', '', '', '<div id="overview-bullets">\r\n<ul class="bullet-points">\r\n<li>6061-T6 Aluminum Wildwood Comfort Frame</li>\r\n<li>50mm Travel Comfort Suspension Fork</li>\r\n<li>Compact Crankset w/ Integrated Chainguard</li>\r\n<li>SSW26 Double Tunnel Alloy Rims<span> </span></li>\r\n<li>Puncture-Resistant Kenda Comfort Tires</li>\r\n</ul>\r\n</div>', '', '', '', '', ''),
(152, 'EN', 'Drifter 2', '', '', '<div id="overview-bullets">\r\n<ul class="bullet-points">\r\n<li>Sun-Hot Heat-Treated Aluminum Beach Cruiser Frame</li>\r\n<li>Hi-Ten Remington Steel Curvaceous Beach Cruiser Fork</li>\r\n<li>Shimano 7-Spd Megarange Freewheel &amp; Twist Shifter</li>\r\n<li>Rust-Proof Alloy Rims &amp; Stainless Steel Spokes</li>\r\n<li>Color-Matched Custom Beach Cruiser Fenders</li>\r\n</ul>\r\n</div>', '', '', '', '', ''),
(153, 'EN', 'UR55 Full Size Headphones', '', '', '<p>Slipping into a set of lightweight, professional headphones like the Koss UR55 studio headphones is like listening to a live musical performance at a spacious outdoor venue. These high velocity headphones feature open-screen ear cups that deliver great sound, lasting comfort, and impressive air circulation. <br /><br />Designed to deliver equal parts sound quality and comfort, Koss UR55s bump with massive bass while their lightweight foam ear cushions are enough to convince you it&rsquo;s just you and the music. A padded sling with a sturdy metal headband reinforcement provides extreme durability, while the swivel ear cups encourage maximum flexibility, single-ear listening and convenient storage.</p>', '', '', '', '', ''),
(154, 'EN', 'JR900 Wireless Headphones', '', '', '<p>Koss JR900s are the music lover&rsquo;s answer to true stereo and cordless freedom. Operating on one of the highest power bands available on the market, the Koss JR900 headphone system (consisting of a high quality, battery operated RF transmitter with AC adapter) offers the best in wireless audio technology, allowing you to roam freely over a 70,000-square-foot area. From room to room, inside to outside, even in bright sunlight, you can move to your heart&rsquo;s content without the need for additional transmitters or worry of signal breakup.</p>', '', '', '', '', ''),
(155, 'EN', 'Porta Pro KTC On-Ear Headphone', '', '', '<p>Koss Porta Pro KTC, the most sophisticated version of the Porta Pro, features a new technological upgrade which brings listeners closer to the music they love. Koss Touch Control (KTC) remote and microphone technology, made for iPhone&reg;, iPad&reg; and iPod&reg;, gives listeners more control in fewer steps. Listeners are now able to stay connected, shuffle song and adjust volume with the flick of a switch.</p>', '', '', '', '', ''),
(156, 'EN', 'Extra Bass Headphones  70mm', '', '', '<p>Get that super bass. A tightly sealed acoustic design combines mega 70mm XB driver units &ndash; the world''s largest1 &ndash; and king-sized cushion earpads to deliver ultra-deep bass.</p>', '', '', '', '', ''),
(157, 'EN', 'Studio Monitor Headphones', '', '', '<p>Love at first listen. Striking yet comfortable studio monitor headphones with neodymium magnets deliver sounds even the most discerning of audiophiles will flip for.</p>', '', '', '', '', ''),
(158, 'EN', 'AIKO SAFE Model Economy (AS 30) Home Safe, with single key', '', '', '<table style="color: #000000; font-family: ''Times New Roman''; background-color: #ffffff;" border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td class="arial_12pt" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-decoration: none;">\r\n<pre style="white-space: pre-wrap; word-wrap: break-word; width: 600px; font-family: Geneva, Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold; text-align: justify; text-decoration: none;">AIKO safes are designed to provide maximum protection against fire and foil any tampering and break-ins. The anti-burglary \r\n\r\nConstruction: \r\nBody &amp; Door: Tough steel plates precisely engineered using industry leading manufacturing techniques. Inserted with Premium formulated Ultra Fine Bubble Concrete provides the most effective insulation against intense heat to ensure valuables are protected from burglary &amp; fire.\r\n\r\nAutomatic Stopper: The automatic stopper feature allows users to close the door with slightest of push.\r\n\r\nLocking System: Fitted with  Solid Steel bolt locking system to lock horizontally. Fitted with Single Key lock system, with ultra secure cylinder Key.\r\n\r\nTest &amp; Approvals: Achieved the following international test certificates.\r\n      1.  JIS - Japan Standard\r\n      2.  KS - Korea Standard\r\n      3.  SINTEF - Norway Standard\r\n      4.  CNAL - China Standard \r\n\r\nBuilt in Alarm: (Optional) To set off anti burglary alarm \r\n\r\nTerms and Conditions\r\n\r\n   1. Only loca</pre>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="arial_12pt" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-decoration: none;" border="0" cellspacing="2" cellpadding="2" width="100%" align="center">\r\n<tbody>\r\n<tr>\r\n<td colspan="8">\r\n<h4>SIZE (APPROX.) &amp; BRIEF SPECIFICATION</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n