(159, 'EN', 'AIKO SAFE Model AS 53 Home Safe, Horizontal Model with one tray', '', '', '<p>All AIKO safes are designed to provide maximum protection against fire and foil any tampering and break-ins. The anti-burglary</p>\r\n<p>Construction: Body &amp; Door: Tough steel plates precisely engineered using industry leading manufacturing techniques. Inserted with Premium formulated Ultra Fine Bubble Concrete provides the most effective insulation against intense heat to ensure valuables are protected from burglary &amp; fire.</p>\r\n<p>Automatic Stopper: The automatic stopper feature allows users to close the door with slightest of push.</p>\r\n<p>Locking System: Fitted with 4 directional Solid Steel bolt locking system to lock horizontally &amp; Vertically. Fitted with Dual Key lock system, with ultra secure cylinder Keys, Key &amp; Dial or Key &amp; Digital lock system.</p>\r\n<p>Automatic Re-locking: Fitted with Automatic Re-locking device.</p>\r\n<p>Test &amp; Approvals: Achieved the following international test certificates. 1.  JIS - Japan Standard 2.  KS - Korea Standard 3.  SINTEF - Norway Standard</p>', '', '', '', '', ''),
(160, 'EN', 'Drifter 3', '', '', '<div id="overview-bullets">\r\n<ul class="bullet-points">\r\n<li>Sun-Hot Heat-Treated Aluminum Stretch Beach Cruiser Frame</li>\r\n<li>Hi-Ten Remington Steel Curvaceous Beach Cruiser Fork</li>\r\n<li>Shimano Nexus Internal 3-Spd Hub / Twist Shifter</li>\r\n<li>Rust-Proof Alloy Rims &amp; Stainless Steel Spokes</li>\r\n<li>Color-Matched Custom Beach Cruiser Fenders</li>\r\n</ul>\r\n</div>', '', '', '', '', ''),
(161, 'EN', 'MV800 16.1 Megapixel MultiView Compact Digital Camera', '', '', '<p>The 3.0" Flip-Out Display lets you take and view great pictures from multiple angles. Easily adjust the LCD from 0 to 180 degrees and make any shot possible. Snap a picture over a crowd or get waist-level candids of kids and pets, or spin the display for perfectly framed self-portraits. Choose from 3 shutter options to comfortably snap pics from any position.</p>', '', '', '', '', ''),
(162, 'EN', 'AIKO SAFE Model AS 180 Office Safe with one shelve & one drawer', '', '', '<table style="color: #000000; font-family: ''Times New Roman''; background-color: #ffffff;" border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td class="arial_12pt" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-decoration: none;">\r\n<pre style="white-space: pre-wrap; word-wrap: break-word; width: 600px; font-family: Geneva, Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold; text-align: justify; text-decoration: none;">ll AIKO safes are designed to provide maximum protection against fire and foil any tampering and break-ins. The anti-burglary\r\n\r\nConstruction:\r\nBody &amp; Door: Tough steel plates precisely engineered using industry leading manufacturing techniques. Inserted with Premium formulated Ultra Fine Bubble Concrete provides the most effective insulation against intense heat to ensure valuables are protected from burglary &amp; fire.\r\n\r\nAutomatic Stopper: The automatic stopper feature allows users to close the door with slightest of push.\r\n\r\nLocking System: Fitted with 4 directional Solid Steel bolt locking system to lock horizontally &amp; Vertically. Fitted with Dual Key lock system, with ultra secure cylinder Keys, Key &amp; Dial or Key &amp; Digital lock system.\r\n\r\nAutomatic Re-locking: Fitted with Automatic Re-locking device.\r\n\r\nTest &amp; Approvals: Achieved the following international test certificates.\r\n1. JIS - Japan Standard\r\n2. KS - Korea Standard\r\n3. SINTEF - Norway Standard\r\n4. CNAL - China Standard\r\n\r\nBuilt in Alarm: (Optional) To set off anti burglary alarm</pre>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="arial_12pt" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-decoration: none;" border="0" cellspacing="2" cellpadding="2" width="100%" align="center">\r\n<tbody>\r\n<tr>\r\n<td colspan="8">\r\n<h4>SIZE (APPROX.) &amp; BRIEF SPECIFICATION</h4>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="8">\r\n<table class="arial_12pt" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: #000000; text-decoration: none;" border="1" cellspacing="2" cellpadding="2" width="100%">\r\n<tbody>\r\n<tr bgcolor="#660000">\r\n<td class="arial_11pt_white" style="font-family: Arial, Helvetica, sans-serif; font-size: 11px; color: #ffffff; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 6px; text-decoration: none;" width="45%" height="35"><strong>Model</strong></td>\r\n<td class="arial_11pt_white" style="font-family: Arial, Helvetica, sans-serif; font-size: 11px; color: #ffffff; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 6px; text-decoration: none;" width="55%"><strong>AS-180</strong></td>\r\n</tr>\r\n<tr>\r\n<td width="45%">Outside</td>\r\n<td width="55%">H900 X W600 X D570 mm</td>\r\n</tr>\r\n<tr>\r\n<td>Inside</td>\r\n<td>H693 X W462 X D360 mm</td>\r\n</tr>\r\n<tr>\r\n<td>Weight</td>\r\n<td>180 Kgs</td>\r\n</tr>\r\n<tr>\r\n<td>Accessory</td>\r\n<td>1 Shelf, 1 Drawer</td>\r\n</tr>\r\n<tr>\r\n<td>Capacity</td>\r\n<td>116L</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', '', '', '', ''),
(163, 'EN', 'NX200 20.3 Megapixel Compact System Camera', '', '', '<p>Capture every moment in true-to-life quality. With the best-in-class resolution of the extra large 20.3 MP APS-C CMOS sensor, shots are rich, deep and exquisitely detailed. For active subjects, stills can be captured beautifully with 7fps Continuous Shot/100ms AF Speed. Then review your shot on the large 3.0&rdquo; AMOLED display&mdash;made for sharper images and glare reduction.</p>', '', '', '', '', ''),
(164, 'EN', 'WB210 10MB 14 Megapixel Slim Digital Camera (Red)', '', '', '<p>When shooting in low light, zooming in on a shot, or when your camera is unsteady, Optical Image Stabilization helps eliminate blurry results. This feature stabilizes your photos by changing their path to the image sensor before they are recorded digitally. Your photos come out sharp and ideally focused.</p>', '', '', '', '', ''),
(165, 'EN', 'Nikon 1 J1 One-Lens Kit White', '', '', '<p>For your very mobile lifestyle comes a completely new imaging system with freedom to create and express as never before. Highly compact and portable, the Nikon 1 J1 goes everywhere you go. Moments from your amazing world are captured using a highly responsive autofocus and super fast shooting speed. In one touch you can work in Full HD (1080p) movie record mode. A camera so versatile you can even snap photos while recording movies. Unleash your creativity with Nikon 1&mdash;offering a balance of high performance, advanced features, portability and a newly designed interchangeable lens system. Infuse your world with photos from every moment and connect as never before.</p>', '', '', '', '', ''),
(166, 'EN', 'Nikon 1 J1 Two-Lens Wide Angle Kit  Red', '', '', '<p>For your very mobile lifestyle comes a completely new imaging system with freedom to create and express as never before. Highly compact and portable, the Nikon 1 J1 goes everywhere you go. Moments from your amazing world are captured using a highly responsive autofocus and super fast shooting speed. In one touch you can work in Full HD (1080p) movie record mode. A camera so versatile you can even snap photos while recording movies. Unleash your creativity with Nikon 1&mdash;offering a balance of high performance, advanced features, portability and a newly designed interchangeable lens system. Infuse your world with photos from every moment and connect as never before.</p>', '', '', '', '', ''),
(167, 'EN', 'D3100 + 18-55 VR Lens Kit', '', '', '<p>Beautiful pictures&ndash;Amazing movies&ndash;Incredibly Easy with the 14 Megapixel DX sensor and learn-as-you-grow Guide Mode.</p>', '', '', '', '', ''),
(168, 'EN', 'D300S (Body Only)', '', '', '<p>Extraordinary still and HD video imaging performance converge in the fast and agile 12.3-megapixel, DX-format D300S, delivering D-SLR versatility.</p>', '', '', '', '', ''),
(169, 'EN', 'D5100 + AF-S DX NIKKOR 18-55mm f/3.5-5.6G VR Lens Kit', '', '', '<p>Creativity from any point of view. <br />Pictures that amaze. Movies that inspire.</p>', '', '', '', '', ''),
(170, 'EN', '588 Chrome Wedge', '', '', '<p>The 588 Forged wedge maintains the popular, tour-proven shape of its predecessor with a series of technological breakthroughs to provide even more performance. Every wedge is Precision Forged from 1025 carbon steel for incredibly soft, solid feel and the highest level of manufacturing consistency for supreme confidence and trust over every shot. Tour Zip Grooves&trade; and Laser Milled&trade; technology maximize spin in accordance with USGA regulations. Exclusive to the 588 Forged wedge is the Tour Concept Wedge steel shaft, co-developed and engineered by Cleveland Golf and industry leader True Temper. With a unique stiffness profile that features a less active tip, this shaft promotes a more penetrating ball flight, increased spin and optimal distance control along with superior feel. Choose from two different finishes &ndash; Satin and Chrome &ndash; as well as low, standard and high bounce options.</p>', '', '', '', '', ''),
(171, 'EN', 'Swingline Stack-and-Shred 100X Hands Free Shredder', '', '', '<p>\r\n<p style="padding-top: 0px; padding-bottom: 10px; color: #424242; font-family: arial, verdana, sans-serif; font-size: 11px; margin: 0px;">\r\n<h2 style="font-size: 13px; padding: 0px; margin: 0px;"><span id="_ctl0_MainContent__ctl0_lblProdName" style="padding: 0px; margin: 0px;">Swingline&trade; Stack-and-Shred&trade; 100X Hands Free Shredder</span></h2>\r\n<p style="padding-top: 0px; padding-bottom: 10px; color: #424242; margin: 0px;"><span id="_ctl0_MainContent__ctl0_lblWebCopy" style="padding: 0px; margin: 0px;">Experience the productivity of hands free shredding. The Swingline&trade; Stack-and-Shred&trade; shredder works without your supervision; just stack, shut and you''re done. Stack up to 100 sheets for automatic shredding at home or in the office. Manual bypass handles 6 sheets of glossy, folded or crumpled paper.</span></p>\r\n<ul style="margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 15px;">\r\n<span id="_ctl0_MainContent__ctl0_lblFeatBenefits" style="padding: 0px; margin: 0px;">\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Hands free shredding-just stack, shut and you''re done</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Auto+ jam clearance automatically reverses and re-feeds stuck papers to clear any jam. LED light indicates rare jams that require user action.</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Cross-cut shredder meets moderate security needs (Level 3)</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Shreds credit cards, paper clips, staples, documents into 7-gallon waste bin with view window</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">100 sheet shred capacity on automatic operation, 6 sheet shred capacity on manual</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Self Clean feature extends cutter life</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">2-year warranty on machine, 2-year on cutters</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Dimensions: 17&rdquo;H x 12&rdquo;W x 14&rdquo;D, fits under a desk</li>\r\n</span>\r\n</ul>\r\n</p>\r\n</p>', '', '', '', '', ''),
(172, 'EN', 'Compact Full HD Camcorder', '', '', '<p>The T10 camcorder was designed to capture memories in comfort and in style. It boasts an ultra compact size, alightweight body and a brushed metal finish creating a subtle but sophisticated look and feel. In fact, its smooth curves fit so comfortably in your hand, it makes shooting video for longer periods of time more enjoyable</p>', '', '', '', '', ''),
(173, 'EN', 'H300 Long Zoom Compact Full HD Camcorder (Black)', '', '', '<p>3.0" LCD Touch Panel display gives you a clearer picture of what you are shooting. By leveraging the latest in LCD display technology, the Touch Panel delivers clean, crisp images that are saturated with natural color and deep, dynamic detail, enabling you to shoot with enhanced comfort and confidence in any external light condition. With the large 3.0" display, it&rsquo;s much easier to browse through content and find the exact features you&rsquo;re looking for. Most useful, the extra large LCD screen makes it easier to select the features you need.</p>', '', '', '', '', ''),
(174, 'EN', 'Swingline Optima 20 Electric Stapler', '', '', '<p>&nbsp;</p>\r\n<h2 style="color: #424242; font-size: 13px; font-family: arial, verdana, sans-serif; padding: 0px; margin: 0px;"><span id="_ctl0_MainContent__ctl0_lblProdName" style="padding: 0px; margin: 0px;">Swingline&reg; Optima&reg; 20 Electric Stapler</span></h2>\r\n<p style="padding-top: 0px; padding-bottom: 10px; color: #424242; font-family: arial, verdana, sans-serif; font-size: 11px; margin: 0px;"><span id="_ctl0_MainContent__ctl0_lblWebCopy" style="padding: 0px; margin: 0px;">Quiet, space-saving desktop electric stapler is packed with user-friendly features including intuitive user control that helps provide accurate staple placement.</span></p>\r\n<ul style="margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 15px; color: #424242; font-family: arial, verdana, sans-serif; font-size: 11px;">\r\n<span id="_ctl0_MainContent__ctl0_lblFeatBenefits" style="padding: 0px; margin: 0px;">\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Jam free stapling guaranteed when using S.F.&reg; 4&reg; or Optima&trade; Premium Staples</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Durable construction to withstand everyday use</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Convenient, built-in detachable staple remover &amp; LED light to indicates low staple count</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Manual or automatic operation, with both plug-in and battery power options</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">20 sheet stapling capacity</li>\r\n<li style="list-style-image: url(http://www.acco.com/swingline/assets/images/li_plus.gif); margin: 0px;">Limited 5-year warranty &amp; 100% Performance Guarantee</li>\r\n</span> \r\n</ul>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(175, 'EN', 'F50 Flash Memory 52x Zoom Camcorder (Silver)', '', '', '<p>2.7&rdquo; LCD Touch Panel display gives you a clearer picture of what you are shooting. By leveraging the latest in LCD display technology, the Touch Panel delivers clean, crisp images that are saturated with natural color and deep, dynamic detail, enabling you to shoot with enhanced comfort and confidence in any external light condition.</p>', '', '', '', '', ''),
(176, 'EN', 'Quartet Euro Magnetic Porcelain Total Erase Mobile Easel', '', '', '<p>\r\n<p class="prod16bold" style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-weight: bold; font-size: 16px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;"><span id="_ctl0_MainContent_lblTitle">Quartet&reg; Euro&trade; Magnetic Porcelain Total Erase&reg; Mobile Easel</span></p>\r\n<p class="body12" style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;"><span id="_ctl0_MainContent_lblDescription">Ultra-durable, ultra-smooth 27" x 41" mobile presentation easel with DuraMax&reg; porcelain surface that will not scratch, dent, stain or ghost. Delivers superior performance when collaboration is needed in high-profile, heavy-use office environments. Magnetic surface doubles as bulletin board. Easy-to-clean writing surface requires minimal use of Quartet&reg; cleaning solutions. Adjustable hooks and clamp hold standard-sized flipcharts for easy sheet tear-away meeting notes. Smooth-rolling 5-caster star-base wheels lock firmly in place for total control and mobility. Flexible spring-loaded height adjuster moves from 67" to 77" for optimal height. Includes spacious folding accessory tray and 4 assorted Quartet&reg; whiteboard markers. Sleek Euro&trade; design with matte aluminum finish for maximum style and durability. 100% Satisfaction Guaranteed.</span></p>\r\n<p class="body12" style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;"><span id="_ctl0_MainContent_lblFeatures">&nbsp;</span></p>\r\n<ul style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;">\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Ultra-durable, ultra-smooth 27" W x 41" H mobile presentation easel with DuraMax&reg; porcelain surface that will not scratch, dent, stain or ghost</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Delivers superior performance when collaboration is needed in high-profile, heavy-use office environments</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Magnetic surface doubles as bulletin board</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Adjustable hooks and clamp hold standard-sized flipcharts for easy sheet tear-away</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Easy-to-clean writing surface requires minimal use of Quartet&reg; cleaning solutions</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Smooth-rolling 5-caster star-base wheels lock firmly in place for total control and mobility</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Flexible spring-loaded height adjuster moves from 67" to 77" for optimal height</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Includes spacious folding accessory tray and 4 assorted Quartet&reg; whiteboard markers</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Sleek Euro&trade; design with matte aluminum finish for maximum style and durability</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">100% Satisfaction Guaranteed</li>\r\n</ul>\r\n</p>', '', '', '', '', ''),
(177, 'EN', 'CG BLACK DRIVER', '', '', '<p>With a sleek and striking look, the CG Black driver weighs only 265 grams, making it the lightest driver on the market to help players generate measurable increases in swing speed and distance with the same swing effort. The advanced aerodynamics found in the driver&rsquo;s Speed Crown Design &ndash; an innovative, teardrop-inspired crown profile &ndash; maximize distance by reducing drag at all angles of airflow during the swing. MaxCOR2 Variable Face Thickness Technology reduces face weight and increases trampoline effect on off-center hits, meaning higher ball speed and more distance on off-center hits. Plus, a high-density weight screw at the rear of the sole plate positions the center of gravity lower and deeper to promote a high, draw-biased trajectory with optimal launch conditions for effortless distance. The CG Black driver features a Miyazaki C. Kua 39 Limited Edition graphite shaft and a Golf Pride Ultralite grip, a combination that decreases overall club weight for faster swing speed.</p>', '', '', '', '', ''),
(178, 'EN', 'Wilson Jones 364 Heavy Duty Round Ring Binder with Label Holder, 1", Black', '', '', '<p>\r\n<p class="body12" style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;"><span id="_ctl0_MainContent_lblDescription">Built to last, this heavy duty binder with standard round rings is made of flexible polypropylene allowing it to fully protect your documents from the elements. The label holder on the binder spine is perfect for titling your projects.</span></p>\r\n<p class="body12" style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;"><span id="_ctl0_MainContent_lblFeatures">&nbsp;</span></p>\r\n<ul style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;">\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">220 sheet capacity in 1 inch binder size</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">No-Gap round rings close tightly</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Eco-friendly, PVC Free polypropylene material is virtually impossible to tear</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">100% recycled chipboard and 45% post consumer waste minimum recycled content</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">CleanView&trade; protection prevents ink from transferring off papers onto binder</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Two clear interior pockets and label holder on spine</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Available in black, blue and dark red, multiple sizes</li>\r\n</ul>\r\n</p>', '', '', '', '', ''),
(179, 'EN', 'CG16 Black Pearl Wedge', '', '', '<div class="overviewbody">\r\n<p>Based on the shape of the tour proven CG14<span style="font-size: 8pt;">&trade;</span> wedge, the CG16<span style="font-size: 8pt;">&trade;</span> has a hint of offset and is slightly larger for added forgiveness.&nbsp; The face features the same spin maximizing technology featured on the CG15<span style="font-size: 8pt;">&trade;</span> wedge &ndash; Tour Zip Grooves<span style="font-size: 8pt;">&trade;</span> in combination with Cleveland<span style="font-size: 8pt;">&reg;</span> Golf&rsquo;s breakthrough Laser Milled<span style="font-size: 8pt;">&trade; </span>surface roughness technology.&nbsp; Using the precision accuracy of a laser, each face features four perfectly calibrated texture lines milled between each groove exactly to the conforming roughness limit.&nbsp; This surface roughness application optimizes ball-to-face friction and maximizes spin within the Rules of Golf.</p>\r\n</div>', '', '', '', '', ''),
(180, 'EN', '18-55mm Portrait Lens', '', '', '<p>Certain photos vividly remind you of memorable moments even at a quick glance. You can treasure such everlasting, memories with the 18-55mm lens. This lens enables you to create diverse images from any scene, including wide-angle and portrait shots, making your precious moments last forever.</p>', '', '', '', '', ''),
(181, 'EN', 'Women''s Bloom Complete Set', '', '', '<p>Created for women golfers looking to improve their game, the Bloom 14 Piece set covers all of her equipment needs. Designed specifically for her swing, the 100% titanium Driver and Stainless Steel Fairway woods are designed with today&rsquo;s modern lightweight and oversized technology to drastically increase distance and consistency-particularly on mishits. The hybrid long irons are hollow and extremely forgiving and are packaged together with the short game simplifying NIBLICK &ndash; to make the game even easier to learn. If that isn&rsquo;t enough, the classically designed mini boot bag has retro details yet modern convenience with ample pocket space and detachable wristlet.</p>', '', '', '', '', ''),
(182, 'EN', 'GBC Smart-View 3-Ring Report Cover', '', '', '<p>\r\n<p class="body12" style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;"><span id="_ctl0_MainContent_lblDescription">Clear front cover folds back and keeps title sheet intact by securing it inside cover edge. Interior 3-ring design holds 3-hole punched report pages.</span></p>\r\n<p class="body12" style="margin-top: 0px; margin-right: 0px; margin-bottom: 15px; margin-left: 0px; color: #333333; font-size: 12px; text-align: left; text-decoration: none; font-family: Verdana, Arial, Helvetica, sans-serif; background-color: #ffffff;"><span id="_ctl0_MainContent_lblFeatures">&nbsp;</span></p>\r\n<ul style="color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; text-align: left; background-color: #ffffff;">\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Durable polypropylene material</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Rings hold up to 40 3-hole punched sheets</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Soft, rounded spine and textured cover</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Large back pocket with business card holder</li>\r\n<li class="body12" style="color: #333333; font-size: 12px; text-align: left; text-decoration: none;">Black</li>\r\n</ul>\r\n</p>', '', '', '', '', ''),
(183, 'EN', 'Samsung 50-200mm NX Telephoto OIS Lens', '', '', '<p>The Samsung T50200SB 50-200mm Telephoto OIS Lens is a long telephoto zoom lens compatible with our NX Series of digital cameras.</p>', '', '', '', '', ''),
(184, 'EN', 'Samsung 30mm NX Pancake Lens', '', '', '<p>Samsung&rsquo;s compact 30mm pancake lens is the brightest in its class. With its 30mm fixed focal length and maximum aperture of F/2, you can capture exceptionally bright images &mdash; even in low-light situations such as shady forest paths and indoor weddings. You can also create striking, images with shallow depth of field in a variety of settings. And since it&rsquo;s incredibly slim and lightweight, you can take it with you everywhere.</p>', '', '', '', '', ''),
(185, 'EN', 'CG Lightweight Cart Bag', '', '', '<p>CG Lightweight Cart bags are perfect for push and power carts</p>', '', '', '', '', ''),
(186, 'EN', 'CG Black Staff Bag', '', '', '<h3 class="product_availability">Item is not available at this time.<br />Can be Preordered.</h3>', '', '', '', '', ''),
(187, 'EN', '2010 TOUR STAFF Bag 10"', '', '', '<p>Used by Cleveland Golf tour staff players worldwide</p>', '', '', '', '', ''),
(188, 'EN', 'NEW Wilson Staff Fifty Elite Yellow Golf Ball', '', '', '<p>An aggressive core is offset by a responsive cover; Explosive distance is coupled with soft feel; Low driver spin is offset by high greenside spin; Long carry, quick stop</p>', '', '', '', '', ''),
(189, 'EN', 'AF-S NIKKOR 14-24mm f/2.8G ED', '', '', '<p>Fast aperture, high-performance, ultra-wide-angle zoom optimized for FX- and DX-format sensors featuring Nikon&rsquo;s exclusive ED Glass and Nano Crystal Coat.</p>', '', '', '', '', ''),
(190, 'EN', 'AF-S DX NIKKOR 10-24mm f/3.5-4.5G ED', '', '', '<p>This ultra wide-angle lens, designed exclusively for use with Nikon&rsquo;s DX-format, provides a versatile wide-angle zoom perspective.</p>', '', '', '', '', '');
INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`) VALUES
(191, 'EN', 'Esperanza Spalding - Radio Music Society', '', '', '<p>\r\n<p>THIS IS A PRE ORDER ITEM.</p>\r\n<p>IF PURCHASED, YOUR ITEM(S) WILL SHIP ON OR FOR DELIVERY ON MARCH 20, 2012</p>\r\n<p>&nbsp;</p>\r\n<p>ESPERANZA SPALDING RELEASES RADIO MUSIC SOCIETY,</p>\r\n<p>A KALEIDOSCOPIC COLLECTION CELEBRATING THE POWER OF SONG</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>CD With ADDED Value Download Card Card To Download 11 Music Videos</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Radio Song,&rdquo; the new disc&rsquo;s opening track, both sets the tone and confirms the aptness of Spalding&rsquo;s &ldquo;radio music&rdquo; metaphor. &ldquo;Everyone has the experience of turning on a car radio,&rdquo; she explains,&rdquo; mindlessly flipping through the dial and suddenly a fragment grabs you and you&rsquo;re totally digging it. I wanted to capture that moment when the music just sinks in. It&rsquo;s about the power of song, and how at the least it can save the day.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Fleshing out the concept with original music was second nature to Spalding. &ldquo;I have this book of music that I&rsquo;ve written, and so much of it fit either the Chamber Music or Radio Music concept. Songs develop for me in fragments, so for these projects, I took my notes and organized them into coherent works of music.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>In the process, Spalding added her original, affirmative perspective to classic radio music themes. Songs about love run a full gamut. &ldquo;Hold On Me&rdquo; is a narrative of unrequited love, inspired by people who cling to dreams of relationships that can never be realized. &ldquo;Let Her,&rdquo; one of Spalding&rsquo;s older compositions, was inspired by &ldquo;different people I&rsquo;ve known who are in miserable situations, then complain when they end.&rdquo; &ldquo;Cinnamon Tree,&rdquo; written to cheer up a friend, celebrates platonic love, and Spalding&rsquo;s belief that &ldquo;the love between friends is just as important as romantic love.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Crowned and Kissed,&rdquo; with references to King Arthur and Midas, is about &ldquo;the unsung royalty in your life, men and women who quietly, every day do the most honorable things, and who deserve to be honored even if they don&rsquo;t end up with castles and thrones.&rdquo; The edgy &ldquo;Smile Like That&rdquo; marks the moment a person realizes that his or her partner has developed other interests. &ldquo;I&rsquo;m saying, `Okay, I get it, let&rsquo;s not beat around the bush,&rdquo;&rsquo; Spalding explains.</p>\r\n<p>&nbsp;</p>\r\n<p>Her takes on the state of our country and our culture are equally fresh and insightful. &ldquo;Vague Suspicions&rdquo; confronts society&rsquo;s short attention span and our habit of absorbing horrific events and celebrity gossip as part of the same media overload. The brief &ldquo;Land Of The Free&rdquo; speaks to the sinister system of false imprisonment by outlining the case of one innocent victim who spent 30 years in jail for a crime he did not commit.</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Black Gold&rdquo; is specifically addressed to young boys of color. &ldquo;So much of our strength is drawn from resistance and endurance,&rdquo; she explains, &ldquo;but black pride didn&rsquo;t just start with the slave trade. I wanted to address our nobility, going back to our incredible ancestors in pre-colonial Africa. I remember meetings when I was in elementary school about being strong as young black women, and I don&rsquo;t think the boys had those meetings. This song is meant to speak to those young men, and I imagined it might one day be something that a parent could sing to his or her son.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Radio Music Society also features &ldquo;City of Roses,&rdquo; a celebration of her native Portland, Oregon that Spalding was commissioned to write by Banana Republic, and two cover tunes. Taking the advice of one of her mentors, tenor saxophone giant Joe Lovano: &ldquo;When you do a classic, you have to find your own reason for doing it.&rdquo; Spalding charges Stevie Wonder&rsquo;s &ldquo;I Can&rsquo;t Help It&rdquo; with the energy of apprehensive new love and adds original lyrics to Wayne Shorter&rsquo;s &ldquo;Endangered Species&rdquo;.</p>\r\n<p>&nbsp;</p>\r\n<p>The music is realized by many of the brilliant musicians who are part of Spalding&rsquo;s ever-expanding universe. In addition to longtime partners Lovano, keyboard player Leo Genovese and drummer Terri Lyne Carrington, the ranks contain jazz legends Jack DeJohnette and Billy Hart; guitar heroes Jef Lee Johnson and Lionel Loueke; an array of master vocalists including Algebra Blessett, Lalah Hathaway, Gretchen Parlato, Leni Stern and Becca Stevens; hip-hop giant Q-Tip (who performs on and co-produced two tracks); and two Portland-based musicians, Janice Scroggins and Dr. Thara Memory, who provided essential mentorship in Spalding&rsquo;s youth.</p>\r\n<p>&nbsp;</p>\r\n<p>Four tracks feature the horn section of the American Music Program, a youth big band of musicians age 12 to 18 directed by her longtime mentor and teacher Dr. Memory, who conducts and provides horn arrangements; while the soulful pianist on &ldquo;Hold on Me&rdquo; is Ms. Scroggins, who Spalding studied with as a child. &ldquo;Both of them are phenomenal artists who aren&rsquo;t well known outside of the Northwest,&rdquo; Spalding emphasizes. &ldquo;Janice Scroggins was, quite honestly, too deep for me when I was eight years old. She unifies completely the sounds of gospel, blues and jazz, our American roots music. And Dr. Thara Memory, the teacher I came up through, has dedicated his life to spreading the message of this music. I had to have his youth band on the record, because they&rsquo;re part of my Music Society, too.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Among its many strengths, Radio Music Society is a celebration of the men and women who have helped cultivate Spalding&rsquo;s talent, as well as those who have nurtured her vision and inspired her along the way. &ldquo;I&rsquo;ve had the honor and blessing of working with so many phenomenal jazz musicians over the years,&rdquo; she says. &ldquo;As I&rsquo;ve gotten to know them and their music, I&rsquo;ve grown to love them as family and colleagues. I wished for an opportunity for us all to interpret songs together, so that they can be heard and received by a larger audience. All my personal heroes who are revered in the jazz world &ndash; like Joe Lovano and Terri Lyne Carrington &ndash; should be heard by a mainstream audience, because what they manifest in their music is so beautiful, sincere and uplifting. I think they literally bring good into the lives of the people who hear them. So I&rsquo;ve tried to put together a program of music that speaks to the non-jazz listener, but can still provide a viable foundation for my jazz heroes to express themselves. Hopefully, people can enjoy all the elements of my music without being told which genres it is &lsquo;supposedly&rsquo; a blend of. Everyone is invited to listen with no pre-conceived notions. It&rsquo;s a journey. Think and feel for yourself. But, most importantly, ENJOY!&rdquo;</p>\r\n</p>', '', '', '', '', ''),
(192, 'EN', 'Black and White America (CD Pack)', '', '', '<p><span style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #ffffff;">Tracklisting:</span><br style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #cac5c5; padding: 0px; margin: 0px;" /><span style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #ffffff;">1. Black And White America</span><br style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #cac5c5; padding: 0px; margin: 0px;" /><span style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #ffffff;">2. Come On Get It</span><br style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #cac5c5; padding: 0px; margin: 0px;" /><span style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #ffffff;">3. In The Black</span><br style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #cac5c5; padding: 0px; margin: 0px;" /><span style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #ffffff;">4. Liquid Jesus</span><br style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: #cac5c5; padding: 0px; margin: 0px;" /><span style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 16px; text-align: left; background-color: