(205, 'EN', 'DIR-657 HD Media Router 1000', '', '', '<p>&nbsp;</p>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; vertical-align: baseline; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 16px; font-family: myriad-pro-1, myriad-pro-2; visibility: visible; color: #555555; border: 0px initial initial;">Up to 300 Mbps speed, 4 Gigabit Ethernet ports and HD Fuel bandwidth prioritization combine to optimize your online entertainment for seamless HD video streams, high-performance gaming, and VOIP calls without annoying glitches or lags. There&rsquo;s a Shareport USB to allow for device printing, an SD Card slot for accessing HD media files and with DLNA, the HD Media Router can connect to virtually any device. The HD Media Router 1000 has been designed to keep up with your connected lifestyle and deliver the uninterrupted connectivity you need to power multiple devices, simultaneously, and keep you in command of your digital universe.<em style="vertical-align: baseline; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding: 0px; margin: 0px; border: 0px initial initial;"><br /></em></p>\r\n<h3 style="margin-top: 10px; margin-right: 0px; margin-bottom: 6px; margin-left: 0px; font-size: 14px; font-weight: 400; vertical-align: baseline; border-image: initial; outline-width: 0px; outline-style: initial; outline-color: initial; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 14px; font-family: myriad-pro-1, myriad-pro-2; visibility: visible; color: #e22736; padding: 0px; border: 0px initial initial;"