ord Of Honor</li>\r\n</ul>\r\n<br />Disc: 2\r\n<ul class="wiki_list">\r\n<li class="wiki_listitem">1. Be Careful With A Fool</li>\r\n<li class="wiki_listitem">2. Please Accept My Love</li>\r\n<li class="wiki_listitem">3. Days Of Old</li>\r\n<li class="wiki_listitem">4. Worry, Worry</li>\r\n<li class="wiki_listitem">5. Confessin'' The Blues</li>\r\n<li class="wiki_listitem">6. Sweet Sixteen Parts 1 &amp; 2</li>\r\n<li class="wiki_listitem">7. Ain''t Nobody''s Business</li>\r\n<li class="wiki_listitem">8. Walkin'' Dr. Bill</li>\r\n<li class="wiki_listitem">9. My Own Fault</li>\r\n<li class="wiki_listitem">10. You Done Lost Your Good Thing Now</li>\r\n<li class="wiki_listitem">11. Downhearted (How Blue Can You Get?)</li>\r\n<li class="wiki_listitem">12. I''ll Survive</li>\r\n<li class="wiki_listitem">13. Mashed Potato Twist</li>\r\n<li class="wiki_listitem">14. Down Now</li>\r\n<li class="wiki_listitem">15. Peace Of Mind</li>\r\n<li class="wiki_listitem">16. That Evil Child</li>\r\n<li class="wiki_listitem">17. Blues Stay Away From Me</li>\r\n<li class="wiki_listitem">18. Rock Me Baby</li>\r\n<li class="wiki_listitem">19. Miss Martha King</li>\r\n<li class="wiki_listitem">20. When Your Baby Packs Up And Goes</li>\r\n</ul>\r\n</div>\r\n</p>', '', '', '', '', ''),
(200, 'EN', 'John Rutter - The Colours of Christmas', '', '', '<p>\r\n<p>The Colours of Christmas is a collection of the greatest Christmas carols by the composer/conductor whose music has, for many, been so associated with Christmas. Featuring the Royal Philharmonic Orchestra and The Bach Choir, with guest artists Over the Bridge and conducted by Rutter himself.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>The Colours of Christmas (track 2 from the album) is a newly composed carol by Rutter for this new album, and is testament to the very best of Rutter&rsquo;s music. Newly orchestrated for this album are the carols Ding Dong! Merrily On High and Hark! The Herald Angels Sing. All recordings on this album are brand new.</p>\r\n<p>TRACKLISTING</p>\r\n<p>1. Ding Dong! Merrily on High&nbsp;</p>\r\n<p>2. The Colours of Christmas&nbsp;</p>\r\n<p>3. In Dulci Jubilo&nbsp;</p>\r\n<p>4. What is this lovely fragrance?&nbsp;</p>\r\n<p>5. Away in a Manger&nbsp;</p>\r\n<p>6. Hodie Christus natus est&nbsp;</p>\r\n<p>7. Riu riu chiu&nbsp;</p>\r\n<p>8. I wonder as I wander&nbsp;</p>\r\n<p>9. Star Carol&nbsp;</p>\r\n<p>10. Once in Royal David''s City&nbsp;</p>\r\n<p>11. Silent Night&nbsp;</p>\r\n<p>12. In the bleak midwinter&nbsp;</p>\r\n<p>13. Gabriel''s Message&nbsp;</p>\r\n<p>14. Fanfare - O come, all ye faithful&nbsp;</p>\r\n<p>15. O Holy Night&nbsp;</p>\r\n<p>16. A New Year Carol&nbsp;</p>\r\n<p>17. Joy to the World&nbsp;</p>\r\n<p>18. Sleigh Ride&nbsp;</p>\r\n<p>19. Deck the Hall&nbsp;</p>\r\n<p>20. The Christmas Song&nbsp;</p>\r\n<p>21. The Twelve Days Of Christmas&nbsp;</p>\r\n<p>22. Have yourself a merry little Christmas&nbsp;</p>\r\n<p>23. Fanfare - Hark! the herald angels sing</p>\r\n</p>', '', '', '', '', ''),
(201, 'EN', 'Beethoven Piano Concertos Nos. 1 & 2', '', '', '<p>\r\n<p>ROYAL PHILHARMONIC ORCHESTRA&nbsp;</p>\r\n<p>PIANO: MARIO GALEANI&nbsp;</p>\r\n<p>CONDUCTOR: GRZEGORZ NOWAK</p>\r\n<p>&nbsp;</p>\r\n<p>Mario Galeani and Grzegorz Nowak partner once more in a new disc of Beethoven piano concertos.</p>\r\n<p>TRACKLISTING</p>\r\n<p>Piano Concerto No.1 in C Major, Op.15&nbsp;</p>\r\n<p>1. Allegro con brio&nbsp;</p>\r\n<p>2. Largo&nbsp;</p>\r\n<p>3. Rondo: Allegro scherzando&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Piano Concerto No.2 in B Flat Major, Op.19&nbsp;</p>\r\n<p>4. Allegro con brio&nbsp;</p>\r\n<p>5. Adagio&nbsp;</p>\r\n<p>6. Rondo: Molto allegro&nbsp;</p>\r\n</p>', '', '', '', '', ''),
(202, 'EN', 'New Year''s Concert 2011 Diverse Klassik Welser-moest / Wiener Philharmoniker', '', '', '<p><strong style="color: #333333; font-family: ''Trebuchet MS'', serif, Times, ''Times New Roman''; font-size: 12px; line-height: 18px; background-color: #ffffff;">New Year''s Concert 2011</strong><br style="color: #333333; font-family: ''Trebuchet MS'', serif, Times, ''Times New Roman''; font-size: 12px; line-height: 18px; background-color: #ffffff;" /><span style="color: #333333; font-family: ''Trebuchet MS'', serif, Times, ''Times New Roman''; font-size: 12px; line-height: 18px; background-color: #ffffff;">Diverse Klassik</span><br style="color: #333333; font-family: ''Trebuchet MS'', serif, Times, ''Times New Roman''; font-size: 12px; line-height: 18px; background-color: #ffffff;" /><span style="color: #333333; font-family: ''Trebuchet MS'', serif, Times, ''Times New Roman''; font-size: 12px; line-height: 18px; background-color: #ffffff;">Welser-moest / Wiener Philharmoniker</span></p>', '', '', '', '', ''),
(203, 'EN', 'New Year''s Concert 2012 Diverse Wr.Philharmoniker / Jansons,M. / Wr.Sn', '', '', '<p><span style="color: #333333; font-family: ''Trebuchet MS'', serif, Times, ''Times New Roman''; font-size: 12px; line-height: 18px; background-color: #ffffff;">The traditional Vienna Philharmonic New Year''s Concert on January 1, 2012, will be conducted for the second time by the Latvian conductor Mariss Jansons. Ever since the first concert together in April 1992, Mariss Jansons has belonged to the circle of conductors with whom the Vienna Philharmonic feels a special bond. His first New Year''s Concert in 2006 was widely acclaimed by both audiences and the media. The New Year''s Concert 2012 will once again be broadcast by the ORF to over 70 television networks and 300 radio stations worldwide.&nbsp;</span></p>', '', '', '', '', ''),
(204, 'EN', 'The Police - The Stewart Copeland Anthology', '', '', '<p><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #ffffff; color: #000000;">Collecting The Police''s drummer''s solo work on one CD.&nbsp;</span><br style="color: #ffffff; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #000000;" /><br style="color: #ffffff; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #000000;" /><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #ffffff; color: #000000;">Track Listing:</span><br style="color: #ffffff; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #000000;" /><br style="color: #ffffff; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #000000;" /><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #ffffff; color: #000000;">1. Too Kool To Kalypso&nbsp;</span><br style="color: #ffffff; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #000000;" /><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #ffffff; color: #000000;">2. Don''t Box Me In</span><br style="color: #ffffff; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #000000;" /><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #ffffff; color: #000000;">3. Tulsa Tango</span><br style="color: #ffffff; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: left; background-color: #000000;" /><span style="font-family: Ver