INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`) VALUES
(206, 'EN', 'RT-N66U Dual-Band Wireless-N900 Gigabit Router', '', '', '<p>&nbsp;</p>\r\n<div id="product_content_area" class="component_style" style="padding-top: 40px; padding-right: 40px; padding-bottom: 20px; padding-left: 40px; border-image: initial; font-size: 12px; font-family: Arial, Helvetica, sans-serif; background-image: url(http://usa.asus.com/images/overview_bg.gif); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: #ffffff; position: relative; float: left; width: 870px; z-index: 1; color: #222222; line-height: 18px; background-position: 50% 0%; background-repeat: no-repeat repeat; margin: 0px; border: 0px initial initial;">\r\n<div id="overview" class="clearfix" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;"><span id="ctl00_ContentPlaceHolder1_ctl00_overview1_span_overview" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<div style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;"><span style="border-image: initial; font-weight: bold; font-style: inherit; font-size: 25px; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">Incredible Performance with Incredible Control</span>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">The ASUS RT-N66U dual-band wireless-N900 gigabit router delivers incredible performance and coverage range. With new ASUSWRT UI, quickly setup your network, customize user access, and monitor signal strength. Following the award-winning RT-N56U, the RT-N66U increases Wi-Fi speed for both 5 GHz and 2.4 GHz transmission by 50% up to 900Mbps that makes it ideal for bandwidth demanding tasks such as 3D HD video steaming, multiplayer gaming, USB hard drive file sharing, and USB connected printer sharing. Built-in Wi-Fi amplifiers make the RT-N66U the perfect wireless router for larger, multi-level homes and buildings with signal range that reaches virtually any area.<br style="padding: 0px; margin: 0px;" /><br style="padding: 0px; margin: 0px;" />Whether you&rsquo;re a tech-savvy enthusiast or a first-time user, the RT-N66U is exceptional easy to use with CD-free, Quick Installation Setup (QIS) that lets you plug-n-surf right out of the box and connect PCs, smartphones, tablets, and other wireless devices quickly. Thanks to its refined interface tools, you get control like never before, letting you monitor signal strength, setup parental settings, and other useful functions in a robust yet intuitive way.</p>\r\n</div>\r\n<div style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Designed for Class-Leading Speed and Range</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Designed with the latest in networking technology, the RT-N66U delivers exceptionally fast wired and wireless connectivity. What&rsquo;s more, it comes with a powerful detachable Wi-Fi antenna to further extend wireless range.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img style="border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/transparent.jpg" alt="" width="850" height="268" /></p>\r\n</div>\r\n<br style="padding: 0px; margin: 0px;" />\r\n<div class="columns_ab" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<div class="column" style="border-image: initial; font-style: inherit; font-family: inherit; float: left; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Dual-Band Connectivity for Lag-Free Entertainment</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Delivering both 2.4 GHz and 5 GHz concurrent bands up to 450Mbps and 450Mbps respectively, the RT-N66U has a total speed of up to 900Mbps connectivity to provide speed with stability. Perform basic internet tasks like Web browsing and file downloading under the 2.4 GHz band, while also simultaneously streaming 3D HD content and other demanding applications smoothly on the 5 GHz band.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img style="border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/lagfree.jpg" alt="" width="400" height="163" /></p>\r\n</div>\r\n<div class="column last" style="border-image: initial; font-style: inherit; font-family: inherit; float: right; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Optimized and Reliable Wireless Coverage via Ai Radar</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">ASUS Ai Radar intelligently strengthens connections to wireless devices. With high-powered amplification and beam package, it provides optimized signals in any direction with better coverage to improve data throughput.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img class="center" style="margin-top: 0px; margin-right: auto; margin-bottom: 0px; margin-left: auto; border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; display: block; padding: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/signals.jpg" alt="" width="400" height="208" /></p>\r\n</div>\r\n</div>\r\n<br style="padding: 0px; margin: 0px;" />\r\n<div class="columns_ab" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<div class="column" style="border-image: initial; font-style: inherit; font-family: inherit; float: left; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Easy Setup Through Your Tablet, Smartphone, or PC</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">With the RT-N66U, setup is simple. Simply power and connect the router and then open a bowser on a Wi-Fi-enabled device like a laptop or tablet. You will be taken to a setup page with a prompt to enter the ID/password from your Internet provider and that&rsquo;s it! Now setting up your network is easier than ever.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img style="border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/easysetup.jpg" alt="" width="400" height="244" /></p>\r\n</div>\r\n<div class="column last" style="border-image: initial; font-style: inherit; font-family: inherit; float: right; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Powerful functions, easiest management</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">With the ASUSWRT Dashboard UI, setup, monitor, and control network applications all in one intuitive area. The whole new dashboard interface lets you manage all clients and settings on a single graphical interface and provides 1-click updates.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img class="center" style="margin-top: 0px; margin-right: auto; margin-bottom: 0px; margin-left: auto; border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; display: block; padding: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/management.jpg" alt="" width="400" height="316" /></p>\r\n</div>\r\n</div>\r\n<br style="padding: 0px; margin: 0px;" />\r\n<div class="columns_ab" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<div class="column" style="border-image: initial; font-style: inherit; font-family: inherit; float: left; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Optimize Your Network for You</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Do you game a lot, or spend most of your time streaming videos? Whatever your planned use is, the RT-N66U has a Quality of Service (QoS) that lets you select how much bandwidth is prioritized for virtually any task. Plus, the traffic monitor allows you to check your Web usage in a clear and graphical interface.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img style="border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/webflow.jpg" alt="" width="400" height="277" /></p>\r\n</div>\r\n<div class="column last" style="border-image: initial; font-style: inherit; font-family: inherit; float: right; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Two Multi-Functional Built-in USB ports</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Featuring connectivity to devices, FTPs, SAMBA, UPnP AV servers, and DLNA support, the RT-N66U makes sharing and networking easier with two built-in USB ports. Download HTTP, FTP, and P2P files to a router-connected USB storage device all day without the need of PC. Additionally, the twin USB ports allow network printer and file server connections, so you perform multiple tasks at once.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img class="center" style="margin-top: 0px; margin-right: auto; margin-bottom: 0px; margin-left: auto; border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; display: block; padding: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/backio.jpg" alt="" width="400" height="279" /></p>\r\n</div>\r\n</div>\r\n<br style="padding: 0px; margin: 0px;" />\r\n<div class="columns_ab" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<div class="column" style="border-image: initial; font-style: inherit; font-family: inherit; float: left; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Download and Stream From Anywhere</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Download Master and DLNA server lets you download and play multimedia files stored on a router-attached USB storage device on DLNA-compatible devices such as PC, tablet, PS3, XBOX, and Internet TV. Download Master can also download files while a PC is turned off, and allows you to manage and monitor download status remotely.</p>\r\n<img style="border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/downloadstream.jpg" alt="" width="400" height="295" /></div>\r\n<div class="column last" style="border-image: initial; font-style: inherit; font-family: inherit; float: right; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Powerful Online Multitasking up to 300,000 Data Sessions</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Support f or a massive data pipeline of up to 300,000 data sessions means the RT-N66U has around 20 times the networking capacity of other conventional routers for exceptionally smooth performance.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img class="center" style="margin-top: 0px; margin-right: auto; margin-bottom: 0px; margin-left: auto; border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; display: block; padding: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/session.jpg" alt="" width="400" height="178" /></p>\r\n</div>\r\n</div>\r\n<br style="padding: 0px; margin: 0px;" />\r\n<div class="columns_ab" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<div class="column" style="border-image: initial; font-style: inherit; font-family: inherit; float: left; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Separate and Secure Wi-Fi Network via Guest Network Access</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">The RT-N66U supports up to three wireless networks over the 2.4 GHz band and three over the 5 GHz band, so it can protect computers from any unauthorized access, hacking and virus attacks. The parental control allows you to set up your kids'' computer access times.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img style="border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/parentalcontrol.jpg" alt="" width="400" height="157" /></p>\r\n</div>\r\n<div class="column last" style="border-image: initial; font-style: inherit; font-family: inherit; float: right; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">VPN Server Enabled</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Easily set up a VPN server to surf the Web and access data&mdash;no matter where you are. Featuring MPPE encryption, your data transmission will be secure and confidential.</p>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img class="center" style="margin-top: 0px; margin-right: auto; margin-bottom: 0px; margin-left: auto; border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; display: block; padding: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/map.jpg" alt="" width="350" height="191" /></p>\r\n</div>\r\n</div>\r\n<br style="padding: 0px; margin: 0px;" />\r\n<div class="columns_ab" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<div class="column" style="border-image: initial; font-style: inherit; font-family: inherit; float: left; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0px; border: 0px initial initial;">Flexible Installation with Versatile Design</h3>\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">Wall-mountable, the RT-N66U fits nearly any space in the home or office.</p>\r\n</div>\r\n<div class="column last" style="border-image: initial; font-style: inherit; font-family: inherit; float: right; width: 426px; padding: 0px; margin: 0px; border: 0px initial initial;"><br style="padding: 0px; margin: 0px;" /><br style="padding: 0px; margin: 0px;" />\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;"><img class="center" style="margin-top: 0px; margin-right: auto; margin-bottom: 0px; margin-left: auto; border-style: initial; border-color: initial; font-style: inherit; font-family: inherit; display: block; padding: 0px;" src="http://usa.asus.com/websites/global/products/PZkFHlMrGWzVROxT/installation.jpg" alt="" width="400" height="200" /></p>\r\n</div>\r\n</div>\r\n</span></div>\r\n</div>\r\n<p><span style="color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: xx-small;"><br /></span></p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(207, 'EN', 'Asus USB-N53', '', '', '<p>&nbsp;</p>\r\n<div id="product_content_area" class="component_style" style="padding-top: 40px; padding-right: 40px; padding-bottom: 20px; padding-left: 40px; border-image: initial; font-size: 12px; font-family: Arial, Helvetica, sans-serif; background-image: url(http://usa.asus.com/images/overview_bg.gif); background-attachment: scroll; background-origin: initial; background-clip: initial; background-color: #ffffff; position: relative; float: left; width: 870px; z-index: 1; color: #222222; line-height: 18px; background-position: 50% 0%; background-repeat: no-repeat repeat; margin: 0px; border: 0px initial initial;">\r\n<div id="overview" class="clearfix" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;"><span id="ctl00_ContentPlaceHolder1_ctl00_overview1_span_overview" style="border-image: initial; font-style: inherit; font-family: inherit; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<p style="padding-top: 0px; padding-bottom: 0px; margin-top: 0px; margin-right: 0px; margin-bottom: 4em; margin-left: 0px; border-image: initial; font-style: inherit; font-family: inherit; border: 0px initial initial;">The ASUS USB-N53 is a dual-band USB adapter that provides flexible dual-band connection for lag-free streaming and high performance networking. It also has a superior antenna design for extensive wireless coverage. With the bundled USB cable, you can flexibly adjust the antenna to receive the strongest signal. A friendly user interface utility allows you to install and use the application easily, making the USB-N53 a fantastic router both at home and on the road.</p>\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.4em; margin-left: 0px; border-image: initial; font-weight: normal; font-style: inherit; font-size: 21px; font-family: inherit; color: #0090ff; line-height: 1; background-image: none; height: auto; padding: 0p