xx-small;"><br /></span></p>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(208, 'EN', 'H.264 Megapixel Surveillance Camera TL-SC3430', '', '', '<p>&nbsp;</p>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">What This Product Does</h3>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt;"><span style="font-family: Arial, sans-serif;" lang="EN-US">With its built-in high performance 1.3Mega-Pixel sensor, the TL-SC3430 is excellent for homes, shops, banks, offices and other building surveillance where clearer video and more image detail are required. What is more exciting is that wherever users are, high definition video can be delivered to them with the most fluidity, through a standard web browser or 3G device so that users will be to stay close to what they care for most.<br />With simple installation, event alerts, 2-way audio and other practical functions, the TL-SC3430 is a perfect solution for the advanced viewer with attention to detail.</span></p>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">1.3 Megapixel HD Video for Identification Surveillance</h3>\r\n<div style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;">Equipped with high performance 1.3Mega-Pixel sensor, it can provide HD images that are more useful, with more image detail and with wider scope for identification, such as faces of people or a car&rsquo;s license plate.</div>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">Advanced H.264 Codec Delivers Beautifully Smooth Video</h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 19px; text-align: left; background-color: #ffffff;">&nbsp;H.264 is an advanced video compression technology that greatly reduces the size of a digital video file (up to 80%) without compromising video quality compared with video quantity. Using H.264 provides savings in network bandwidth and storage costs, as well as achieves much higher video quality for a given bit rate.&nbsp;</p>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">Intelligent Surveillance Functionality</h3>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt;"><span style="font-family: Arial, sans-serif;" lang="EN-US">Motion detection settings make the camera record automatically and alert you via an e-mail when motion is detected.&nbsp;</span></p>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">Multiple Easy Remote Viewing Options</h3>\r\n<div style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;">TP-LINK''s TL-SC3430 is compliant with 3GPP protocols, so users can look in on their cameras from 3G mobile Phones, laptops or tablets, such as Android&nbsp;<span style="font-size: 9pt;">&trade;</span>&nbsp;phones or 3G enabled iPads&nbsp;<span style="font-size: 9pt;">&trade;</span>.</div>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">16-channel Management Software</h3>\r\n<div style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;">The TL-SC3430&rsquo;s bundled surveillance software assists users with managing multiple cameras at the same time. With it, video from 16 cameras can be displayed on one screen. Users can archive streamed video and audio straight to their hard drives, playback video, and monitor up to 16 cameras on a single screen.</div>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">2-Way Audio Communication</h3>\r\n<div style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: left; background-color: #ffffff; line-height: 18pt; padding: 0px; margin: 0px;">With the TL-SC3430&rsquo;s built-in microphone or one purchased separately, users can hear what&rsquo;s happening within range of their cameras remotely. What&rsquo;s more , by connecting an external speaker to the TL-SC3430, users may also speak to someone near the camera or give a public address depending on the speaker&rsquo;s strength. This brings users more convenience allowing for better communication when monitoring their cameras from a remote location.</div>\r\n<h3 style="padding-top: 14px; padding-right: 0px; padding-bottom: 14px; padding-left: 0px; font-size: 20px; font-weight: normal; font: normal normal normal 20px/1 ''Trebuchet MS'', Arial, Helvetica, sans-serif; color: #333333; text-align: left; background-color: #ffffff; margin: 0px;">Easy Remote Access-DDNS &amp; UPnP</h3>\r\n<div style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 19px; text-align: left; background-color: #ffffff; padding: 0px; margin: 0px;">Eliminating the need for users to remember a numeric IP address, the TL-SC3430&rsquo;s DDNS feature enables users to remotely access the camera by typing an easy-to-remember domain name (e.g. www.mycamera.com) into their browser. This feature comes in handy, especially when the camera&rsquo;s IP address is always changed by users&rsquo; Internet Service Providers. Even more convenient is if the camera is connected with a router and set up in a local area network, the router&rsquo;s UPnP function can facilitate access to the camera without any complicated configuration of the router or camera.<br /><br /></div>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(209, 'EN', 'HP Scanjet G3110 Scanner', '', '', '<p>&nbsp;</p>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;">Make your photos, documents, slides, and negatives all look great by scanning them at 4800 x 9600<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">dpi</a>resolution<sup style="font-size: 0.8em;">1</sup>. Our Scanjet G3110 Photo Scanner comes with software that removes red eye, removes dust and scratches, and restores vibrant color to your old, faded images.</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/l2698a_open_left.jpg" alt="Top surface with slides" /></p>\r\n</div>\r\n<div class="col59pctL" style="float: left; width: 303px; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Excellent quality, affordable price</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Get great scans</strong>of black-and-white and color photos with the 4800 x 9600<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">dpi</a>and 48-bit color</li>\r\n<li><strong>Remove red eye</strong>from scanned photos</li>\r\n<li><strong>Bring out the detail</strong>in dark photos, plus restore faded colors</li>\r\n<li><strong>Correct most flaws</strong>and scratches from damaged photos</li>\r\n</ul>\r\n</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px; width: 329px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Versatile flatbed design</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Scan four 35 mm slides,</strong>five negatives, or three 4 x 6" photos at once, then save to separate files</li>\r\n<li><strong>Archive important records</strong>and documents: the G3110 scans sizes up to 8.5 x 11"</li>\r\n<li><strong>Get realistic</strong>scans of 3-D items, capturing more detail and depth (ideal for photos for on-line auctions)</li>\r\n<li><strong>Create word-processing files</strong>and PDFs from scanned documents with the included optical character recognition software</li>\r\n<li><strong>Scan directly to e-mail</strong>for quick and easy sharing</li>\r\n<li><strong>Print copies</strong>of scanned documents using a one-touch button and default printer</li>\r\n</ul>\r\n</div>\r\n<div class="fr" style="float: right; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-bottom: 10px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/l2698a_portsview_right.jpg" alt="View of side ports" /></p>\r\n</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px; width: 329px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Fast and easy</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Save time</strong>on common jobs with scan shortcuts</li>\r\n<li><strong>Use four one-touch buttons</strong>for common tasks: scan, copy, scan to e-mail, scan to PDF</li>\r\n<li><strong>Organize, edit,</strong>print, share, and save scanned photos with the included HP Photosmart Essential Software</li>\r\n<li><strong>Connect to a PC</strong>for optimal scan transfer speeds with Hi-Speed USB 2.0</li>\r\n</ul>\r\n</div>\r\n<div class="fr" style="float: right; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-bottom: 10px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/l2698a_top_right.jpg" alt="View of top buttons" /></p>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">First-class warranty and support</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Get peace of mind</strong>with the 90-day limited warranty and toll-free phone support</li>\r\n<li><strong>Find answers</strong>to your product questions online, 24 x 7, at our Consumer Support Forum, HP.com/support/consumer-forum</li>\r\n</ul>\r\n</div>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;">\r\n<h2 class="theme_ruled" style="font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;">What''s in the box?</h2>\r\n<p class="fl mt10 mr10" style="margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;"><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" longdesc="http://www.shopping.hp.com/product/scanner/photo/1/storefronts/L2698A%2523B1H" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/products/l2698a_150.gif" border="0" alt="HP Scanjet G3110 Scanner" width="150" height="100" /></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Scanner</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>USB cable</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Power cord and supply</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>CDs with software and instructions</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Set-up poster</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>IRIS registration flyer</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Warranty statement</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; margin-top: 10px; padding: 10px;">\r\n<h2 class="theme_ruled" style="font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;">Compatible with</h2>\r\n<p class="fl mt10 mr10" style="margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;"><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_windows_compatible.gif" alt="Windows compatible" width="20" height="15" /><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_compatible_mac.gif" alt="Mac compatible" width="20" height="15" /></p>\r\n</div>\r\n<p>&nbsp;</p>', '', '', '', '', '');
INSERT INTO `cscart_product_descriptions` (`product_id`, `lang_code`, `product`, `shortname`, `short_description`, `full_description`, `meta_keywords`, `meta_description`, `search_words`, `page_title`, `age_warning_message`) VALUES
(210, 'EN', 'HP Photosmart Plus e-All-in-One Printer - B210a', '', '', '<p>&nbsp;</p>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;">Touch your way to easy, affordable printing with our Photosmart Plus e-All-in-One &ndash; B210a. You''ll get affordable lab-quality photos, everyday documents, creative projects, and Web pages. Plus, HP<a class="udrline" style="color: #003366; text-decoration: underline;" href="http://www.hp.com/go/eprintbanner" target="_blank">ePrint</a><sup style="font-size: 0.8em;">1</sup>and<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">integrated wireless</a>will keep you connected on the go.<sup style="font-size: 0.8em;">1, 2</sup></div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/cn216a_right_facing.jpg" alt="HP Photosmart Plus e-All-in-One - B210a, right facing image" /></p>\r\n</div>\r\n<div class="col59pctL" style="float: left; width: 303px; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Easy and affordable</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Print photos and documents,</strong>make copies, and scan&mdash;all without turning on your PC</li>\r\n<li><strong>Get lab-quality,</strong>smudge-resistant photos that last<sup style="font-size: 0.8em;">3</sup></li>\r\n<li><strong>Use the automatic photo tray</strong>tray for easy picture printing</li>\r\n<li>Share photos with friends<sup style="font-size: 0.8em;">4</sup>via Snapfish</li>\r\n<li><strong>Have fun</strong>with photos using the included software</li>\r\n<li><strong>Print affordably</strong>with individual HP inks; save money with our high-capacity XL cartridges (sold separately) for frequent printing</li>\r\n<li><strong>Get templates</strong>for calendars and games with HP<a class="udrline" style="color: #003366; text-decoration: underline;" href="http://h71036.www7.hp.com/hho/us/en/ep/articles/quick-forms.html" target="_blank">Quick Forms</a><sup style="font-size: 0.8em;">4</sup></li>\r\n</ul>\r\n</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px; width: 329px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Quick Web printing, no PC</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Print from the Web without a PC</strong>&mdash;photos, coupons, recipes, greeting cards and more with customizable<a class="udrline" style="color: #003366; text-decoration: underline;" href="http://www.hp.com/go/eprintcenter" target="_blank">print apps</a><sup style="font-size: 0.8em;">4</sup></li>\r\n<li><strong>Use the intuitive</strong>TouchSmart screen to make copies, photo reprints, and scans</li>\r\n<li><strong>Print and share</strong>from multiple PCs via the<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">integrated wireless</a><sup style="font-size: 0.8em;">2</sup></li>\r\n<li><strong>Just touch a button</strong>to print wirelessly<sup style="font-size: 0.8em;">5</sup></li>\r\n<li><strong>Print wirelessly</strong>from a smartphone with our<a class="udrline" style="color: #003366; text-decoration: underline;" href="http://www.hp.com/go/mobile-printing-solutions" target="_blank">mobile printing apps</a><sup style="font-size: 0.8em;">6</sup></li>\r\n</ul>\r\n</div>\r\n<div class="fr" style="float: right; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-bottom: 10px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/cn216a_top_view.jpg" alt="HP Photosmart Plus e-All-in-One - B210a, top view image" /></p>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">If you can e-mail it, you can print it</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Print directly</strong>to your HP printer using a smartphone, laptop, or other mobile device with HP ePrint</li>\r\n<li><strong>Print from your iPad, iPhone, or iPod touch</strong><sup style="font-size: 0.8em;">7</sup>wirelessly with<a class="udrline" style="color: #003366; text-decoration: underline;" href="http://www.hp.com/go/airprint" target="_blank">AirPrint</a></li>\r\n</ul>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Helping conserve resources</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Save energy</strong>with this efficient, ENERGY STAR<sup style="font-size: 0.8em;">&reg;</sup>qualified machine</li>\r\n<li><strong>Recycle:</strong>return your cartridges via our Planet Partners program<sup style="font-size: 0.8em;">8</sup></li>\r\n</ul>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Peace of mind</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Protect your investment</strong>with the one-year limited warranty plus and one year of toll-free tech support</li>\r\n<li><strong>Get product questions answered</strong>toll-free, 24 x 7, or via e-mail in as little time as an hour</li>\r\n<li><strong>Get exclusive offers</strong>and discounts on supplies, shop from your own supplies list, and get free next-day shipping with "My Print Rewards"</li>\r\n</ul>\r\n</div>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;">\r\n<h2 class="theme_ruled" style="font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;">What''s in the box?</h2>\r\n<p class="fl mt10 mr10" style="margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;"><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" longdesc="http://www.shopping.hp.com/product/printer/Photosmart/1/storefronts/CN216A%2523B1H" src="http://hpshopping.speedera.net/s7d2.scene7.com/is/image/HPShopping/full3_fmt/cn216a_main.jpg" border="0" alt="HP Photosmart Plus e-All-in-One Printer - B210a" width="150" height="100" /></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Printer</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Power supply</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Power cord</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Accessory bag</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>HP 564 black cartridge (approx. 250 pages)</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>HP 564 cyan, magenta, yellow cartridge (approx. 300 pages each)</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>CD with software</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Reference guide</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; margin-top: 10px; padding: 10px;">\r\n<h2 class="theme_ruled" style="font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;">Compatible with</h2>\r\n<p class="fl mt10 mr10" style="margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;"><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_windows_compatible.gif" alt="Windows compatible" width="20" height="15" /><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_compatible_mac.gif" alt="Mac compatible" width="20" height="15" /></p>\r\n</div>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(211, 'EN', 'HP Officejet Pro 8600 Premium e-All-in-One Printer', '', '', '<p>&nbsp;</p>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;">View apps on our Officejet Pro 8600A Premium e-All-in-One''s large touchscreen. Get networking and versatile performance; get professional-color documents for a cost per page of up to 50% lower than with laser printers.<sup style="font-size: 0.8em;">1</sup>You can even print from a mobile device via HP<a class="udrline" style="color: #003366; text-decoration: underline;" href="http://www.hp.com/go/eprintbanner" target="_blank">ePrint</a>.<sup style="font-size: 0.8em;">2</sup></div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Professional color, economical price</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Get great-looking color</strong>for a cost per page of up to 50% lower than with lasers, and get better value with frequent printing<sup style="font-size: 0.8em;">3</sup></li>\r\n<li><strong>Resist fading,</strong>water and highlighter-pen smears when using HP Officejet inks<sup style="font-size: 0.8em;">4, 5</sup></li>\r\n<li><strong>Print at ISO speeds up to 20 ppm black</strong>and 16 color when using our affordable individual inks<sup style="font-size: 0.8em;">6</sup></li>\r\n<li><strong>Rely on the 25,000-page</strong>monthly<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">duty cycle</a></li>\r\n</ul>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Web connectivity and mobile printing</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Print from virtually anywhere,</strong>and from a variety of mobile devices, using HP ePrint</li>\r\n<li><strong>Use the large touchscreen</strong>with gesturing to access business apps, plus print and store files</li>\r\n<li><strong>View and print photos</strong>from a USB drive and<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">memory cards</a></li>\r\n<li><strong>Stay connected</strong>&mdash;share on a wireless or wired network<sup style="font-size: 0.8em;">7</sup></li>\r\n</ul>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Versatile for copying and scanning</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Make flawless copies</strong>with the CopySmart feature</li>\r\n<li><strong>Print a one-sided copy</strong>of a two-sided ID card</li>\r\n<li><strong>Automatically print, copy, and scan</strong>on both sides of the page</li>\r\n<li><strong>Get more done</strong>with the 50-page<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">automatic document feeder</a></li>\r\n<li><strong>Improve workflow</strong>&mdash;send faxes, scan documents to a PC or e-mail, and more</li>\r\n<li><strong>Create borderless, double-sided flyers</strong>and brochures, plus print impressive business photos</li>\r\n<li><strong>Use original HP ink</strong>for quality, reliability and rewards<sup style="font-size: 0.8em;">8</sup></li>\r\n</ul>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Energy and resource saver</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Reduce energy use</strong>by up to 50% compared with laser printers with this ENERGY STAR<sup style="font-size: 0.8em;">&reg;</sup>qualified printer<sup style="font-size: 0.8em;">9</sup>and preset on/off times</li>\r\n<li><strong>Use up to 70% less in supplies</strong>and packaging by weight, compared with laser printers<sup style="font-size: 0.8em;">10</sup></li>\r\n<li><strong>Automatically print two-sided</strong>with the<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">automatic document feeder</a>; cut your paper use in half</li>\r\n<li><strong>Recycle</strong>your cartridges&mdash;it''s free and easy<sup style="font-size: 0.8em;">11</sup></li>\r\n</ul>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Peace of mind</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Protect your investment</strong>with World-class service and support. One-year limited hardware warranty, 24-hour, 7 days a week Web support, business hour phone support within warranty period.</li>\r\n</ul>\r\n</div>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;">\r\n<p class="tinygray" style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: #666666; font-size: 10px;"><span style="font-size: small; color: #000000;">What''s in the box?</span></p>\r\n</div>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;">\r\n<p class="fl mt10 mr10" style="margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;"><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" longdesc="http://www.shopping.hp.com/product/printer/Officejet+Pro/1/storefronts/CN577A%2523B1H" src="http://hpshopping.speedera.net/s7d2.scene7.com/is/image/HPShopping/full3_fmt/cn577a_main.jpg" border="0" alt="HP Officejet Pro 8600 Premium e-All-in-One Printer" width="150" height="100" /></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Printer</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Automatic two-sided printing accessory</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Second 250 sheet input tray</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>HP 950 Setup Black Officejet Ink Cartridge (~ 1,000 pages)</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>HP 951 Setup Cyan Officejet Ink Cartridge</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>HP 951 Setup Magenta Officejet Ink Cartridge</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>HP 951 Setup Yellow Officejet Ink Cartridge: composite yield (~ 700 pages),</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Second set of color cartridges</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Power cord</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Phone cord</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Set-up poster</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Getting started guide</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>In-house marketing kit</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>CDs with software, Windows and Mac printer drivers, user guide</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; margin-top: 10px; padding: 10px;">\r\n<h2 class="theme_ruled" style="font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;">Compatible with</h2>\r\n<p class="fl mt10 mr10" style="margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;"><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_windows_compatible.gif" alt="Windows compatible" width="20" height="15" /><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/logos/icon_compatible_mac.gif" alt="Mac compatible" width="20" height="15" /></p>\r\n</div>\r\n<p>&nbsp;</p>', '', '', '', '', ''),
(212, 'EN', 'Panasonic KX-MB2000 24PPM 3-in-1 Monochrome Laser MFP', '', '', '<p>&nbsp;</p>\r\n<h3 style="border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;">Robust Feature Set &amp; Superior Ease of Use.</h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;">The KX-MB2000 includes standard printing, color scanning, and copying capabilities to meet the demands of todays businesses. The KX-MB2000 boasts a highly reliable print engine with an easy open clam shell design which makes consumable replacement and the removal of the occasional paper jam extremely easy. In addition, the KX-MB2000 includes a 10/100 Base-TX Ethernet interface for convenient device sharing in multi-user office environments, not to mention the ability to remotely manage and configure the device using a standard internet browser.</p>\r\n<h3 style="border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;">High Speed, Professional-Quality Laser Printing</h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;">The KX-MB2000 is capable of outputting up to 24 professional quality documents per minute<sup style="border-image: initial; font-size: 7px; font: inherit; display: inline; line-height: 7px; padding: 0px; margin: 0px; border: 0px initial initial;">1</sup>&nbsp;at 600 x 600 DPI. The KX-MB2000 includes a Host Based GDI printer driver which has been optimized for maximum printing productivity. The advanced printing features of the GDI printer driver include the ability to add watermarks to printed documents, print or create document Overlays, merge up to 16 documents on a single sheet of paper, or enlarge your document to a wall size poster.</p>\r\n<h3 style="border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;">PC &amp; Network Document Scanner</h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;">The built in document flatbed on the KX-MB2000, is able to scan documents directly to a PC, E-mail, shared network folder or FTP server. Scanned documents can be saved as a PDF, JPG, TIFF or BMP file. The KX-MB2000 is capable of scanning documents in full color with resolutions up to 19,200 x 19,200 dpi (Interpolated).</p>\r\n<h3 style="border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;">Convenient Desktop Copier</h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;">The KX-MB2000 can also be used a desktop copy machine, utilizing the standard document flatbed. The KX-MB2000 offers many convenient copy features, such as Image Repeat, N in 1 Copy, Separate N in 1 Copy, Quick ID Copy and Proof Copy.</p>\r\n<h3 style="border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;">Panasonic Multifunction Station Suite Software</h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;">The KX-MB2000 comes bundled with the Panasonic Multifunction Station Suite Software, which includes all the software and utilities for the device. The bundled software suite includes; Panasonic''s Multi-function viewer software which allows you to view scanned documents, remotely adjust the device configuration with the Remote control utility, and the Device Manager Application which provides a real time view of the devices current state.</p>\r\n<h3 style="border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; color: #000000; line-height: 12px; padding: 0px; margin: 0px; border: 0px initial initial;">Advanced Document Management</h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; font-family: Arial, Helvetica, sans-serif; line-height: 16px; color: #40474b; border: 0px initial initial;">The KX-MB2000 features Panasonic''s newest software application, the Panasonic Easy Print Utility. This intuitive application allows you to merge multiple documents into a single print job, which can then be previewed from your computers monitor before actual printing, to ensure the document layout is correct without wasting paper and toner. In addition, the KX-MB2000 includes a copy of Readiris Pro 7, which will allow you to convert your digital documents into text editable file formats.</p>', '', '', '', '', ''),
(213, 'EN', 'Intel Boxed Intel Core i7-2600', '', '', '<p>&nbsp;</p>\r\n<div class="proc-spec-title" style="outline-style: none; outline-width: initial; outline-color: initial; padding-top: 0px; padding-right: 0px; padding-bottom: 8px; padding-left: 0px; border-image: initial; font: inherit; vertical-align: baseline; font-family: intel-neo-sans-1, intel-neo-sans-2, Tahoma, Helvetica, sans-serif; font-size: 14px; color: #666666; background-color: #ffffff; margin: 0px; border: 0px initial initial;">Intel&reg; Boxed Intel&reg; Core&trade; i7-2600 Processor (8M Cache, 3.40 GHz) FC-LGA10 Desktop Processor Specification</div>\r\n<p>&nbsp;</p>\r\n<table style="outline-style: none; outline-width: initial; outline-color: initial; border-image: initial; font: inherit; vertical-align: baseline; border-collapse: collapse; width: 289px; color: #666666; font-family: intel-neo-sans-1, intel-neo-sans-2, Tahoma, Helvetica, sans-serif; line-height: 16px; background-color: #ffffff; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<tbody style="outline-style: none; outline-width: initial; outline-color: initial; border-image: initial; font: inherit; vertical-align: baseline; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<tr style="outline-style: none; outline-width: initial; outline-color: initial; border-image: initial; font: inherit; vertical-align: baseline; height: 21px; padding: 0px; margin: 0px; border: 0px initial initial;">\r\n<td class="proc-spec-table-row-odd" style="outline-style: none; outline-width: initial; outline-color: initial; padding-top: 4px; padding-right: 0px; padding-bottom: 4px; padding-left: 0px; border-image: initial; font: inherit; vertical-align: baseline; font-family: intel-neo-sans-1, intel-neo-sans-2, tahoma, helvetica, sans-serif; font-size: 12px; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #f2f2f2; margin: 0px; border: 0px initial initial;">