(227, 'EN', 'Acer 3D Series HN274H bmiiid', '', '', '<p><span style="font-family: Helvetica, Arial, Verdana; font-size: 12px; line-height: 20px; text-align: left; background-color: #ffffff; color: #000000;">27" Widescreen LCD display - 1920 x 1080 resolution - 100,000,000:1 contrast ratio - white LED backlight - 2ms response time - integrated speakers - HDMI&reg; - USB - DVI - VGA - adjustable display angle - 3D ready - 3-year limited warranty</span></p>', '', '', '', '', '');
