"><img style="border-style: initial; border-color: initial; font-size: 12px; font: inherit; vertical-align: baseline; padding: 0px; margin: 0px;" src="http://www.lg.com/us/images/monitors/features/left-module-2d-3d-connected-462x302.jpg" alt="" width="465" height="265" /></span></div>\r\n</div>\r\n<div class="text-col narrow" style="margin-top: 15px; margin-right: 10px; margin-bottom: 0px; margin-left: 0px; padding-top: 10px; padding-right: 0px; padding-bottom: 0px; padding-left: 40px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; width: 375px; float: left; height: auto; border: 0px initial initial;">\r\n<div class="feature-block feature-block2" style="margin-top: 16px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; padding: 0px; border: 0px initial initial;">\r\n<h3 style="margin-top: 0px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; border-image: initial; font-size: 20px; font: inherit; vertical-align: baseline; font-weight: normal; font-family: BryantLGMedium; text-transform: uppercase; padding: 0px; border: 0px initial initial;">GET&nbsp;<span style="border-image: initial; font-size: 20px; font: inherit; vertical-align: baseline; color: #d80546; padding: 0px; margin: 0px; border: 0px initial initial;">CONNECTED</span></h3>\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 12px; margin-left: 0px; padding-top: 0px; padding-bottom: 0px; border-image: initial; font-size: 12px; font: inherit; vertical-align: baseline; border: 0px initial initial;">Get deeper colors, take advantage of full HD and connect 3D devices experience with HDMI connectivity even without a PC. LG CINEMA 3D monitor makes it possible to view 3D content, whether from a game console, blu-ray disc&trade; player, set-top box or another source. Prepare yourself for tomorrow''s technology today.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</p>', '', '', '', '', ''),
(217, 'EN', 'ASUS CP6230', '', '', '<p>The ASUS CP6230 features a space-saving design with a hexagonal pattern lid that easily fits anywhere in your home. It draws you in with its elegant aesthetics but holds your attention with its computer power to tackle any task.</p>', '', '', '', '', ''),
(218, 'EN', 'ASUS Essentio CP1130', '', '', '<p>The ASUS new Essentio CP1130 has sleek appearance and small size make it perfectly fit anywhere in your home. At the same time, it provides complete function and delivers ultimate performance for daily computing.</p>', '', '', '', '', ''),
(219, 'EN', 'Series 3 15.6" Laptop', '', '', '<p>Don''t be weighed down by wasted time, let your PC come alive when you need it. Your life happens on the go, you don''t have time to wait for PC to shut down and power up. With Samsung''s exclusive Fast Start technology, simply close the lid to enter a hybrid sleep mode. When you open the lid, you are up and running in less than 3 sec.</p>', '', '', '', '', ''),
(220, 'EN', 'Series 7 Chronos 14 Notebook', '', '', '<p>Cutting edge design: Sleek aluminum, a stunning screen, cutting edge performance, all seamlessly blended in one of the world&rsquo;s thinnest quad core PC.</p>', '', '', '', '', ''),
(221, 'EN', 'Series 9 13.3" Laptop', '', '', '<p>You no longer have to shut down your Samsung computer, just close its lid and it goes into a special powerless sleep mode. When you open the lid your computer comes back to life in 3 seconds and you are exactly at the same place as when you shut the lid. Fast Start saves your data and system configurations to your hard drive and PC memory. So, when you power it back on it is just like you left it.</p>', '', '', '', '', ''),
(222, 'EN', 'Series 3 15.6" Laptop', '', '', '<p>Don''t be weighed down by wasted time, let your PC come alive when you need it. Your life happens on the go, you don''t have time to wait for PC to shut down and power up. With Samsung''s exclusive Fast Start technology, simply close the lid to enter a hybrid sleep mode. When you open the lid, you are up and running in less than 3 sec.</p>', '', '', '', '', ''),
(223, 'EN', 'Samsung Galaxy Tab 8.9 (Wi-Fi Only) - 32GB Metallic Gray', '', '', '<p>If you buy the wrong tablet, you&rsquo;re at the mercy of the manufacturer regarding how much you can customize or personalize your screens. But the beauty of Android is that you have much greater flexibility to arrange things however you want. You&rsquo;ll have multiple home screens to compose and design, plus live wallpapers to express your mood and personality. The Tab also offers you the freedom of TouchWiz&reg;, the intuitive user interface that allows you to quickly drag and drop your icons, widgets and Live Panels with only the touch of a finger. Now, reorganizing your tablet&rsquo;s menus and navigational options will be simple and straightforward.</p>', '', '', '', '', ''),
(224, 'EN', 'Samsung Galaxy Tab 8.9 (AT&T)', '', '', '<p>Your eyes have never seen such rich, luscious color. And at 1280x800, the resolution is well above normal HD standards. Of course, everything about the Tab is above normal.</p>', '', '', '', '', ''),
(225, 'EN', 'Samsung Galaxy Tab 7.0" (Verizon)', '', '', '<p>The Samsung Galaxy Tab&trade; brings you the media you want and keeps you connected with anyone, anytime. Compact and light, you can keep in touch with people and content through 3G connectivity, Wi-Fi&reg; 802.11 b/g/n, Bluetooth&reg; Wireless Technology 3.0. With a battery life of up to seven hours* and a crisp TFT-LCD display, you&rsquo;re free to communicate, update, and enjoy.</p>', '', '', '', '', ''),
(229, 'EN', 'HP 2711x 27" LED Monitor', '', '', '<p>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px; padding-bottom: 10px;">Maximize your home PC experience with our 2711x 27" LED Monitor. You''ll enjoy movies, photos, on-line<sup style="font-size: 0.8em;">1</sup>games, and streamed shows on your PC in brilliant color on this ultra-slim, energy-saving monitor.</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/xp600aa_front_facing_left_cut.jpg" alt="HP 2711x 27" /></p>\r\n</div>\r\n<div class="col59pctL" style="float: left; width: 303px; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Superior technology</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Go ultra-slim:</strong>LED backlighting reduces the number and overall size of the components</li>\r\n<li><strong>See the detail:</strong>get deep blacks, brilliant color, and clarity with the ultra-high dynamic<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">contrast ratio</a></li>\r\n<li><strong>Switch on/off</strong>faster than with a CCFL (standard) monitor</li>\r\n</ul>\r\n</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px; width: 329px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Spacious and spectacular</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Expand your view</strong>of Web pages, videos, and documents; see two application Windows at once on the 27" LED screen</li>\r\n<li><strong>Immerse yourself</strong>in cinema-like movies and realistic on-line gaming with the Full HD<sup style="font-size: 0.8em;">2</sup>1920 x 1080 resolution</li>\r\n<li><strong>Minimize blur</strong>in sports broadcasts, action movies, and on-line games with the 5 ms on/off response time</li>\r\n<li><strong>Reduce glare</strong>and sharpen images with the BrightView technology</li>\r\n</ul>\r\n</div>\r\n<div class="fr" style="float: right; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-bottom: 10px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/BrightView_1.jpg" alt="HP 2711x 27" /></p>\r\n</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/xp600aa_side_view.jpg" alt="HP 2711x 27" /></p>\r\n</div>\r\n<div class="col59pctL" style="float: left; width: 303px; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Sleek design, enhanced features</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Save space</strong>and complement your HP desktop or laptop PC with the stylish, ultra-slim design (about 1" deep)</li>\r\n<li><strong>Connect</strong>to your HP desktop or laptop via VGA, HDCP-supported<a class="dotline" style="color: #003366; border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #003366; cursor: default;">HDMI</a>, or DVI-D input</li>\r\n<li><strong>Find the best</strong>viewing position with the tilt adjustment and ability to slide from left to right</li>\r\n</ul>\r\n</div>\r\n<div class="fl" style="float: left; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-bottom: 10px; width: 329px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">Eco highlights</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Help protect the environment:</strong>this model is ENERGY STAR<sup style="font-size: 0.8em;">&reg;</sup>5.0 qualified and EPEAT Silver registered</li>\r\n<li><strong>Lower your impact</strong>on the environment with the mercury-free LED backlighting</li>\r\n<li><strong>Be eco-conscious</strong>with the arsenic-free display glass<sup style="font-size: 0.8em;">3</sup>, recyclable plastic parts, and recyclable packaging</li>\r\n</ul>\r\n</div>\r\n<div class="fr" style="float: right; color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-bottom: 10px;">\r\n<p style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px;"><img style="border-style: initial; border-color: initial; padding: 0px; margin: 0px;" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/overview/xp600aa_right_facing.jpg" alt="HP 2711x 27" /></p>\r\n</div>\r\n<div style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding-left: 10px; padding-right: 10px;">\r\n<h3 class="cb large mb5" style="font-size: 14px; margin-bottom: 5px; margin-top: 1px; clear: both;">First-class warranty and support</h3>\r\n<ul style="margin-top: 0px; margin-bottom: 10px; margin-left: 20px; padding: 0px;">\r\n<li><strong>Get peace of mind</strong>with the one-year limited warranty plus real-time chat and e-mail response in about an hour</li>\r\n<li><strong>Find answers</strong>to product questions online, 24 x 7, at our Consumer Support Forum, hp.com/support/consumer-forum</li>\r\n</ul>\r\n</div>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;">\r\n<p class="tinygray" style="margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: #666666; font-size: 10px;">1. Internet access required, sold separately.<br />2. HD content required to view HD images.<br />3. Arsenic and its compounds were not detected using US EPA Test Methods 3052 and 3052/6010b by ICP or ICP-AES.</p>\r\n</div>\r\n<div class="p10" style="color: #000000; font-family: Arial, Verdana, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;">\r\n<h2 class="theme_ruled" style="font-size: small; margin-bottom: 0px; margin-top: 1px; border-bottom-width: 4px; border-bottom-style: solid; padding-bottom: 1px; border-color: #000000;">What''s in the box?</h2>\r\n<p class="fl mt10 mr10" style="margin-top: 10px; margin-right: 10px; margin-bottom: 10px; margin-left: 0px; float: left;"><img style="border-style: initial; border-color: initial; display: inline; padding: 0px; margin: 0px;" longdesc="http://www.shopping.hp.com/product/display/display/1/storefronts/XP600AA%2523ABA" src="http://hpshopping.speedera.net/www.shopping.hp.com/shopping/images/products/xp600aa_150.gif" border="0" alt="HP 2711x 27&quot; LED Monitor" width="150" height="100" /></p>\r\n</div>\r\n</p>\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Monitor</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>External power supply</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Power cable</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>VGA cable</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>DVI-D cable</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Cable clip management</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>CD with instructions</td>\r\n</tr>\r\n<tr>\r\n<td width="10" valign="top">&bull;</td>\r\n<td>Warranty card</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', '', '', '', ''),
(230, 'EN', '2011 Pit Boss', '', '', '<p>Hydration Capacity: 100 oz (3 L)<br /><br />Total Capacity: 1800 cu in (29.50 L)<br /><br />CamelBak&reg; Got Your Bak&trade; Guarantee: If we built it, we''ll Bak it&trade; with our lifetime guarantee. <br /><br />Reservoir Features: Quick Link&trade; System, 1/4 turn - easy open/close cap, lightweight fillport, dryer arms, center baffling and low-profile design, patented Big Bite&trade; Valve, HydroGuard&trade; technology, insulated PureFlow&trade; tube, easy-to-clean wide-mouth opening<br /><br />BACK PANEL: Air Director&trade; Snowshed&trade;<br /><br />HARNESS: Therminator&trade; provides easy access for frequent sipping, insulated and fully enclosed to protect against freezing<br /><br />BELT: Load-bearing with cargo<br /><br />Additional Features: <br />Versatile Snowboard / Ski Carry (Diagonal, Vertical or Horizontal), tri-zip quick gear access, gear compression, goggle pocket, essentials pocket<br />Drop-out Probe Pocket for instant probe access -- locate survivors without unloading your pack<br /><br />Designed to carry: skis/snowboard, shovel, probe, skins, snowshoes, helmet, goggles, extra layers, lunch, tools, camera, phone, wallet, keys</p>', '', '', '', '', ''),
(231, 'EN', '2011 Tycoon', '', '', '<p>Hydration Capacity: 100 oz (3 L)<br /><br />Total Capacity: 1125 cu in (18.44 L)<br /><br />CamelBak&reg; Got Your Bak&trade; Guarantee: If we built it, we''ll Bak it&trade; with our lifetime guarantee. <br /><br />Reservoir Features: Quick Link&trade; System, 1/4 turn - easy open/close cap, lightweight fillport, dryer arms, center baffling and low-profile design, patented Big Bite&trade; Valve, HydroGuard&trade; technology, insulated PureFlow&trade; tube, easy-to-clean wide-mouth opening<br /><br />BACK PANEL: Snowshed&trade;<br /><br />HARNESS: Therminator&trade; provides easy access for frequent sipping, insulated and fully enclosed to protect against freezing<br /><br />BELT: Load-bearing<br /><br />Additional Features: <br />Snowboard / Ski Carry (Diagonal, Vertical or Horizontal), pack compression, goggle pocket, essentials pocket<br />Drop-out Probe Pocket for instant probe access -- locate survivors without unloading your pack<br /><br />Designed to carry: skis/snowboard, shovel, probe, skins or snowshoes, goggles, extra layer, snack, phone, wallet, keys</p>', '', '', '', '', ''),
(232, 'EN', '2011 Ice Queen', '', '', '<p>Hydration Capacity: 70 oz (2 L)<br /><br />Total Capacity: 1000 cu in (16.39 L)<br /><br />CamelBak&reg;Got Your Bak&trade; Guarantee: If we built it, we''ll Bak it&trade; with our lifetime guarantee. <br /><br />Reservoir Features: 1/4 turn - easy open/close cap, lightweight fillport, dryer arms, center baffling and low-profile design, patented Big Bite&trade; Valve, HydroGuard&trade; technology, insulated PureFlow&trade; tube, easy-to-clean wide-mouth opening<br /><br />BACK PANEL: Snowshed&trade;<br /><br />HARNESS: S-Curved Women''s Harness; Therminator&trade; provides easy access for frequent sipping, insulated and fully enclosed to protect against freezing<br /><br />BELT: Removable 1" (25 mm) stability<br /><br />Additional Features: <br />Tri-Zip design allows easy access to all your gear, compresion, goggle pocket, essentials pocket<br /><br />Designed to carry: Helmet, goggles, extra layers, lunch, phone, wallet, keys</p>', '', '', '', '', ''),
(233, 'EN', 'Crystal Lake Warm Weather Sleeping Bag', '', '', '<p>&bull;  Coleman&reg; warm weather sleeping bags made for camping temperatures between 40 and 60 degrees<br />&bull;  Rectangle shape, 33&rdquo; x 75&rdquo;, fits up to 5&rsquo;11&rdquo; tall<br />&bull;  3 pounds of ThermoTech&reg; insulation<br />&bull;  Cotton cover with soft cotton liner<br />&bull;  Essential camping gear, sleeping bag for a better night outdoors<br />&bull;  Don&rsquo;t forget the Coleman&reg; camping tent to go with your sleeping bags<br />&bull;  ComfortSmart&trade; Technology includes:<br />&bull;  ZipPlow&trade; plows fabric away from zipper to prevent snags<br />&bull;  ComfortCuff&trade; surrounds your face with softness<br />&bull;  Roll Control&trade; locks bag in place for easier rolling<br />&bull;  FiberLock&trade; prevents insulation from shifting, increases durability<br />&bull;  ThermoLock&trade; construction reduces heat loss through the zipper, keeping you warmer<br />&bull;  ZipperGlide&trade; tailoring allows smooth zipper operation around the corners<br />&bull;  QuickCord&trade; for easy, no tie closure<br />&bull;  Commercial Machine washable<br />&bull;  Five year limited warranty<br />&bull;  Made in China</p>', '', '', '', '', ''),
(234, 'EN', 'White Water Cool Weather Sleeping Bag', '', '', '<p>&bull;  Coleman&reg; cool weather sleeping bags made for camping temperatures between 30 and 50 degrees<br />&bull;  Rectangle shape, big &amp; tall 39&rdquo; x 84&rdquo;, fits up to 6&rsquo;4&rdquo; tall<br />&bull;  4 pounds of Coletherm&reg; insulation<br />&bull;  Polyester cover with cotton flannel liner<br />&bull;  Groundbreaking headrest shape makes keeping your head off the ground or floor easy<br />&bull;  Essential camping gear, sleeping bag for a better night outdoors<br />&bull;  Don&rsquo;t forget the Coleman&reg; camping tent to go with your sleeping bags<br />&bull;  ComfortSmart&trade; Technology includes:<br />&bull;  ZipPlow&trade; plows fabric away from zipper to prevent snags<br />&bull;  ComfortCuff&trade; surrounds your face with softness<br />&bull;  Roll Control&trade; locks bag in place for easier rolling<br />&bull;  FiberLock&trade; prevents insulation from shifting, increases durability<br />&bull;  ThermoLock&trade; construction reduces heat loss through the zipper, keeping you warmer<br />&bull;  ZipperGlide&trade; tailoring allows smooth zipper operation around the corners<br />&bull;  QuickCord&trade; for easy, no tie closure<br />&bull;  Commercial Machine washable<br />&bull;  Five year limited warranty<br />&bull;  Made in China</p>', '', '', '', '', ''),
(235, 'EN', 'Everglades Cold Weather Sleeping Bag', '', '', '<p>&bull;  The perfect sleeping bag for extreme sleeping conditions between 10 and 30 degrees<br />&bull;  3 lbs Coletherm&reg; insulation<br />&bull;  33&rdquo; x 85&rdquo;, fits up to 5&rsquo;11&rdquo; tall<br />&bull;  Diamond ripstop cover to polyester liner<br />&bull;  Double-batt, offset quilt construction eliminates potential cold spots<br />&bull;  Essential camping gear, sleeping bag for a better night outdoors<br />&bull;  Semi-sculpted hood surrounds head with warmth, keeps head off the ground<br />&bull;  Fleece foot section provides extra warmth<br />&bull;  Two way zipper for maximum ventilation<br />&bull;  Stuff sack included<br />&bull;  Made in China<br />&bull;  Commercial Machine washable<br />&bull;  Five year limited warranty</p>', '', '', '', '', ''),
(236, 'EN', 'WeatherMaster Screened 6 Tent With Hinged Door', '', '', '<p>&bull;  6 person tent/ 2 rooms<br />&bull;  17''x9'' footprint<br />&bull;  Cabin structure; heavier, stronger, better for extended stay camping<br />&bull;  6 ft. 10 in. center height<br />&bull;  2 Doors - Front Door is Hinged (Patent Pending)<br />&bull;  Strong steel and fiberglass frame<br />&bull;  Control airflow with Variflo&trade; adjustable ventilation<br />&bull;  Privacy vent window<br />&bull;  Interior gear pocket<br />&bull;  Electrical access port<br />&bull;  Reverse angle windows<br />&bull;  Easy set up with continuous, color coded pole sleeves and shock-corded poles<br />&bull;  Easy instructions sewn into durable carry bag<br />&bull;  Carry bag also includes separate sacks for poles and stakes<br />&bull;  Fly: Polyester taffeta 75D <br />&bull;  Mesh: Polyester 68D inner tent<br />&bull;  Floor: Polyethylene 1000D-140g/sqm floor<br />&bull;  Limited 1 year warranty<br />&bull;  Made in China</p>', '', '', '', '', ''),
(237, 'EN', 'Elite Evanston 8 Tent', '', '', '<p>&bull;  8 person/1 room tent<br />&bull;  12''x12'' footprint<br />&bull;  Exclusive WeatherTec&trade; System<br />Keeps you dry -- Guaranteed&trade;<br />&bull;  Modified dome structure, easy to transport and simple to set up<br />&bull;  6 ft. 2 in. center height<br />&bull;  Hinged door (patent pending)<br />&bull;  Great for family camping, scout leaders, extended camping trips<br />&bull;  Self-rolling windows (patent pending)<br />&bull;  Tent includes remote controlled light<br />&bull;  Light is 100 lumens<br />&bull;  Control airflow with Variflo&trade; adjustable ventilation<br />&bull;  Privacy vent window<br />&bull;  Interior gear pocket<br />&bull;  Electrical access port<br />&bull;  Front Porch and Wings provide great outdoor living space<br />&bull;  Easy set up with continuous, color coded pole sleeves and shock-corded poles<br />&bull;  Easy instructions sewn into durable carry bag<br />&bull;  Carry bag also includes separate sacks for poles and stakes<br />&bull;  Fly: Polyester taffeta 75D <br />&bull;  Mesh: Polyester 68D inner tent<br />&bull;  Floor: Polyethylene 1000D-140g/sqm floor<br />&bull;  Poles: 11 mm, 7.9 mm and 6.3 mm fiberglass<br />&bull;  Limited 1 year warranty<br />&bull;  Made in China</p>', '', '', '', '', '');
