(238, 'EN', 'Apple iPhone 4S Black', '', '', '<p>16GB iPhone 4S locked AT&amp;T model. Will work on AT&amp;T. Now you can use your voice to use your iPhone. Just talk to Siri as you would to a person: "Do I need an umbrella?" or "Any great burgers around here?" or "Where''s the closest ATM?" Siri not only understands what you say, it knows what you mean.1 It figures out the right apps to use to find the right answer. Then, just like a personal assistant, it answers you. Siri makes phone calls, sends messages, schedules meetings, sets reminders, and more. How much more? Just ask, and Siri tells you that, too. Two cores in the A5 chip deliver up to two times more power and up to seven times faster graphics.2 And you''ll feel the effects. Fast. iPhone 4S is quick and responsive, which makes all the difference when you''re launching apps, browsing the web, gaming, and doing just about everything. And no matter what you''re doing, you can keep on doing it. Because the A5 chip is so power-efficient, iPhone 4S has outstanding battery life. This just might be the best camera ever on a phone. And with all-new optics, it just might be the only camera you need. Because behind every shot, you''ve got 8-megapixel resolution and a custom lens with a larger f/2.4 aperture. Not to mention an improved backside illumination sensor, excellent auto white balance, advanced color accuracy, face detection, and reduced motion blur. It all means that no matter how many people, how much light, and how much action you capture, everything looks exactly as it should. And just wait until you see the photos. Shoot stunning 1080p HD video everywhere you go. With all-new optics, the light is always right, the color is always vivid, and everything will look even better than you remember. Video stabilization steadies shaky shots. And you can edit video right on iPhone and share your lush life as fast as you shoot.</p>', '', '', '', '', ''),
(239, 'EN', 'Apple iPhone 4S White', '', '', '<p>16GB iPhone 4S locked AT&amp;T model. Will work on AT&amp;T. Now you can use your voice to use your iPhone. Just talk to Siri as you would to a person: "Do I need an umbrella?" or "Any great burgers around here?" or "Where''s the closest ATM?" Siri not only understands what you say, it knows what you mean.1 It figures out the right apps to use to find the right answer. Then, just like a personal assistant, it answers you. Siri makes phone calls, sends messages, schedules meetings, sets reminders, and more. How much more? Just ask, and Siri tells you that, too. Two cores in the A5 chip deliver up to two times more power and up to seven times faster graphics.2 And you''ll feel the effects. Fast. iPhone 4S is quick and responsive, which makes all the difference when you''re launching apps, browsing the web, gaming, and doing just about everything. And no matter what you''re doing, you can keep on doing it. Because the A5 chip is so power-efficient, iPhone 4S has outstanding battery life. This just might be the best camera ever on a phone. And with all-new optics, it just might be the only camera you need. Because behind every shot, you''ve got 8-megapixel resolution and a custom lens with a larger f/2.4 aperture. Not to mention an improved backside illumination sensor, excellent auto white balance, advanced color accuracy, face detection, and reduced motion blur. It all means that no matter how many people, how much light, and how much action you capture, everything looks exactly as it should. And just wait until you see the photos. Shoot stunning 1080p HD video everywhere you go. With all-new optics, the light is always right, the color is always vivid, and everything will look even better than you remember. Video stabilization steadies shaky shots. And you can edit video right on iPhone and share your lush life as fast as you shoot.</p>', '', '', '', '', ''),
(240, 'EN', 'Apple iPad 2 Black', '', '', '<p>The all-new thinner and lighter design makes iPad 2 even more comfortable to hold. It''s even more powerful with the dual-core A5 chip, yet has the same 10 hours of battery life. 1 With two cameras, you can make FaceTime video calls,2 record HD video and put a twist on your snapshots in Photo Booth. And the iPad Smart Cover attaches magnetically and wakes up, stands up and brightens up your iPad 2.3 Product Features 9.7" LED-backlit display with IPS technology Dual-core A5 chip Front and back cameras Up to 10 hours of battery life Built-in Wi-Fi (802.11a/b/g/n) 3G data service with AT&amp;T (data plan sold separately) Bluetooth 2.1 + EDR technology 16GB flash storage Over 65,000 apps made for iPad, available from the App Store</p>', '', '', '', '', ''),
(241, 'EN', 'Apple iPad 2 White', '', '', '<p>The all-new thinner and lighter design makes iPad 2 even more comfortable to hold. It''s even more powerful with the dual-core A5 chip, yet has the same 10 hours of battery life. 1 With two cameras, you can make FaceTime video calls,2 record HD video and put a twist on your snapshots in Photo Booth. And the iPad Smart Cover attaches magnetically and wakes up, stands up and brightens up your iPad 2.3 Product Features 9.7" LED-backlit display with IPS technology Dual-core A5 chip Front and back cameras Up to 10 hours of battery life Built-in Wi-Fi (802.11a/b/g/n) 3G data service with AT&amp;T (data plan sold separately) Bluetooth 2.1 + EDR technology 16GB flash storage Over 65,000 apps made for iPad, available from the App Store</p>', '', '', '', '', ''),
(242, 'EN', 'Apple iPod Classic Black', '', '', '<p>With 160GB of storage, iPod classic can hold up to 40,000 songs, 200 hours of video, or 25,000 photos.** That&rsquo;s more than enough room for a day&rsquo;s &mdash; or a lifetime&rsquo;s &mdash; worth of entertainment.</p>', '', '', '', '', ''),
