(261, 'EN', 'Nike Chambray Super Runner Men''s Jacket [CLONE]', '', '<p>The  timeless Windrunner design gets a premium upgrade in the Nike Chambray  Super Runner Men''s Jacket. Created with tough, water-resistant fabric  and a mesh lining, this jacket combines breathability and protection  from the elements.</p>', '<div class="text description black-white">\r\n<div class="product-description-component">\r\n<p><strong>The Nike Chambray Super Runner Jacket: A durable, updated classic </strong></p>\r\n<br />\r\n<p>The timeless Windrunner design gets a premium upgrade in the Nike Chambray Super Runner Men''s Jacket. Created with tough, water-resistant fabric and a mesh lining, this jacket combines breathability and protection from the elements.</p>\r\n<br />\r\n<p><strong>Benefits</strong></p>\r\n<ul>\r\n<li>Hood with drawcord for an adjustable fit</li>\r\n<li>Overlay at yoke and raglan sleeves for style and enhanced protection</li>\r\n<li>Rib cuffs and hem for a fit that stays in place</li>\r\n<li>Mesh lining for enhanced ventilation</li>\r\n<li>Durable, wind-resistant fabric to protect against the elements</li>\r\n</ul>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<ul>\r\n<li>Side zip pockets for secure storage</li>\r\n<li>Fabric: Body: 100% cotton. Lining and overlay: 100% polyester.</li>\r\n<li>Machine wash</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>\r\n</div>', '', '', '', '', ''),
(262, 'EN', 'Nike Chambray Super Runner Men''s Jacket [CLONE] [CLONE]', '', '<p>The  timeless Windrunner design gets a premium upgrade in the Nike Chambray  Super Runner Men''s Jacket. Created with tough, water-resistant fabric  and a mesh lining, this jacket combines breathability and protection  from the elements.</p>', '<div class="text description black-white">\r\n<div class="product-description-component">\r\n<p><strong>The Nike Chambray Super Runner Jacket: A durable, updated classic </strong></p>\r\n<br />\r\n<p>The timeless Windrunner design gets a premium upgrade in the Nike Chambray Super Runner Men''s Jacket. Created with tough, water-resistant fabric and a mesh lining, this jacket combines breathability and protection from the elements.</p>\r\n<br />\r\n<p><strong>Benefits</strong></p>\r\n<ul>\r\n<li>Hood with drawcord for an adjustable fit</li>\r\n<li>Overlay at yoke and raglan sleeves for style and enhanced protection</li>\r\n<li>Rib cuffs and hem for a fit that stays in place</li>\r\n<li>Mesh lining for enhanced ventilation</li>\r\n<li>Durable, wind-resistant fabric to protect against the elements</li>\r\n</ul>\r\n<br />\r\n<p><strong>Additional Details</strong></p>\r\n<ul>\r\n<li>Side zip pockets for secure storage</li>\r\n<li>Fabric: Body: 100% cotton. Lining and overlay: 100% polyester.</li>\r\n<li>Machine wash</li>\r\n<li>Imported</li>\r\n</ul>\r\n</div>\r\n</div>', '', '', '', '', ''),
