(272, 'EN', 'fun-vendor', '', '', '<p>Hydration Capacity: 100 oz (3 L)<br /><br />Total Capacity: 1125 cu in (18.44 L)<br /><br />CamelBak&reg; Got Your Bak&trade; Guarantee: If we built it, we''ll Bak it; with our lifetime guarantee. Reservoir Features: Quick Link&trade; System, 1/4 turn - easy open/close cap, lightweight fillport, dryer arms, center baffling and low-profile design, patented Big Bite&trade; Valve, HydroGuard&trade; technology, insulated PureFlow&trade; tube, easy-to-clean wide-mouth opening<br /><br />BACK PANEL: Snowshed&trade;<br /><br />HARNESS: Therminator&trade; provides easy access for frequent sipping, insulated and fully enclosed to protect against freezing<br /><br />BELT: Load-bearing<br /><br />Additional Features: <br />Snowboard / Ski Carry (Diagonal, Vertical or Horizontal), pack compression, goggle pocket, essentials pocket<br />Drop-out Probe Pocket for instant probe access -- locate survivors without unloading your pack<br /><br />Designed to carry: skis/snowboard, shovel, probe, skins or snowshoes, goggles, extra layer, snack, phone, wallet, keys</p>', '', '', '', '', ''),
